	(6, 1, '2011-04-13 23:55:14', '2011-04-13 23:55:14', 'http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/04/fiskbrasliaasasuletaguatinganorte.wordpress.2011-04-13.xml_.txt', 'fiskbrasliaasasuletaguatinganorte.wordpress.2011-04-13.xml_.txt', '', 'inherit', 'open', 'open', '', 'fiskbrasliaasasuletaguatinganorte-wordpress-2011-04-13-xml_-txt', '', '', '2011-04-13 23:55:14', '2011-04-13 23:55:14', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/04/fiskbrasliaasasuletaguatinganorte.wordpress.2011-04-13.xml_.txt', 0, 'attachment', '', 0),
	(176, 2, '2010-03-31 01:53:49', '2010-03-31 01:53:49', '<p id="materia_resumo">Conheça a unidade FISK Taguatinga Norte e venha fazer uma visita!</p>\nDesde o dia 16 de novembro de 2009 a unidade FISK em Taguatinga Norte está a todo vapor. Temos turmas de Kids, Teens, Breaking Free, Aiming at the Sky, Flying High…, além de Espanhol e Português para brasileiros. Temos turmas <a title="FISK Regular" href="queroserfisk_metodo.html">Regulares</a> e <a title="FISK Personalizado" href="queroserfisk_metodo.html/">Personalizadas</a>.\n<img class="alignleft size-full wp-image-425" title="DSC_62121270074243" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/DSC_62121270074243.jpg" alt="" width="504" height="338" />\n\n<img title="FISK Taguatinga Norte 1" src="public/uploads/DSC_62121270074243.jpg" alt="FISK Taguatinga Norte 1" />\n<br clear="all"/>\nSediada na <strong>Av. Samdú Norte QNE 24 Casa 05</strong>, o novo Centro de Ensino FISK Taguatinga Norte conta com amplas e modernas instalações:\n<ul>\n	<li>3 Salas de Ensino Personalizado</li>\n	<li>3 Salas de Ensino Regular</li>\n	<li>1 Sala de Kids</li>\n	<li>1 Laboratório Multimídia</li>\n	<li>1 Auditório Audiovisual</li>\n	<li>1 Cafeteria</li>\n	<li>2 Lounges</li>\n	<li>1 Biblioteca</li>\n</ul>\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/DSC_67141270074265.jpg" alt="" title="DSC_67141270074265" width="504" height="338" class="alignleft size-full wp-image-427" />\n<br clear="all"/>\nVeja mais fotos da unidade <a title="FISK Taguatinga Norte" href="queroserfisk_unidade_tagnorte.html/">FISK Taguatinga Norte</a>\n\nVenha fazer uma visita e se envolver na “Great atmosphere”!\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/DSC_65321270074280.jpg"><img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/DSC_65321270074280.jpg" alt="" title="DSC_65321270074280" width="504" height="338" class="alignleft size-full wp-image-428" /></a>', 'FISK Taguatinga Norte em Ação!', '', 'publish', 'open', 'open', '', 'fisk-taguatinga-norte-em-acao', '', '', '2010-03-31 01:53:49', '2010-03-31 01:53:49', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=176', 0, 'post', '', 0),
	(179, 2, '2010-03-10 01:59:08', '2010-03-10 01:59:08', '<p id="materia_resumo">Procura para estudar no país é maior do que nos EUA, diz agência. Pacotes de intercâmbio custam a partir de R$ 3,7 mil.</p>\n<p>&#8220;Foi-se o tempo que os Estados Unidos era o destino preferido dos cariocas para estudar inglês. Em busca de melhores preços, recepção amigável a estrangeiros e locais onde a violência é quase inexistente, muitos jovens do Rio estão optando por intercâmbio no Canadá.&#8221;</p>\n\n	<p>Leia a matéria completa no site do <a href="http://g1.globo.com/Noticias/Vestibular/0,,MUL1522363-5604,00-PRECO+ACESSIVEL+E+SEGURANCA+ATRAEM+CARIOCAS+PARA+INTERCAMBIO+NO+CANADA.html" title="Intercâmbio no Canadá">G1 &#8211; Globo</a>.</p>', 'Preço acessível e segurança atraem cariocas para intercâmbio no Canadá', '', 'publish', 'open', 'open', '', 'preco-acessivel-e-seguranca-atraem-cariocas-para-intercambio-no-canada', '', '', '2010-03-10 01:59:08', '2010-03-10 01:59:08', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=179', 0, 'post', '', 0),
	(181, 2, '2010-03-10 02:00:38', '2010-03-10 02:00:38', '<p id="materia_resumo">Matéria sobre o programa de intercâmbio do aluno de avançado Pedro Brasil Diehl, pertecente ao estágio Expanding Horizons, e a sua viagem realizada no último verão em Vancouver as vésperas dos Jogos Olímpicos de Inverno.</p>\n<h3>Trip to Vancouver</h3>\n\n	<p>When we arrived in a different country, the tendency is to feel lost at the first moment. It was what happened with me. I was out of the comfort that I have at home with my parents. But after that I felt how the things would happen, I was getting used to this new life. But I was still afraid of what would happen.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/diehl31268068129.jpg" alt="" title="Diehl 3" width="504" height="345" class="alignleft size-full wp-image-430" />\n\n	<p>My two first weeks were harder, but for the first time I began to think in English before I speak. Besides I have improved my fluency in the language and much more than that. First at all, I broke many biases that I had and learned to relate better with other people. I gave more importance for my family and friendships that I built during whole of my life. By the way, I found out that the Brazilian’s culture and the wealth of our food is unique. I built a family there, because my friends were with me all day long, helping me and making me happier. Because of them, everything was easier for me.</p>\n\n	<p>The top of my trip was the Olympic season. Awesome! The spirit of everyone was incredible. I practiced snowboard and skiing for some days and I created a kind of love for that sport. It was something that I will never forget. I was awful in the beginning, but after hard practice, I could do it without falling down.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/diehl21268068111.jpg" alt="" title="Diehl 2" width="504" height="378" class="alignleft size-full wp-image-432" />\n\n	<p>Analyzing everything, I became much more mature after that trip as it opened my mind for several things. I hope that young people, no matter the age, should travel abroad at least once, to immerse in this fabulous experience that is the cultural exchange.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/03/diehl11268067910.jpg" alt="" title="Diehl 1" width="504" height="339" class="alignleft size-full wp-image-433" />\n\n	<p>Pedro Brasil Diehl</p>\n', 'Trip to Vancouver', '', 'publish', 'open', 'open', '', 'trip-to-vancouver', '', '', '2010-03-10 02:00:38', '2010-03-10 02:00:38', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=181', 0, 'post', '', 0),
	(187, 2, '2010-02-22 02:10:09', '2010-02-22 02:10:09', '<p id="materia_resumo">Trabalho de Conclusão de Curso Focus on FISK Final do Aluno Milton Bassani - Julho 2009.</p>\n<h3>Sobre o Focus on FISK Final</h3>\n\n	<p>Nível Aperfeiçoamento<br />\nDuração: 50 a 55 horas<br />\nMétodo: Regular ou Personalizado<br />\nRítmo: Rápido ou Intensivo</p>\n\n	<p>O objetivo deste estágio é preparar o aluno para esse exame final, além de proporcionar-lhe uma consolidação de seus conhecimentos do idioma e de suas habilidades comunicativas. Após o <strong>Focus on FISK Final</strong>, o aluno prestará um exame para obter o certificado de conclusão do curso.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/02/81266882829.jpg" alt="" title="Bassani 1" width="504" height="619" class="alignleft size-full wp-image-435" />\n\n	<h3>Studying Abroad</h3>\n\n	<p>Today, studying abroad is much more than an opportunity of growing professionally and personally. Actually, it is a new way of interrelate, a big experience fully of discovers that certainly will broad the point of view of those ones who enter into this experience.</p>\n\n	<p>It is proved that learning a new language in a foreign country is easier than in your own country. Besides the language, you have the opportunity of knowing costumes and traditions of a people.</p>\n\n	<p>The objective of this final project is helping people that want to do an exchange but don’t have idea from where to start. It is known that is hard to find reliable information about it, and because of that, here are some information associated about courses, accommodations, cities, etc., in order to you start planning your trip.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/02/51266882915.jpg" alt="" title="Bassani 2" width="504" height="378" class="alignleft size-full wp-image-437" />\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/02/61266882953.jpg" alt="" title="Bassani 3" width="504" height="378" class="alignleft size-full wp-image-438" />\n\n	<h3>Download</h3>\n\n	<p>Leia o trabalho na íntegra: <a href="public/pdf/studyingabroad.pdf" title="Studying Abroad">Studying Abroad</a> (pdf).</p>', 'Trabalho de aluno: Studying Abroad', '', 'publish', 'open', 'open', '', 'trabalho-de-aluno-studying-abroad', '', '', '2010-02-22 02:10:09', '2010-02-22 02:10:09', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=187', 0, 'post', '', 0),
	(189, 2, '2010-02-01 02:13:15', '2010-02-01 02:13:15', '<p id="materia_resumo">Nosso sincero muito obrigado a todos os alunos, pais, professores, funcionários e amigos da família FISK ASA SUL!</p>\n<p>Completamos no último dia 07/01/2010 dois anos de funcionamento da FISK ASA SUL!</p>\n\n	<p>Foram dois anos de muito trabalho e conquistas!  Vimos ao longo deste tempo o crescimento da nossa família FISK, a medida que se passava os semestres letivos muitos outros chegaram e descobriram o que faz de nós sermos sempre comprometidos com a Excelência de ensino. </p>\n\n	<p>Trabalhamos  sempre preocupados em fazer o melhor para os nossos alunos, sabemos que a nossa responsabilidade é enorme, pois aqui existem depositados muitos sonhos, que através do nosso esforço cotidiano somado ao esforço de cada um de nossos alunos, haveremos de concretizá-los.<br />\nNão é sem justo motivo, que já ampliamos a nossa Escola, hoje temos muito mais a oferecer e esperamos muitas outras novidades em 2010.</p>\n\n	<p><strong>Nosso sincero muito obrigado a todos os alunos, pais, professores, funcionários e amigos da família FISK ASA SUL!</strong></p>\n\n	<p>Que venham muitos aniversários! Contamos com cada um de vocês para fazermos a Escola cada vez melhor!</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/02/041264200741.jpg" alt="" title="Team" width="504" height="336" class="alignleft size-full wp-image-440" />', 'Unidade FISK Asa Sul completa 2 anos de muitas vidas!', '', 'publish', 'open', 'open', '', 'unidade-fisk-asa-sul-completa-2-anos-de-muitas-vidas', '', '', '2010-02-01 02:13:15', '2010-02-01 02:13:15', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=189', 0, 'post', '', 0),
	(338, 2, '2010-09-29 15:09:53', '2010-09-29 15:09:53', 'Depois de quase um ano de espera, aconteceu no último dia 25/09 o primeiro FISK SHOP da Unidade Taguatinga Norte, foi um sábado de muita alegria onde os alunos puderam gastar os FISK DOLLARS acumulados ao longo do ano.\n\nOs alunos puderam apreciar muitas atrações incríveis: cama elástica, pescaria, jogo de argolas, caça ao tesouro, dança das cadeiras e muito mais!\n\nOs alunos usaram ainda os seus FISK DOLLARS para adquirirem  interessantes “souvenirs” além de saborearem um delicioso lanche composto por “hot dog, nuggets, pop corn and soda”.\n\nO FISK SHOP é uma “Street  market” que a FISK oferece gratuitamente aos seus alunos como forma de reconhecimento pelo bom rendimento escolar, bonificando os alunos que realmente querem estudar e avançar na língua inglesa.\n\nO acúmulo de FISK DOLLARS baseia-se em um  regulamento que abrange aspectos pedagógicos e disciplinares bem como assiduidade e interesse pelo o Inglês.\nAssim, se você estudou e curtiu o FISK SHOP, Parabéns! Ano que vem tem muito mais!\n\nCURTAM AS FOTOS DO FISK SHOP E DIVIRTAM-SE!\n\nVALEU!\n\n[nggallery id=7] ', 'FISK SHOP 2010 - TAGUATINGA NORTE', '', 'publish', 'open', 'open', '', 'fisk-shop-2011-taguatinga-norte', '', '', '2010-09-29 15:09:53', '2010-09-29 15:09:53', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1', 0, 'post', '', 0),
	(481, 2, '2011-05-02 16:16:33', '2011-05-02 16:16:33', 'Essa última semana aqui na Fisk, ocorreram grandes eventos para comemorar em grande estilo o dia da páscoa.\n<p style="text-align: left;">Foram desenvolvidas atividades durante as aulas com os alunos como pintura de rosto, confecção de tiaras e máscaras de coelho e é claro a clássica caça aos ovos!!!</p>\n<p style="text-align: left;">O evento foi um sucesso e os alunos adoraram!</p>\n[nggallery id=11] ', 'Easter 2011 - FISK Taguatinga Norte', '', 'publish', 'open', 'open', '', 'easter-2011-fisk-taguatinga-norte', '', '', '2011-05-02 16:16:33', '2011-05-02 16:16:33', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=481', 0, 'post', '', 0),
	(524, 2, '2011-05-03 00:28:20', '2011-05-03 00:28:20', '<p style="text-align: left;"><strong>O estudo, feito em todo país, indica que secretárias que dominam o inglês têm salários 68% maiores. Gerentes, 20%. Consultores, 12% e diretores, 9%.</strong></p>\n<p style="text-align: left;">Pesquisa revela que as empresas pagam mais para quem fala inglês O estudo, feito em todo país, indica que secretárias que dominam o inglês têm salários 68% maiores. Gerentes, 20%. Consultores, 12% e diretores, 9%. imprimir O gerente de recursos humanos Roberto Gomes trabalha numa multinacional. Estuda para aprimorar o inglês e crescer na empresa. “A pessoa que tem domínio de inglês, até um nível não fluente, mas avançado, certamente leva uma vantagem de cargo, alguma coisa nesse sentido porque afinal de contas num mundo globalizado a comunicação conta muito, não é verdade?”, fala Gomes. No mercado de trabalho dominar um segundo idioma é essencial. E quem fala inglês ganha bem mais. É o que mostra uma pesquisa feita em todo o país com quase 150 mil profissionais. Secretárias que dominam o inglês têm salários 68% maiores. Gerentes, 20%. Consultores, 12% e diretores, 9%. “Quando o chefe olha esse profissional que fala inglês e que está resolvendo alguns problemas onde o idioma inglês é necessário, vai significar também que esse profissional que investiu mais na carreira, que ele traz resultado e de certa forma ele já fica com certo painel de destaque dentro da empresa aonde pode receber promoções e ter um tratamento diferenciado dentro da empresa”, explica o diretor-geral da Catho online, Adriano Arruda. Segundo a pesquisa, apenas 10% dos profissionais que estão no mercado têm fluência no inglês. “Quando você quer gastar seu tempo pra aprender um idioma, mais do que aprender um terceiro ou um quarto idioma, invista no seu inglês, tenha um inglês fluente”, orienta Arruda.</p>\n<p style="text-align: left;"><a href="http://video.globo.com/Videos/Player/Noticias/0,,GIM1468754-7823-PESQUISA+REVELA+QUE+AS+EMPRESAS+BRASILEIRAS+PAGAM+MAIS+PARA+QUEM+FALA+INGLES,00.html">Assista o Vídeo - Clique aqui</a></p>', 'Pesquisa revela que as empresas pagam mais para quem fala inglês', '', 'publish', 'open', 'open', '', 'pesquisa-revela-que-as-empresas-pagam-mais-para-quem-fala-ingles', '', '', '2011-05-03 00:28:20', '2011-05-03 00:28:20', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=524', 0, 'post', '', 0),
	(541, 2, '2011-05-03 22:16:57', '2011-05-03 22:16:57', 'Pesquisa aponta que os ganhos profissionais podem dobrar. Título de mestre ou doutor pode aumentar os salários em 119,86%. <strong>Fluência no Inglês 111%</strong>. As empresas também valorizam funcionários experientes, entusiasmados e com bom relacionamento.\n\n<a href="http://video.globo.com/Videos/Player/Noticias/0,,GIM1459588-7823-DOMINIO+DE+INGLES+PODE+AUMENTAR+O+SALARIO,00.html">Assista o Vídeo - Clique aqui</a>', 'Domínio de inglês pode aumentar o salário', '', 'publish', 'open', 'open', '', 'dominio-de-ingles-pode-aumentar-o-salario', '', '', '2011-05-03 22:16:57', '2011-05-03 22:16:57', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=541', 0, 'post', '', 0),
	(544, 2, '2011-05-09 20:01:39', '2011-05-09 20:01:39', 'Semana passada aqui na Unidade Fisk Taguatinga Norte, ocorreram homenagens com apresentações dos alunos e confecções de lindos cartões para as mães!\n\nAlunos das turmas de kids participaram homenageando as mamães com a música "I love you"  - Barney Song - com direito até a coreografia. Ficou tão lindo que teve até mamãe que se derreteu em lágrimas!\n\nCada turminha escolheu uma forma diferente para apresentar e homenagear sua mãe!\n\nVamos ver algumas fotinhos pra ver o que rolou por aqui?\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-04-09.56.00.jpg"><img class="aligncenter size-large wp-image-546" title="2011-05-04 09.56.00" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-04-09.56.00-1024x768.jpg" alt="" width="640" height="480" /></a>\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-04-10.00.34.jpg"><img class="aligncenter size-large wp-image-547" title="2011-05-04 10.00.34" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-04-10.00.34-1024x768.jpg" alt="" width="640" height="480" /></a>\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-10.04.04_Brasília_Distrito-Federal_BR.jpg"><img class="aligncenter size-large wp-image-549" title="2011-05-05 10.04.04_Brasília_Distrito Federal_BR" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-10.04.04_Brasília_Distrito-Federal_BR-1024x925.jpg" alt="" width="640" height="578" /></a>\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-14.52.26_Brasília_Distrito-Federal_BR.jpg"><img class="aligncenter size-large wp-image-550" title="2011-05-05 14.52.26_Brasília_Distrito Federal_BR" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-14.52.26_Brasília_Distrito-Federal_BR-1024x768.jpg" alt="" width="640" height="480" /></a>\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-14.55.45.jpg"><img class="aligncenter size-large wp-image-551" title="2011-05-05 14.55.45" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-14.55.45-1024x1007.jpg" alt="" width="640" height="629" /></a>\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-16.01.03.jpg"><img class="aligncenter size-large wp-image-552" title="2011-05-05 16.01.03" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-16.01.03-1024x768.jpg" alt="" width="640" height="480" /></a>\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-16.03.02_Brasília_Distrito-Federal_BR.jpg"><img class="aligncenter size-large wp-image-554" title="2011-05-05 16.03.02_Brasília_Distrito Federal_BR" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/05/2011-05-05-16.03.02_Brasília_Distrito-Federal_BR-1024x768.jpg" alt="" width="640" height="480" /></a>\n\nPara você que ficou interessado em saber o que acontece na Fisk, não deixe de acessar diariamente nosso Facebook, que além de obter mais fotos e videos da homenagem de dia das mães, você acompanha tudo de pertinho do que está rolando por aqui!\n\nAcesse:\n\n<a href="http://www.facebook.com/profile.php?id=100002330713746&amp;sk=wall#!/profile.php?id=100002330713746">http://www.facebook.com/profile.php?id=100002330713746&amp;sk=wall#!/profile.php?id=100002330713746</a>', 'Mother´s Day (Dia das mães)', '', 'publish', 'open', 'open', '', 'mother%c2%b4s-day-dia-das-maes', '', '', '2011-05-09 20:01:39', '2011-05-09 20:01:39', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=544', 0, 'post', '', 0),
	(553, 2, '2011-05-09 21:07:56', '2011-05-09 21:07:56', ' O FISK SHOP é uma feira que a FISK ASA SUL oferece gratuitamente aos seus alunos como forma de reconhecimento pelo bom rendimento escolar, bonificando o empenho e esforço dos alunos.\n\nO acúmulo de FISK DOLLARS baseia-se em um regulamento que abrange aspectos pedagógicos e disciplinares, bem como assiduidade e interesse pelo inglês. Com os FISK DOLLARS adquiridos os alunos participam de brincadeiras e ainda podem comprar “souvenirs” e saborearem deliciosos lanches.\n\nAssim, o Fisk Shop 2011 Asa Sul foi o máximo!  Tivemos várias brincadeiras, jogos, pintura de rosto, lanches e muito mais! A garotada trouxe os amigos e se divertiram bastante. Valeu a pena a dedicação de cada  aluno para conquistar o Fisk dollar. Agora é só curtir as fotos!\n\n[nggallery id=14] ', 'Fisk Shop 2011-Asa Sul (veja as fotos)', '', 'publish', 'open', 'open', '', 'fisk-shop-2011-asa-sul', '', '', '2011-05-09 21:07:56', '2011-05-09 21:07:56', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=553', 0, 'post', '', 0),
	(565, 2, '2011-05-10 11:55:06', '2011-05-10 11:55:06', 'Vejam mais algumas fotos do FISK SHOP 2011 e divirtam-se!\n\n[nggallery id=15] ', 'Fisk Shop 2011- Asa Sul (+ fotos)', '', 'publish', 'open', 'open', '', 'continuacao-fisk-shop-2011-asa-sul', '', '', '2011-05-10 11:55:06', '2011-05-10 11:55:06', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=565', 0, 'post', '', 0),
	(339, 2, '2011-08-22 03:36:01', '2011-08-22 03:36:01', '<p id="materia_resumo">Desenvolva a habilidade "Speaking" no FISK SPEAK-UP SESSION</p>\nAs Escolas <strong>FISK Asa Sul e Taguatinga Norte</strong> oferecem aulas de conversação gratuitas aos alunos do curso de inglês dos níveis intermediário e avançado.  O curso de conversação passou por uma reformulação para ficar mais dinâmico e interativo.\n\nAs aulas têm carga horária de duas horas semanais e as aulas ocorrem uma vez por semana. As aulas terão início no dia 22/08. Confira as turmas, os dias e os horários das aulas.\n\nAproveite essa oportunidade! Procure a Secretaria da sua escola para obter mais informações a respeito das aulas de conversação.', 'Aulas de conversação gratuitas aos alunos (FISK SPEAK-UP SESSION)', '', 'publish', 'open', 'open', '', 'aaa-mlk', '', '', '2011-08-22 03:36:01', '2011-08-22 03:36:01', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=83', 0, 'post', '', 0),
	(586, 2, '2011-08-22 19:19:17', '2011-08-22 19:19:17', '<strong><span style="color: #000000;"><span style="font-family: Calibri;"> A Escola FISK e a FLOR DE CERRADO TURISMO convidam os alunos e seus familiares para <span style="text-decoration: underline;">24° Encontro Nacional de Alunos FISK, </span>que por certo será um passeio imperdível!</span></span></strong>\n<p style="text-align: center;"><strong><span style="font-family: Calibri; color: #000000;">WET´N WILD &amp; HOPIHARI &amp; MAIS BANDA</span></strong><a href="http://www.msplinks.com/MDFodHRwOi8vd3d3LnJlc3RhcnRzaG9wLmNvbS5icg==" target="_blank"><strong><span style="color: #555555;"><span style="font-family: Arial;"> </span></span></strong></a></p>\n<strong><span style="color: #000000;">1º DIA - 29/09/2011 (QUINTA - FEIRA) – BRASÍLIA / CAMPINAS</span></strong>\n\n<span style="color: #000000;">Apresentação às 18H no estacionamento do FISK. Saída em ônibus de luxo D.D panorâmico com: Televisão/DVD, ar condicionado, toalete, geladeira, som, guia da FLOR do Cerrado Turismo, serviço de bordo, e seguro viagem MIC.</span>\n\n<strong><span style="color: #000000;">2º DIA - 30/09/2011 (SEXTA-FEIRA) – HOTEL / WET’N WILD / HOTEL</span></strong>\n\n<span style="color: #000000;">Chegada aproximadamente às 08H no <span style="font-family: Lucida Sans;"><span style="text-decoration: underline;">Hotel Shelton inn</span>, acomodação das bagagens, café da manhã e às 09:30HS saída com destino ao Parque Aquático </span>wet’n wild, com sua fantásticas atrações, semelhantes às da Flórida nos Estados Unidos. (o passaporte inclui um dia de diversão em todas as atrações, <span style="font-family: Lucida Sans;"><strong><span style="text-decoration: underline;">com exceção</span></strong> do aluguel de bóias e armários). ÀS 17H, retorno ao hotel e em seguida saída para</span><span style="font-family: Lucida Sans;"> pizzaria (INCLUSO).</span></span>\n\n<strong><span style="color: #000000;">3º DIA - 01/10/2011 (SÁBADO) –<span style="font-family: Copperplate Gothic Bold;"> HOTEL / HOPI HARI / BRASÍLIA</span></span></strong>\n\n<span style="color: #000000;">Café da manhã no hotel e saída Com destino Parque temático HOPI HARI, onde permaneceremos até às 20H aproveitando ao máximo todas as atrações desse maravilhoso complexo de diversão, lazer e cultura.<span style="font-family: Lucida Sans;"> (o passaporte inclui um dia de diversão no Parque com todas as suas atrações, </span><span style="font-family: Lucida Sans;"><strong><span style="text-decoration: underline;">exceto:</span></strong> HADIKALI, KATAKUMB, TIROLEZA E DIVERSÕES ELETRÔNICAS). <strong>Ao anoitecer o parque tranforma-se numa balada conhecida por "<span style="text-decoration: underline;">A noite do Terror</span>"! Fecharemos o dia com o show da <span style="text-decoration: underline;">banda Restart</span>! Imperdivel! </strong></span></span><strong><span style="color: #000000;"><span style="font-family: Lucida Sans;">Às 21HS iniciaremos nossa viagem de retorno para Brasília</span>.</span></strong>\n\n<strong><span style="color: #000000;">4º DIA - 02/10/2011 (DOMINGO) BRASÍLIA - Chegada prevista às 09H na unidade do FISK e fim de nossos serviços.</span></strong>\n\n<span style="color: #000000;">O PACOTE INCLUI: </span><span style="color: #000000;">Seguro Viagem – Serviço de Bordo – Guia Acompanhante – 01 Camiseta HOPI HARI/FISK –02 Cafés da Manhã –<span style="font-family: Lucida Sans;"> 01 Rodízio de Pizza, 01 Passaporte </span><strong><span style="font-family: Lucida Sans;">HOPI HARI</span></strong></span><span style="color: #000000;"> – 01 Passaporte <strong><span style="font-family: Lucida Sans;">WET’N WILD</span></strong></span><span style="color: #000000;"> – 01 Diária no <strong><span style="font-family: Lucida Sans;">Hotel SHELTON INN.</span></strong></span>\n\n<span style="color: #000000;"> [nggallery id=17]</span>\n\n<span style="color: #000000;">O PACOTE NÃO INCLUI: qualquer outro serviço/gasto não especificado neste pacote.</span>\n\n<span style="font-family: Lucida Sans; color: #000000;"> </span>\n<div>\n<table border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td width="171" valign="top"><span style="color: #000000;">ACOMODAÇÃO</span></td>\n<td width="172" valign="top"><span style="color: #000000;">Preço por pessoa à vista</span></td>\n<td width="239" valign="top"><span style="color: #000000;">Forma de pagamento (5 X sem juros)</span></td>\n</tr>\n<tr>\n<td width="171" valign="top"><strong><span style="color: #000000;">Duplo ou Triplo</span></strong></td>\n<td width="172" valign="top"><strong><span style="color: #000000;">R$ 635,00</span></strong></td>\n<td width="239" valign="top"><strong><span style="color: #000000;">Entrada +4 CHEQUES DE R$127,00 COM DATAS: 10/06, 10/07, 10/08, 10/09&amp; 10/10/2011. </span></strong></td>\n</tr>\n</tbody>\n</table>\n</div>\n<span style="font-family: Calibri; color: #000000;"> </span>', 'Encontro Nacional de Alunos FISK!', '', 'publish', 'open', 'open', '', 'encontro-nacional-de-alunos-fisk', '', '', '2011-08-22 19:19:17', '2011-08-22 19:19:17', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=586', 0, 'post', '', 0),
	(612, 2, '2011-07-05 19:34:38', '2011-07-05 19:34:38', 'O Arraiá da Fisk Asa sul 2011 foi um sucesso! Este ano tivemos um grande público que aproveitou muito as músicas tocadas ao vivo por uma dupla sertaneja especialmente convidada. Além disso, todos puderam saborear comidas e bebidas típicas deliciosas ! Ainda houveram brinquedos para as crianças e uma pescaria de verdade com direito a levar peixinhos para casa! Agradecemos à todos que compareceram e desde já convidamos para a próxima edição da nossa tradicional festa que ocorrerá no inverno de 2012.\n\n[nggallery id=20] ', 'Nosso Arraiá 2011 - FISK Asa Sul', '', 'publish', 'open', 'open', '', 'arraia-2011-asa-sul-fotos', '', '', '2011-07-05 19:34:38', '2011-07-05 19:34:38', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=612', 0, 'post', '', 0),
	(651, 2, '2011-08-29 11:14:13', '2011-08-29 11:14:13', '<p style="text-align: justify;"><strong>A criação de postos de trabalho na Copa do Mundo amplia a procura pelas escolas de idioma. No ano passado os cursos contabilizaram maior demanda de estudantes</strong></p>\n\n<div style="text-align: justify;">\n<p style="text-align: justify;"><strong>MAYCON FIDALGO\n<a href="mailto:mfidalgo@jornaldacomunidade.com.br">mfidalgo@jornaldacomunidade.com.br</a></strong></p>\nRedação Jornal da Comunidade\n\n</div>\n<div>\n<p style="text-align: justify;">Depois do dia 30 de outubro de 2007, quando o Brasil foi  anunciado como sede da Copa do Mundo e dos Jogos Olímpicos, em 2014 e 2016, respectivamente, cresceu a procura em várias escolas de idiomas do Distrito Federal. A demanda pelo aprendizado de uma segunda língua aumentou e, com ela, a promessa de trabalho nos eventos esportivos.</p>\n<p style="text-align: justify;">Taxistas, garçons, recepcionistas, vendedores e profissionais que, em geral, se relacionam com uma grande quantidade de pessoas estão se preparando para receber cerca de 600 mil turistas internacionais. Destes, mais de 206 mil são esperados em Brasília, mostra pesquisa da Fundação Getulio Vargas (FGV), encomendada pelo Ministério do Turismo (MTur). Após a África do Sul sediar o certame desportivo realizado a cada quatro anos pela Federação Internacional de Futebol (Fifa), houve registro de meio milhão de visitantes naquele país e calcula-se que 130 a 250 mil empregos foram gerados durante o Mundial.</p>\n<p style="text-align: justify;">Uma das 12 cidades-sede da Copa, o Distrito Federal se destacará em segmentos que variam do comércio varejista ao setor hoteleiro. “Apesar de os eventos esportivos serem uma oportunidade para o Brasil, é também uma faca de dois gumes. Se não estivermos preparados, muitos voltarão falando mal da recepção brasileira”, acredita Adelmir Santana, presidente da Federação do Comércio de Bens, Serviços e Turismo do Distrito Federal (Fecomércio/DF). Ele acha que, por ser o Mundial um evento de curta duração, é importante as pessoas serem bem capacitadas para receber os visitantes. “Temos de conquistá-los para que retornem ao Brasil depois do torneio”, esclarece.</p>\n\n<div style="text-align: justify;">\n<div><img title="Jefferson Henry, diretor da unidade Fisk na Asa Sul e Taguatinga Norte, diz que a ideia do curso nasceu com a Copa de 2014" src="http://comunidade.maiscomunidade.com/imagem/783e65c30c34ff6f3b69f48c219824055d6f24e9" alt="Jefferson Henry, diretor da unidade Fisk na Asa Sul e Taguatinga Norte, diz que a ideia do curso nasceu com a Copa de 2014" /></div>\n<div>Jefferson Henry, diretor das unidades Fisk na Asa Sul e Taguatinga Norte, diz que a ideia do curso nasceu com a Copa de 2014</div>\n</div>\n<p style="text-align: justify;">Com 15 milhões de alunos formados em seus 53 anos de existência, a Fisk criou um curso específico de idioma para os profissionais que trabalharão na Copa. O programa de estudo é um dos pioneiros em relação aos eventos desportivos: “Ficamos muito tempo formulando esse curso, desde quando o Brasil foi anunciado como sede da Copa. Há dois anos a escola aprimora o material para fazer algo diferenciado”, afirma Jefferson Henry, diretor das unidades da Fisk na Asa Sul e Taguatinga Norte.</p>\n<p style="text-align: justify;">O método de ensino comunicativo tem como objetivo capacitar o estudante na língua inglesa através de dramatizações nas aulas. As simulações englobarão aspectos importantes, introduzindo o profissional em situações costumeiras, como barganhar, ajudar visitantes e instruir clientes. “A ideia das lições segue o modelo de ‘aula-laboratório’, na qual a conversação será o ponto principal”, explica Jefferson.</p>\n<p style="text-align: justify;">Divulgado no Congresso em Mogi das Cruzes, o curso é direcionado a profissionais dos setores alimentício, comercial, turístico, hoteleiro e até mesmo de transporte. O material May I help you?, composto por dois livros, foi planejado pela Richard Hugh Fisk Foundation: “Houve muita procura, as pessoas estavam preocupadas com o Mundial. A Fisk de São Paulo, sabendo disso, montou esse programa pensando nessa demanda, que já era um pouco reprimida”, diz o diretor.</p>\nVeja a reportagem na íntegra no link abaixo:\n\n<a href="http://comunidade.maiscomunidade.com/conteudo/2011-08-06/educacao/4774/HORA-DE-APRENDER-OUTRA-LINGUA.pnhtml">http://comunidade.maiscomunidade.com/conteudo/2011-08-06/educacao/4774/HORA-DE-APRENDER-OUTRA-LINGUA.pnhtml</a>\n\n</div>', 'FISK no Jornal da Comunidade: Hora de aprender outra língua', '', 'publish', 'open', 'open', '', 'fisk-no-jornal-da-comunidade-hora-de-aprender-outra-lingua', '', '', '2011-08-29 11:14:13', '2011-08-29 11:14:13', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=651', 0, 'post', '', 1),
	(1109, 2, '2013-06-10 21:28:16', '2013-06-10 21:28:16', 'Neste ano de 2013 a FISK realizou o café da manhã de dia das mães, com o intuito de homenagear aquelas que representam o dom da criação, da doação e do amor incondicional.\r\n\r\nO evento foi repleto de carinho e alegria, tendo como ponto alto ver nossos alunos se relacionando com suas mães e demonstrando os trabalhos realizados em homenagem  à elas.\r\n\r\nConfira abaixo as fotos do evento realizados nas três unidades Fisk, Asa Sul, Asa Norte e Taguatinga Norte.\r\n\r\n[nggallery id=37]', 'Café da manhã em homenagem às mães!', '', 'inherit', 'open', 'open', '', '1097-revision-11', '', '', '2013-06-10 21:28:16', '2013-06-10 21:28:16', '', 1097, 'http://dev.webfacetecnologia.com.br/fisk/2013/06/1097-revision-11/', 0, 'revision', '', 0),
	(801, 2, '2011-09-24 20:54:12', '2011-09-24 20:54:12', 'Conheça os 50 anos da História do Centro de Ensino FISK. Há mais de 50 anos, a Fisk se dedica ao ensino de idiomas. Teve como base o inglês, incorporou o espanhol posteriormente e em 2008, introduziu o ensino de informática e o de português para brasileiros. Sua história começa com Richard H. Fisk , um americano nascido em Tunbridge, Vermont, que se apaixonou pelo Brasil em uma visita realizada em 1950. Graduado em lnternational Relations e com o diploma Master of Arts pela School of Advanced International Studies, Johns Hopkins University, em Washington, D.C., Mr. Fisk, como é conhecido, decidiu permanecer no Brasil e passou a lecionar inglês no país. Criou um método próprio, com base na solução das dificuldades específicas que os brasileiros apresentam ao aprender inglês. O sucesso do método Fisk gerou um crescimento vertiginoso, ampliando a escola para uma rede com quase 1.000 unidades, muitas delas franquias, espalhadas pela América do Norte e Sul, África e Ásia. Em 1992, foi criada a Fundação Richard H. Fisk, responsável pelas escolas Fisk, pela PBF – escola de idiomas, pela gráfica Support e pela Larry Publicidade e Propaganda. A Fundação Richard Hugh Fisk tem como norte os seguintes valores:…', 'Quero ser FISK', '', 'publish', 'open', 'closed', '', 'quero-ser-fisk', '', '', '2017-02-01 03:07:45', '2017-02-01 03:07:45', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/quero-ser-fisk/', 1, 'nav_menu_item', '', 0),
