	(802, 2, '2011-09-24 20:54:12', '2011-09-24 20:54:12', 'Divirta-se e aprimore seu Inglês ou Espanhol ON LINE! Só aqui você encontra o FISKNET, um portal de jogos interativos e curiosidades que a FISK preparou para você se divertir enquanto revisa o conteúdo aprendido em sala de aula. Você que é FISK ou quer ser FISK jogue agora mesmo o FISK MENTOR, FISK ENIGMA, FISK NET LAB e FISK QUIZ e outros jogos irados no nosso site! Acesse o FISK NET', 'Sou FISK', '', 'publish', 'open', 'closed', '', 'sou-fisk', '', '', '2017-02-01 03:07:45', '2017-02-01 03:07:45', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/sou-fisk/', 11, 'nav_menu_item', '', 0),
