	(837, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Conheça nossos Cursos. Na FISK, crianças a partir de 4 anos já começam a se comunicar em inglês. Veja quais as opções que a FISK oferece para crianças, jovens e adultos. Veja os Cursos de Inglês   Na FISK, Espanhol agora começa mais cedo. Confira abaixo as opções que a FISK oferece para adolescentes, jovens e adultos: Veja os Cursos de Espanhol   Não tropece mais! Aprimore suas habilidades de escrita e fala com a FISK. Veja os Cursos de Português   Mantenha-se atualizado e profissionalize-se com nossos diversos cursos de Informática! Veja os Cursos de Informática    ', '', '', 'publish', 'open', 'closed', '', '837', '', '', '2017-02-01 02:47:44', '2017-02-01 02:47:44', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/837/', 4, 'nav_menu_item', '', 0),
	(838, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Venha conhecer a nossa Unidade da Asa Sul!   O Centro de Ensino FISK Asa Sul conta uma moderna infraestrutura, composta por: 3 Salas de aula para o Ensino Regular; 3 Salas para o Ensino Personalizado; 1 Sala de KIDS; 1 Laboratório Multimídia; 1 Auditório audiovisual; 1 “Learning Center” com computadores conectados na internet; 1 Biblioteca; 1 Lounge na área externa. Tudo isso preparado para propocionar o que há de mais moderno no Ensino de Idiomas e Informática fazendo da nossa Escola um “Great place!” para aprender! Venha e conheça a nossa atmosfera! Na FISK você aprende fazendo amigos! Join us! Eventos HALLOWEEN 2010 – FISK ASA SUL, 06 NOV Aulas de conversação gratuitas aos alunos (FISK SPEAK-UP SESSION), 14 AGO Ganhadores da Promoção FISK na Copa 2010!, 30 JUN FISK no Hopi Hari 2010, 24 JUN Arraiá do Hexa 2010, 24 JUN FISK na Copa 2010!, 11 JUN A importância de saber outro idioma para a carreira, 10 JUN Muita diversão no FISK Shop 2010!, 28 ABR Unidade FISK Asa Sul completa 2 anos de muitas vidas!, 01 FEV FISK Shop 2009 – Asa Sul, 22 JAN  ', '', '', 'publish', 'open', 'closed', '', '838', '', '', '2017-02-01 02:47:44', '2017-02-01 02:47:44', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/838/', 5, 'nav_menu_item', '', 0),
	(839, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Conheça a FISK Taguatinga Norte!   Venha estudar conosco! Temos um Centro de Ensino todo feito pra você! Na FISK Taguatinga Norte você encontra: 3 Salas de Ensino Personalizado; 3 Salas de Ensino Regular; 1 Sala de Kids; 1 Laboratório Multimídia; 1 Auditório Audiovisual; 1 Cafeteria; 2 Lounges; 1 Biblioteca. Fazemos uma Escola melhor por quê temos e melhor Ensino! Venha estudar em um ambiente moderno e com uma “Great atmosphere!”. Come to us! Eventos Halloween 2010 – FISK TAG. NORTE, 10 NOV FISK SHOP 2010 – TAGUATINGA NORTE, 29 SET Ganhadores da Promoção FISK na Copa 2010!, 30 JUN FISK no Hopi Hari 2010, 24 JUN FISK na Copa 2010!, 11 JUN A importância de saber outro idioma para a carreira, 10 JUN Muita diversão no FISK Shop 2010!, 28 ABR FISK Taguatinga Norte em Ação!, 31 MAR Inauguração da Unidade FISK Taguatinga Norte , 21 JAN  ', '', '', 'publish', 'open', 'closed', '', '839', '', '', '2017-02-01 02:47:44', '2017-02-01 02:47:44', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/839/', 6, 'nav_menu_item', '', 0),
	(840, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Você pode aprender no método Personalizado ou Regular. O aspecto fundamental do método é desenvolver, desde a primeira aula, as quatro habilidades comunicativas – conversação, leitura, escrita e compreensão auditiva – associadas a um conhecimento do sistema gramatical para que o aluno seja capaz de utilizar o idioma corretamente. Nos estágios iniciais, as aulas enfatizam o ensino e a prática de estruturas gramaticais através de exercícios de conversação direcionada, com a aplicação de algumas atividades de comunicação livre. À medida que o aluno aprende mais, ele passa a ser envolvido em mais atividades comunicativas, reforçando os tópicos estudados e ampliando sua capacidade de comunicação oral e escrita. Aqui na FISK você pode optar pelo método Regular ou Personalizado, pois a medida que fazemos um ou outro, temos a certeza que desenvolveremos as quatro habilidades já mencionadas, tudo isso dentro do padrão de qualidade FISK conquistado ao longo de mais de 50 anos de pesquisa. Utilizamos material didático próprio desenvolvido pela Fundação Richard Hugh Fisk com vários recursos multimídia (Cd´s de áudio, CD ROM´s e DVD´s) além do FISK NET. Regular O através do método Regular o aluno é incentivado a realizar as atividades em grupo, fortalecendo a vivenciação de situações…', '', '', 'publish', 'open', 'closed', '', '840', '', '', '2017-02-01 02:47:44', '2017-02-01 02:47:44', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/840/', 2, 'nav_menu_item', '', 0),
