	(1230, 1, '2013-03-26 23:48:42', '2013-03-26 23:48:42', '<strong>MAY I HELP YOU? - BOOK 1 &amp; 2</strong>\r\n\r\nCom o advento dos grandes eventos que o Brasil sediará nos próximos anos, a FISK apresenta o curso <strong><em>May I Help You?</em></strong>, que consiste em curso prático de conversação situacional em inglês totalmente desenvolvido para suprir as necessidades de todos que precisam de uma preparação rápida para as grandes oportunidades que virão.\r\n<p style="text-align: justify;">O curso tem como objetivo preparar quem trabalha na área de turismo, hotelaria ou viaja a negócios ou lazer para interagir com pessoas de todo o mundo. Os principais diferenciais dessa modalidade são: conversação imediata, apresentação de expressões e frases situacionais, diálogos-modelo, vocabulário temático e atividades de compreensão auditiva e de pronúncia. Para reforçar o conteúdo estudado em sala, o material vem acompanhado de CDs de áudio.</p>\r\n<p style="text-align: justify;"><strong>O curso tem duração de somente 8 meses com carga horária de 80 h/a divididas em 2 vezes na semana de 1h15min</strong>. As aulas podem ser dadas nas sedes das Escolas FISK ASA SUL, ASA NORTE e TAGUATINGA NORTE ou na modalidade "In company" que consiste em aulas dadas na sede da empresa parceira com professores, material didático e metodologia FISK.</p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg"><img class="alignleft size-full wp-image-872" title="May I help you" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg" width="174" height="227" /></a></p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg"><img class="alignright size-full wp-image-873" title="May I help you2" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg" width="175" height="226" /></a></p>', 'Curso May I Help you?', '', 'inherit', 'open', 'open', '', '860-revision-v1', '', '', '2013-03-26 23:48:42', '2013-03-26 23:48:42', '', 860, 'http://dev.webfacetecnologia.com.br/fisk/2013/03/860-revision-v1/', 0, 'revision', '', 0),
	(1356, 1, '2015-11-03 16:42:06', '0000-00-00 00:00:00', 'eyJpZF9maWVsZCI6IklEIn0=', 'Untitled ngg_pictures', '', 'draft', 'open', 'open', '', 'mixin_nextgen_table_extras', '', '', '2015-11-03 16:42:06', '0000-00-00 00:00:00', 'eyJpZF9maWVsZCI6IklEIn0=', 0, 'http://dev.webfacetecnologia.com.br/fisk/?post_type=ngg_pictures&p=1356', 0, 'ngg_pictures', '', 0),
	(842, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Rápido ou Intensivo RÁPIDO O Curso FISK no Rítmo Rápido, cada estágio é desenvolvido em 1 semestre letivo, com frequência igual a 2 vezes por semana e carga horária aproximada de 3 horas semanais. Desta forma, um aluno de Inglês no Rítmo Rápido inicia o Breaking Free (Nível Inicial – Estágio 1) e termina o Focus on FISK Final (Nível Aperfeiçoamento – Estágio 7) em apenas 3 anos e meio. INTENSIVO O Curso FISK no Rítmo Intensivo desenvolve 2 estágios por semestre letivo, reduzindo a duração do Curso pela metade. Assim, realiza-se um carga horária aproximada de 6 horas semanais. No Rítmo Intensivo, esse mesmo aluno de Inglês (Breaking Free ao Focus on FISK Final – Nível Inicial ao Aperfeiçoamento) termina o Curso em incríveis 1 ano e 8 meses. Os Cursos Intensivos só poderão ser ministrados no método Personalizado. Os diferentes Rítmos aqui apresentados são válidos para as Unidades FISK Asa Sul e Taguatinga Norte.  ', '', '', 'publish', 'open', 'closed', '', '842', '', '', '2017-02-01 02:47:44', '2017-02-01 02:47:44', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/842/', 3, 'nav_menu_item', '', 0),
	(843, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Conheça os 50 anos da História do Centro de Ensino FISK. Há mais de 50 anos, a Fisk se dedica ao ensino de idiomas. Teve como base o inglês, incorporou o espanhol posteriormente e em 2008, introduziu o ensino de informática e o de português para brasileiros. Sua história começa com Richard H. Fisk , um americano nascido em Tunbridge, Vermont, que se apaixonou pelo Brasil em uma visita realizada em 1950. Graduado em lnternational Relations e com o diploma Master of Arts pela School of Advanced International Studies, Johns Hopkins University, em Washington, D.C., Mr. Fisk, como é conhecido, decidiu permanecer no Brasil e passou a lecionar inglês no país. Criou um método próprio, com base na solução das dificuldades específicas que os brasileiros apresentam ao aprender inglês. O sucesso do método Fisk gerou um crescimento vertiginoso, ampliando a escola para uma rede com quase 1.000 unidades, muitas delas franquias, espalhadas pela América do Norte e Sul, África e Ásia. Em 1992, foi criada a Fundação Richard H. Fisk, responsável pelas escolas Fisk, pela PBF – escola de idiomas, pela gráfica Support e pela Larry Publicidade e Propaganda. A Fundação Richard Hugh Fisk tem como norte os seguintes valores:…', '', '', 'publish', 'open', 'closed', '', '843', '', '', '2017-02-01 02:47:44', '2017-02-01 02:47:44', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/843/', 1, 'nav_menu_item', '', 0),
