	(850, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Publique o seu trabalho aqui e mostre pro mundo o que você faz na FISK! Alunos, esse espaço é seu! Publiquem e divulgem os seus trabalhos no nosso site! Compartilhem suas “compositions”! Você do Focus, divulgue o seu “Project Work”! 10 MAR | Trabalhos de Alunos, Intercâmbio, Trip to Vancouver Matéria sobre o programa de intercâmbio do aluno de avançado Pedro Brasil Diehl, pertecente ao estágio Expanding Horizons, e a sua viagem realizada no último verão em Vancouver as vésperas dos Jogos Olímpicos de Inverno. …continuar leitura. 22 FEV | Trabalhos de Alunos, Trabalho de aluno: Studying Abroad Trabalho de Conclusão de Curso Focus on FISK Final do Aluno Milton Bassani – Julho 2009. …continuar leitura.', '', '', 'publish', 'open', 'open', '', '850', '', '', '2015-01-27 03:33:01', '2015-01-27 03:33:01', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/850/', 2, 'nav_menu_item', '', 0),
