	(853, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Seja proficiente em Inglês com a FISK! Proficiency Course for Diploma Carga horária mínima: 55 horas Duração: 1 semestre Indicado para alunos FISK e de outras instituições que terminaram o curso completo de Inglês em nível avançado e que pretendem obter o Certificado de Proficiência em Língua Inglesa da Fundação Richard Hugh Fisk. Durante o curso o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso preparatório e ser aprovado no exame Fisk Proficiency Examination. FISK, O MUNDO RECONHECE QUE FAZ!  ', '', '', 'publish', 'open', 'open', '', '853', '', '', '2015-01-25 15:12:55', '2015-01-25 15:12:55', '', 60, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/853/', 1, 'nav_menu_item', '', 0),
