	(1195, 1, '2015-01-25 15:16:39', '2015-01-25 15:16:39', 'A Fisk, como um renomado centro de ensino, adquiriu e vem adquirindo muitos prêmios em reconhecimento ao trabalho sério e de comprometimento com seus alunos e franqueados. Veja abaixo todos os prêmios conquistados:\r\n<h3>2014</h3>\r\n<ul>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising</li>\r\n</ul>\r\n<h3>2013</h3>\r\n<ul>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising</li>\r\n	<li>- <strong>Prêmio TOP 25 </strong>- Grupo Bittencourt</li>\r\n	<li>- <strong>Prêmio TOP Educação</strong> - Escolas de Idiomas</li>\r\n</ul>\r\n<h3>2012</h3>\r\n<ul>\r\n	<li>- <strong>Eleita Melhor Franquia do Brasil</strong> pela 3ª vez, pela Revista Pequenas Empresas Grandes Negócios, Ed. Globo.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Destaque na Categoria MASTER</strong> - do selo de Excelência em Franchising 2012.</li>\r\n	<li>- <strong>Prêmio TOP Educação</strong> - Escolas de Idiomas</li>\r\n</ul>\r\n<h3>2011</h3>\r\n<ul>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising</li>\r\n</ul>\r\n<h3>2010</h3>\r\n<ul>\r\n	<li>- <strong>Top of Mind A Tribuna 2010</strong> como marca mais lembrada no segmento de escolas de idiomas na Região Metropolitana da Baixada Santista.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Eleita Melhor Franquia do Brasil</strong> pela Revista Pequenas Empresas Grandes Negócios, Ed. Globo.</li>\r\n</ul>\r\n<h3>2009</h3>\r\n<ul>\r\n	<li>- <strong>Top of Brands 2009</strong> da Universidade Metodista do ABC.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n</ul>\r\n<h3>2008</h3>\r\n<ul>\r\n	<li>- <strong>Top of Mind Diário do Grande ABC</strong> como marca mais lembrada no segmento de escolas de idiomas da região do Grande ABC.</li>\r\n	<li>- <strong>Top of Mind A Tribuna</strong> como marca mais lembrada no segmento de escolas de idiomas da região do litoral sul de São Paulo, Baixada Santista e Vale do Ribeira.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Prêmio Franqueador do Ano</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Prêmio As Melhores Franquias do Brasil</strong> - PEGN Pequenas Empresas &amp; Grandes Negócios.</li>\r\n</ul>\r\n<h3>2007</h3>\r\n<ul>\r\n	<li>- <strong>Top of Mind Diário do Grande ABC</strong> como marca mais lembrada no segmento de escolas de idiomas da região do Grande ABC.</li>\r\n	<li>- <strong>Top de Qualidade do Instituto</strong> de Estudos e Pesquisa da Qualidade.</li>\r\n	<li>- <strong>Prêmio Homem do Ano</strong> da AVB Produções para Bruno Caravati, vice-presidente da Fundação Richard Hugh Fisk pelo destaque na área empresarial e social.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Eleita Melhor Franquia do Brasil </strong>pela Revista Pequenas Empresas Grandes Negócios, Ed. Globo.</li>\r\n	<li>- <strong>Top of Brands</strong> da Universidade Metodista do ABC.</li>\r\n	<li>- <strong>Prêmio Quality Brasil</strong> - chancelado pela Sociedade Brasileira de Educação e Integração.</li>\r\n</ul>\r\n<h3>2006</h3>\r\n<ul>\r\n	<li>- <strong>Top of Brands</strong> da Universidade Metodista do ABC.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Prêmio 5 Estrelas</strong> - Melhores Franquias do Brasil da Revista Pequenas Empresas Grandes Negócios, Ed. Globo.</li>\r\n</ul>\r\n<h3>2005</h3>\r\n<ul>\r\n	<li>- <strong>Top of Mind Diário do Grande ABC</strong> como marca mais lembrada no segmento de escolas de idiomas da região do Grande ABC.</li>\r\n	<li>- <strong>Top of Mind A Tribuna</strong> como marca mais lembrada no segmento de escolas de idiomas da região do litoral sul de São Paulo, Baixada Santista e Vale do Ribeira.</li>\r\n	<li>- <strong>Selo de Excelência em Franchising</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Prêmio Franqueador do Ano</strong> - ABF Associação Brasileira de Franchising.</li>\r\n	<li>- <strong>Prêmio As Melhores Franquias do Brasil</strong> - PEGN Pequenas Empresas &amp; Grandes Negócios</li>\r\n</ul>', 'Prêmios', '', 'publish', 'open', 'open', '', 'premios', '', '', '2015-01-25 15:17:28', '2015-01-25 15:17:28', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1195', 0, 'page', '', 0),
	(855, 2, '2011-09-24 20:54:14', '2011-09-24 20:54:14', 'Prepare-se e seja aprovado nos exames internacionais TOEFL ITP & IBT com a FISK! Se você pretende estudar no exterior ou quer uma certificação internacional que ateste o seu conhecimento em Inglês, faça o curso preparatório com a FISK! A certificação internacional pode ser conseguida através dos Exames TOEFL ITP (Institucional) & IBT (Internet Based TOEFL), para os quais preparamos você com os melhores Professores e com o mais completo material didático, que garante excelentes índices de aprovação. Além disso, realizamos diversos simulados durante o Curso preparatório. Indicado para alunos FISK e de outras instituições que possuam o Nível Avançado de Inglês. Carga horária mínima: 55 horas aula Duração: 1 semestre letivo  ', '', '', 'publish', 'open', 'open', '', '855', '', '', '2015-01-25 15:12:55', '2015-01-25 15:12:55', '', 60, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/855/', 2, 'nav_menu_item', '', 0),
