	(9, 2, '2011-03-14 15:21:29', '2011-03-14 15:21:29', '<p id="pagina_resumo">Conheça os 50 anos da História do Centro de Ensino FISK.</p>\nHá mais de 50 anos, a Fisk se dedica ao ensino de idiomas. Teve como base o inglês, incorporou o espanhol posteriormente e em 2008, introduziu o ensino de informática e o de português para brasileiros.\n\n<img class="alignleft size-full wp-image-238" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/escola1264189943.jpg" alt="" width="150" height="113" /> Sua história começa com Richard H. Fisk , um americano nascido em Tunbridge, Vermont, que se apaixonou pelo Brasil em uma visita realizada em 1950. Graduado em lnternational Relations e com o diploma Master of Arts pela School of Advanced International Studies, Johns Hopkins University, em Washington, D.C., Mr. Fisk, como é conhecido, decidiu permanecer no Brasil e passou a lecionar inglês no país.\n\nCriou um método próprio, com base na solução das dificuldades específicas que os brasileiros apresentam ao aprender inglês. O sucesso do método Fisk gerou um crescimento vertiginoso, ampliando a escola para uma rede com quase 1.000 unidades, muitas delas franquias, espalhadas pela América do Norte e Sul, África e Ásia.\n\n<img class="alignright size-full wp-image-247" title="Fundação Richard H. Fisk" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/fundacao1264189908.jpg" alt="" width="150" height="101" /> Em 1992, foi criada a Fundação Richard H. Fisk, responsável pelas escolas Fisk, pela PBF – escola de idiomas, pela gráfica Support e pela Larry Publicidade e Propaganda.\n\nA Fundação Richard Hugh Fisk tem como norte os seguintes valores:\n\n<strong>Missão:</strong> Produzir programas educacionais a fim de promover o ensino com total qualidade e responsabilidade social, contribuindo para o desenvolvimento intelectual e cultural de alunos, professores e colaboradores.\n\n<strong>Visão:</strong> Ser no segmento de educação um referencial pela atuação de qualidade e respeito.\n\n<strong>Valores emanados:</strong> Ética, Transparência, Comprometimento e Responsabilidade.\n\n<img class="alignleft size-full wp-image-250" title="Excelência em Franchising" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/selos1264159932.gif" alt="" width="340" height="75" />\n\n<span class="clear block"> </span>', 'Sobre o FISK', '', 'publish', 'open', 'open', '', 'sobre-o-fisk', '', '', '2011-03-14 15:21:29', '2011-03-14 15:21:29', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=9', 0, 'page', '', 0),
	(11, 2, '2011-03-14 15:22:04', '2011-03-14 15:22:04', '	<p id="pagina_resumo">Você pode aprender no método Personalizado ou Regular.</p>\n		<p>O aspecto fundamental do método é desenvolver, desde a primeira aula, as quatro habilidades comunicativas &#8211; <strong>conversação, leitura, escrita e compreensão auditiva</strong> &#8211; associadas a um conhecimento do sistema gramatical para que o aluno seja capaz de utilizar o idioma corretamente.</p>\n\n	<p>Nos estágios iniciais, as aulas enfatizam o ensino e a prática de estruturas gramaticais através de exercícios de conversação direcionada, com a aplicação de algumas atividades de comunicação livre. À medida que o aluno aprende mais, ele passa a ser envolvido em mais atividades comunicativas, reforçando os tópicos estudados e ampliando sua capacidade de comunicação oral e escrita.</p>\n\n	<p>Aqui na FISK você pode optar pelo método Regular ou Personalizado, pois a medida que fazemos um ou outro, temos a certeza que desenvolveremos as quatro habilidades já mencionadas, tudo isso dentro do padrão de qualidade FISK conquistado ao longo de mais de 50 anos de pesquisa. Utilizamos material didático próprio desenvolvido pela Fundação Richard Hugh Fisk com vários recursos multimídia (Cd´s de áudio, CD ROM´s e DVD´s) além do FISK NET.</p>\n\n	<h3>Regular</h3>\n\n	<p>O através do método Regular o aluno é incentivado a realizar as atividades em grupo, fortalecendo a vivenciação de situações do dia-dia na língua estudada através de práticas de conversação direcionada e dramatizações. </p>\n\n	<p>As aulas ministradas pelo Professor procuram sempre despertar o <strong>gostar</strong> de estudar a língua, a medida que possibilitam a conversação desde a primeira aula.</p>\n\n	<h3>Personalizado</h3>\n\n	<p>O Personal Programmed Teaching, ou Ensino Personalizado, é uma outra opção de aprendizado na qual, apesar de as aulas serem ministradas em grupo, os alunos recebem acompanhamento individualizado do professor. </p>\n\n	<p>Aqui o rendimento e o progresso do aluno dependem dele mesmo, pois não precisa se preocupar em seguir o ritmo de aprendizado dos colegas. Ele deve apenas respeitar uma carga horária mínima para cumprir todas as etapas das lições. </p>	<span class="clear block">&nbsp;</span>\n', 'Método FISK de Ensino', '', 'publish', 'open', 'open', '', 'metodo-fisk-de-ensino', '', '', '2011-03-14 15:22:04', '2011-03-14 15:22:04', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=11', 0, 'page', '', 0),
	(15, 2, '2011-03-14 15:25:18', '2011-03-14 15:25:18', '	<p id="pagina_resumo">Rápido ou Intensivo</p>\n		<p><b>RÁPIDO</b></p>\n\n	<p>O  Curso FISK no Rítmo Rápido, cada estágio é desenvolvido em 1 semestre letivo,  com frequência igual a 2 vezes por semana e carga horária aproximada de 3 horas semanais.</p>\n\n	<p>Desta forma, um aluno de Inglês no Rítmo Rápido inicia o Breaking Free (Nível Inicial &#8211; Estágio 1) e termina o Focus on FISK Final (Nível Aperfeiçoamento &#8211; Estágio 7) em apenas 3 anos e meio.</p>\n\n	<p><strong>INTENSIVO</strong></p>\n\n	<p>O Curso FISK no Rítmo Intensivo desenvolve 2 estágios por semestre letivo, reduzindo a duração do Curso pela metade. Assim, realiza-se um carga horária aproximada de 6 horas semanais.</p>\n\n	<p>No Rítmo Intensivo, esse mesmo aluno de Inglês (Breaking Free ao Focus on FISK Final &#8211; Nível Inicial ao Aperfeiçoamento) termina o Curso em incríveis 1 ano e 8 meses.</p>\n\n	<p>Os Cursos Intensivos só poderão ser ministrados no método Personalizado.<br />\nOs diferentes Rítmos aqui apresentados são válidos para as Unidades FISK Asa Sul e Taguatinga Norte.</p>	<span class="clear block">&nbsp;</span>\n', 'Ritmo de Aprendizado', '', 'publish', 'open', 'open', '', 'ritmo-de-aprendizado', '', '', '2011-03-14 15:25:18', '2011-03-14 15:25:18', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=15', 0, 'page', '', 0),
	(17, 2, '2011-03-14 15:25:41', '2011-03-14 15:25:41', '<p class="hide" id="pagina_resumo">Conheça nossos Cursos.</p>\r\n\r\n<div id="quadro_cursos">\r\n<div class="bloco_curso" id="bloco_ingles">\r\n\r\n<img class="alignleft size-full wp-image-254" title="ingles" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/ingles.gif" width="80" height="90" />\r\n\r\nNa FISK, crianças a partir de 4 anos já começam a se comunicar em inglês. Veja quais as opções que a FISK oferece para crianças, jovens e adultos.\r\n\r\n<a href="queroserfisk_cursos_ingles.html">Veja os Cursos de Inglês</a>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<div class="bloco_curso" id="bloco_espanhol">\r\n\r\n<img class="alignleft size-full wp-image-262" title="espanhol" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/espanhol.gif" width="80" height="90" />\r\n\r\nNa FISK, Espanhol agora começa mais cedo. Confira abaixo as opções que a FISK oferece para adolescentes, jovens e adultos:\r\n\r\n<a href="queroserfisk_cursos_espanhol.html">Veja os Cursos de Espanhol</a>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<div class="bloco_curso" id="bloco_portugues">\r\n\r\n<img class="alignleft size-full wp-image-263" title="portugues" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/portugues.gif" width="80" height="90" />\r\n\r\nNão tropece mais! Aprimore suas habilidades de escrita e fala com a FISK.\r\n\r\n<a href="queroserfisk_cursos_portugues.html">Veja os Cursos de Português</a>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n<div class="bloco_curso" id="bloco_informatica">\r\n\r\n<img class="alignleft size-full wp-image-264" title="informatica" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/informatica.gif" width="80" height="90" />\r\n\r\nMantenha-se atualizado e profissionalize-se com nossos diversos cursos de Informática!\r\n\r\n<a href="queroserfisk_cursos_informatica.html">Veja os Cursos de Informática</a>\r\n\r\n&nbsp;\r\n\r\n</div>\r\n&nbsp;\r\n\r\n</div>\r\n&nbsp;', 'Cursos', '', 'publish', 'open', 'open', '', 'cursos', '', '', '2013-02-28 01:48:09', '2013-02-28 01:48:09', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=17', 0, 'page', '', 0),
	(19, 2, '2011-03-14 15:26:05', '2011-03-14 15:26:05', '<p id="pagina_resumo">Venha conhecer a nossa Unidade da Asa Sul!</p>\r\n[nggallery id=41]<span class="clear block">\r\n</span>\r\n\r\nO Centro de Ensino FISK Asa Sul conta uma moderna infraestrutura, composta por:\r\n<ul>\r\n	<li>3 Salas de aula para o Ensino Regular;</li>\r\n	<li>3 Salas para o Ensino Personalizado;</li>\r\n	<li>1 Sala de KIDS;</li>\r\n	<li>1 Laboratório Multimídia;</li>\r\n	<li>1 Auditório audiovisual;</li>\r\n	<li>1 “Learning Center” com computadores conectados na internet;</li>\r\n	<li>1 Biblioteca;</li>\r\n	<li>1 Lounge na área externa.</li>\r\n</ul>\r\nTudo isso preparado para propocionar o que há de mais moderno no Ensino de Idiomas e Informática fazendo da nossa Escola um “Great place!” para aprender!\r\n\r\nVenha e conheça a nossa atmosfera! Na FISK você aprende fazendo amigos! Join us!\r\n\r\n&nbsp;', 'FISK Asa Sul', '', 'publish', 'open', 'open', '', 'fisk-asa-sul', '', '', '2015-08-19 02:18:58', '2015-08-19 02:18:58', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=19', 0, 'page', '', 0),
	(21, 2, '2011-03-14 15:26:29', '2011-03-14 15:26:29', '<p id="pagina_resumo">Conheça a FISK Taguatinga Norte!</p>\r\n[nggallery id=26]\r\nVenha estudar conosco! Temos um Centro de Ensino todo feito pra você!\r\n\r\nNa FISK Taguatinga Norte você encontra:\r\n<ul>\r\n	<li>3 Salas de Ensino Personalizado;</li>\r\n	<li>3 Salas de Ensino Regular;</li>\r\n	<li>1 Sala de Kids;</li>\r\n	<li>1 Laboratório Multimídia;</li>\r\n	<li>1 Auditório Audiovisual;</li>\r\n	<li>1 Cafeteria;</li>\r\n	<li>2 Lounges;</li>\r\n	<li>1 Biblioteca.</li>\r\n</ul>\r\nFazemos uma Escola melhor por quê temos e melhor Ensino! Venha estudar em um ambiente moderno e com uma “Great atmosphere!”. Come to us!\r\n\r\n<span class="clear block"> </span>', 'FISK Taguatinga Norte', '', 'publish', 'open', 'open', '', 'fisk-taguatinga-norte', '', '', '2012-02-06 16:38:39', '2012-02-06 16:38:39', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=21', 0, 'page', '', 0),
	(23, 2, '2011-03-14 15:26:53', '2011-03-14 15:26:53', '<p>Para enviar sua mensagem, preencha <strong>todos</strong> os campos abaixo.</p>\n\n<!--cforms name="Trabalhe Conosco"-->', 'Trabalhe conosco', '', 'publish', 'open', 'open', '', 'trabalhe-conosco', '', '', '2011-03-14 15:26:53', '2011-03-14 15:26:53', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=23', 0, 'page', '', 0),
	(25, 2, '2011-03-14 15:27:08', '2011-03-14 15:27:08', '<strong>As Unidades FISK Asa Sul, Asa Norte e Taguatinga Norte apresentam a Super Promoção "MEIA ENTRADA FISK!", que consiste na concessão de 50% de desconto nas mensalidades do primeiro semestre dos Cursos de Inglês, Espanhol ou Francês para os alunos que apresentarem a sua Carteira de Estudante no ato de sua matrícula, sim, aqui na FISK você paga meia!</strong>\r\n\r\n<em><strong>E mais! Você concorre a  um  Iphone 7 novinho em folha!  (super lançamento da Apple)</strong></em>\r\n\r\nEntão corra até as Unidades FISK listadas acima e aproveita essa super oportunidade para começar ou retomar aquele Curso de idiomas sonhado! A hora é agora!\r\n\r\nPromoção por tempo limitado. Válido pelo primeiro semestre do Curso escolhido. Restrito a novos alunos. Somente nas Unidades FISK  participantes.\r\n\r\n<img class="ngg_displayed_gallery mceItem" src="http://dev.webfacetecnologia.com.br/fisk/nextgen-attach_to_post/preview/id--1456" alt="" data-mce-placeholder="1" />', 'Meia Entrada FISK (50% Desconto)', '', 'draft', 'open', 'closed', '', 'promocoes', '', '', '2017-02-01 02:47:18', '2017-02-01 02:47:18', '', 8, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=25', 0, 'page', '', 0),
