	(923, 2, '2011-10-28 12:40:36', '2011-10-28 12:40:36', '<p style="text-align: left;">O Halloween 2011 Fisk foi de arrepiar... Tivemos várias brincadeiras, concurso de fantasias e muita diversão! Quem já ouviu falar na dança das abóboras, múmia de papel e quiz de criaturas horripilantes ? Pois é, esse ano tivemos tudo isso e muito mais! Agradecemos à todos que participaram e vejam as fotos das festas de Halloween que ocorreram em cada turma.</p>\r\n<p style="text-align: left;">[nggallery id=25]</p>', 'Halloween 2011 Fisk Asa Sul(Fotos)', '', 'publish', 'open', 'open', '', 'halloween-2011-fisk-asa-sulfotos', '', '', '2011-11-01 14:12:55', '2011-11-01 14:12:55', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=923', 0, 'post', '', 0),
