	(1076, 1, '2013-03-04 23:49:55', '2013-03-04 23:49:55', 'O método de aprendizado Écho é endereçado aos adolescentes a partir de 13 anos e aos adultos que possuem o interesse em aprender um novo idioma moderno. O método visa trabalhar, diferentes etapas culturais da vida pessoal, educativa, social e profissional do francês de uma forma dinâmica e motivadora. Junto a isso, o método ainda aborda questões linguísticas e gramaticais da metodologia francesa, em um aprendizado apoiado nas interações naturais da turma, ou seja, a prática da abordagem da conversação tida em cada livro do método Écho.\r\n\r\nO método Écho ainda permite, ao aluno de francês, a descoberta do desenvolvimento francofônico e da integração no meio social da cultura de outros países oriundos da cultura francesa em uma carga horária, semestral de 72 h/a, sendo assim, na metodologia regular ou personalizada. Aqui há um aprimoramento da língua francesa no que tange as mudanças de informações, experiências, opiniões ao melhor dos projetos.\r\n\r\nPor fim, as atividades de vídeos, dos estágios A1 e A2, ainda fazem todo diferencial, no processo da prática do que foi visto em sala de aula, ou seja, do que foi aprendido pelo aluno, ao longo da semana.\r\n\r\nO caderno de exercícios por sua vez, visa reforçar o conteúdo visto em sala de aula e vem acompanhado de um cd de áudio para a praticidade e automatização da escuta em casa', 'Curso ECHO de Francês', '', 'publish', 'open', 'open', '', 'curso-echo-de-frances', '', '', '2016-04-18 21:49:46', '2016-04-18 21:49:46', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1076', 0, 'page', '', 0),
