	(1411, 2, '2016-04-18 21:48:58', '2016-04-18 21:48:58', 'O método de aprendizado Écho é endereçado aos adolescentes a partir de 13 anos e aos adultos que possuem o interesse em aprender um novo idioma moderno. O método visa trabalhar, diferentes etapas culturais da vida pessoal, educativa, social e profissional do francês de uma forma dinâmica e motivadora. Junto a isso, o método ainda aborda questões linguísticas e gramaticais da metodologia francesa, em um aprendizado apoiado nas interações naturais da turma, ou seja, a prática da abordagem da conversação tida em cada livro do método Écho.\n\nO método Écho ainda permite, ao aluno de francês, a descoberta do desenvolvimento francofônico e da integração no meio social da cultura de outros países oriundos da cultura francesa em uma carga horária, semestral de 72 h/a, sendo assim, na metodologia regular ou personalizada. Aqui há um aprimoramento da língua francesa no que tange as mudanças de informações, experiências, opiniões ao melhor dos projetos.\n\nPor fim, as atividades de vídeos, dos estágios A1 e A2, ainda fazem todo diferencial, no processo da prática do que foi visto em sala de aula, ou seja, do que foi aprendido pelo aluno, ao longo da semana.\n\nO caderno de exercícios por sua vez, visa reforçar o conteúdo visto em sala de aula e vem acompanhado de um cd de áudio para a praticidade e automatização da escuta em casa', 'Curso ECHO de Francês', '', 'inherit', 'closed', 'closed', '', '1076-autosave-v1', '', '', '2016-04-18 21:48:58', '2016-04-18 21:48:58', '', 1076, 'http://dev.webfacetecnologia.com.br/fisk/2016/04/1076-autosave-v1/', 0, 'revision', '', 0),
