	(37, 2, '2011-03-14 15:29:40', '2011-03-14 15:29:40', '<p id="pagina_resumo">Na FISK o seu esforço nos estudos vira festa!</p>\nA FISK Asa Sul e Taguatinga Norte realizam todos os anos o FISK SHOP, uma grande feira livre onde os alunos que cursam as séries FISK KIDS e FISK TEENS podem gastar os seus “FISK DOLLARS” acumulados ao longo do ano letivo, sendo estes uma forma de incentivo que a Escola oferece aos seus alunos como reconhecimento pelo bom rendimento escolar.\n\n<img class="aligncenter size-full wp-image-268" title="FISK Shop 4" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/DSC_01791264162155.jpg" alt="" width="504" height="385" />\n\nNeste dia, a alegria e descontração toma conta de todos os alunos, pais, professores e funcionários.\n\nPergunte ao seu Teacher  sobre os critérios de acúmulo de FISK DOLLARS, seja um aluno nota 10 e faça a festa no FISK SHOP!', 'FISK Shop', '', 'publish', 'open', 'open', '', 'fisk-shop', '', '', '2011-03-14 15:29:40', '2011-03-14 15:29:40', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=37', 0, 'page', '', 0),
