	(41, 2, '2011-03-14 15:30:38', '2011-03-14 15:30:38', '<p id="pagina_resumo">Publique o seu trabalho aqui e mostre pro mundo o que você faz na FISK!</p>\n<strong>Alunos, esse espaço é seu!</strong>\n\nPubliquem e divulgem os seus trabalhos no nosso site!\nCompartilhem suas “compositions”!\nVocê do Focus, divulgue o seu  “Project Work”!\n<div id="materias_blog">\n<ul id="lista_materias">\n	<li>\n<p class="metadados"><span class="meta_mes">10</span> <span class="meta_dia">MAR</span> | <span class="meta_categorias"><a href="prisma/categorias/visualizar/5">Trabalhos de Alunos</a>, <a href="prisma/categorias/visualizar/6">Intercâmbio</a>, </span></p>\n\n<h2><a href="blog_post13.html">Trip to Vancouver</a></h2>\nMatéria sobre o programa de intercâmbio do aluno de avançado Pedro Brasil Diehl, pertecente ao estágio Expanding Horizons, e a sua viagem realizada no último verão em Vancouver as vésperas dos Jogos Olímpicos de Inverno. <a href="blog_post13.html">...continuar leitura</a>.</li>\n	<li>\n<p class="metadados"><span class="meta_mes">22</span> <span class="meta_dia">FEV</span> | <span class="meta_categorias"><a href="prisma/categorias/visualizar/5">Trabalhos de Alunos</a>, </span></p>\n\n<h2><a href="blog_post14.html">Trabalho de aluno: Studying Abroad</a></h2>\nTrabalho de Conclusão de Curso Focus on FISK Final do Aluno Milton Bassani - Julho 2009. <a href="blog_post14.html">...continuar leitura</a>.</li>\n</ul>\n<ul class="paginador">\n	<li></li>\n</ul>\n</div>\n', 'Trabalhos de Alunos', '', 'publish', 'open', 'open', '', 'trabalhos-de-alunos', '', '', '2011-03-14 15:30:38', '2011-03-14 15:30:38', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=41', 0, 'page', '', 0),
	(43, 2, '2011-03-14 15:31:06', '2011-03-14 15:31:06', '	<p id="pagina_resumo">Suas dúvidas podem aparecer aqui! Pergunte aos Professores no nosso Blog ou mande um mensagem no Help-out Online. Na FISK você aprende 24 horas por dia!</p>\n		<div id="materias_blog">\n		<ul id="lista_materias">\n					</ul>\n		<ul class="paginador"><li>&nbsp;</li></ul>\n</div>	', 'Dicas do Professor', '', 'publish', 'open', 'open', '', 'dicas-do-professor', '', '', '2011-03-14 15:31:06', '2011-03-14 15:31:06', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=43', 0, 'page', '', 0),
	(45, 2, '2011-03-14 15:31:43', '2011-03-14 15:31:43', '<p id="pagina_resumo">Tire as suas dúvidas online!</p>\n		<p>Escreva a sua dúvida no formulário abaixo que um Professor FISK irá respondê-lo com breviedade. Lembre-se sempre de revisar as suas lições e fazer os exercícios propostos.  </p>\n<p>Para enviar sua mensagem, preencha <strong>todos</strong> os campos abaixo.</p>\n\n<!--cforms name="Help-out Online"-->', 'Help-out Online', '', 'publish', 'open', 'open', '', 'help-out-online', '', '', '2011-03-14 15:31:43', '2011-03-14 15:31:43', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=45', 0, 'page', '', 0),
