	(62, 2, '2011-03-14 16:20:11', '2011-03-14 16:20:11', '<p id="pagina_resumo">Seja proficiente em Inglês com a FISK!</p>\r\nProficiency Course for Diploma\r\nCarga horária mínima: 55 horas\r\nDuração: 1 semestre\r\n\r\nIndicado para alunos FISK e de outras instituições que terminaram o curso completo de Inglês em nível avançado e que pretendem obter o <strong>Certificado de Proficiência em Língua Inglesa da Fundação Richard Hugh Fisk</strong>.\r\nDurante o curso o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso preparatório e ser aprovado no exame Fisk Proficiency Examination.\r\n\r\n<strong>FISK, TODO MUNDO FALA BEM!</strong>\r\n\r\n<span class="clear block"> </span>', 'FISK Proficiency Examination', '', 'publish', 'open', 'open', '', 'fisk-proficiency-examination', '', '', '2013-03-26 23:38:38', '2013-03-26 23:38:38', '', 60, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=62', 0, 'page', '', 0),
	(1091, 2, '2013-03-26 23:39:59', '2013-03-26 23:39:59', '<p id="pagina_resumo">Prepare-se e seja aprovado nos exames internacionais TOEFL ITP &amp; IBT com a FISK!</p>\nSe você pretende estudar no exterior ou quer uma certificação internacional que ateste o seu conhecimento em Inglês, faça o curso preparatório com a FISK!\n\nA certificação internacional pode ser conseguida através do Exame TOEFL IBT (Internet Based TOEFL), para o qual preparamos você com os melhores Professores e com o mais completo material didático, que garante excelentes índices de aprovação. Além disso, realizamos diversos simulados durante o Curso preparatório.\n\nIndicado para alunos FISK e de outras instituições que possuam o Nível Avançado de Inglês.\n\nCarga horária mínima: 55 horas aula\nDuração: 1 semestre letivo\n\n<img class="alignleft size-full wp-image-271" title="Cambridge Preparation for the TOEFL Test" alt="" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/book_3_img1264269043.jpg" width="403" height="340" />\n\n&nbsp;', 'TOEFL', '', 'inherit', 'open', 'open', '', '64-autosave-v1', '', '', '2013-03-26 23:39:59', '2013-03-26 23:39:59', '', 64, 'http://dev.webfacetecnologia.com.br/fisk/2013/03/64-autosave/', 0, 'revision', '', 0),
	(64, 2, '2011-03-14 16:20:33', '2011-03-14 16:20:33', '<p id="pagina_resumo">Prepare-se e seja aprovado no exame internacional TOEFL IBT com a FISK!</p>\r\nSe você pretende estudar no exterior ou quer uma certificação internacional que ateste o seu conhecimento em Inglês, faça o curso preparatório com a FISK!\r\n\r\nA certificação internacional pode ser conseguida através do Exame TOEFL IBT (Internet Based TOEFL), para o qual preparamos você com os melhores Professores e com o mais completo material didático, que garante excelentes índices de aprovação. Além disso, realizamos diversos simulados durante o Curso preparatório.\r\n\r\nIndicado para alunos FISK e de outras instituições que possuam o Nível Avançado de Inglês.\r\n\r\nCarga horária mínima: 55 horas aula\r\nDuração: 1 semestre letivo\r\n\r\n<img class="alignleft size-full wp-image-271" title="Cambridge Preparation for the TOEFL Test" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/book_3_img1264269043.jpg" alt="" width="403" height="340" />\r\n\r\n&nbsp;', 'TOEFL IBT', '', 'publish', 'open', 'open', '', 'toefl', '', '', '2015-01-27 22:28:25', '2015-01-27 22:28:25', '', 60, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=64', 0, 'page', '', 0),
	(66, 2, '2011-03-14 16:21:02', '2011-03-14 16:21:02', '<p id="pagina_resumo">Aperfeiçoe seu Inglês ou Espanhol no exterior com a FISK!</p>\nNa FISK você tem a possibilidade a desenvolver o seu Inglês ou Espanhol no exterior com toda assistência e segurança que só a maior rede de idiomas do mundo pode oferecer!\n\nConheça os nossos Intercâmbios Culturais:\n<h3>Toronto – Canadá</h3>\n<img class="aligncenter size-full wp-image-275" title="Toronto" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/800px-122_-_Toronto_-_Septembre_20091264117033.jpg" alt="Toronto" width="504" height="195" />\n\nO nosso intercâmbio em Toronto destina-se aos alunos e ex-alunos Fisk que desejam realizar uma viagem ao exterior com o objetivo de conhecerem os costumes, as tradições, as tecnologias e o idioma de um país estrangeiro, com troca de conhecimentos e hospedando-se na casa de uma pessoa nativa.\n\nO intercâmbio é realizado em parceria com a  <strong>Escola ILSC</strong> (International Language Schools of Canada), em Toronto, localizada no centro da cidade e próxima às principais atrações turísticas.\n\n<img class="aligncenter size-full wp-image-276" title="ILSC Toronto" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/369_43f303f034b5b1264117666.jpg" alt="ILSC Toronto" width="504" height="430" />\n\nNormalmente este intercâmbio ocorre no mês de dezembro e tem duração de 15 dias, o qual os alunos terão oportunidade de aprofundar suas habilidades comunicativas através de aulas presenciais e inúmeras oportunidades de imersão nas ruas e atrações de Toronto.\n<h3>Orlando – Estados Unidos</h3>\nA FISK realiza no final de todos os anos, o nosso intercâmbio para a cidade de Orlando e seus maravilhosos parques temáticos (Disney World, Universal Studios, Sea World, Bush Gardens, Inslands of Adventure etc) tudo com garantia de muita diversão e animação proporcionada pela excelente infraestrutura da cidade de Orlando e pelo profissionalismo dos guias da <strong>Agência Rodojet Turismo</strong>, nossa parceira neste programa.\n\n<img class="aligncenter size-full wp-image-277" title="Magic Kingdom" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/08_orlando_disney2_fl1264120651.jpg" alt="Magic Kingdom" width="504" height="445" />\n\nExcelente oportunidade de imersão no Inglês, pois o aluno se depara com inúmeras situações que proporcionarão meios para colocar em prática os conhecimentos aprendidos na sala de aula.\n\nO programa tem duração aproximada de 15 dias e normalmente ocorre no mês de dezembro.\nNa FISK você estuda inglês e tem a oportunidade de conhecer a Disney!\n\nFISK, O MUNDO RECONHECE QUEM FAZ!\n<h3>Buenos Aires – Argentina</h3>\nO intercâmbio em Buenos Aires destina-se a alunos e ex-alunos FISK que desejam aprimorarem-se na língua espanhola, bem como conhecerem os costumes, as tradições e a cultura argentina. Através de aulas  em Unidades FISK e passeios de imersão nas inúmeras atrações de Buenos Aires.\n\n<img class="aligncenter size-full wp-image-278" title="Buenos Aires" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/750px-Buenos_Aires_waterfront1264117207.jpg" alt="Buenos Aires" width="504" height="143" />\n\nO programa tem duração de 1 semana e pressupõe 20 horas aula de Espanhol ministradas por professores nativos e passeios turísticos na cidade de Buenos Aires. A parte teórica é organizada pela Fundação Richard Hugh Fisk e a parte turística que inclui passagem aérea, hospedagem e passeios é feita através de convênio com a operadora <strong>CVC</strong>.\n\n<img class="alignleft size-full wp-image-474" title="prensa51264117918" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/prensa512641179183.jpg" alt="" width="400" height="287" />\n<img class="alignleft size-full wp-image-475" title="prensa41264117909" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/prensa41264117909.jpg" alt="" width="220" height="160" /><img class="alignleft size-full wp-image-476" title="prensa31264117902" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/prensa31264117902.jpg" alt="" width="160" height="220" /><img class="alignleft size-full wp-image-477" title="prensa21264117895" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/prensa212641178951.jpg" alt="" width="220" height="160" /><img class="alignleft size-full wp-image-478" title="prensa11264117876" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/prensa11264117876.jpg" alt="" width="220" height="160" />\n\n&nbsp;\n<p class="clear">O programa ocorre anualmente no mês de julho com divulgação das condições no início do ano letivo.</p>\n<em>Fotos: Wikipedia</em>\n\n<span class="clear block"> </span>', 'Intercâmbio', '', 'publish', 'open', 'closed', '', 'intercambio', '', '', '2015-01-25 15:10:41', '2015-01-25 15:10:41', '', 33, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=66', 0, 'page', '', 0),
