	(229, 2, '2011-03-29 00:20:43', '2011-03-29 00:20:43', '<p id="pagina_resumo">Nossa garantia de sigilo e respeito à sua privacidade online.</p>\n		<h3>Cadastro</h3>\n\n	<p>É necessário criar um cadastro no site para participar dos serviços: Blog, Dicas do Professor, Help-Out Online, Newsletter. O cadastro consiste de:</p>\n\n	<ul>\n		<li>Nome completo</li>\n		<li>E-mail pessoal válido</li>\n		<li>Senha secreta</li>\n		<li>Opcional: recebimento de newsletter</li>\n	</ul>\n\n	<h3>Utilização do e-mail cadastrado</h3>\n\n	<p><strong>Não divulgamos e-mails a terceiros!</strong>. Nem mesmo os administradores de conteúdo do site possuem acesso direto aos e-mails cadastrados. O e-mail serve apenas para comunicação de newsletter e para procedimento de criar nova senha.</p>\n\n	<h3>Coleta de dados</h3>\n\n	<p>Todas as páginas do site estão programadas para contabilizar cliques nos links. Informações técnicas <strong>anônimas</strong> como: última hora de acesso, navegador, sistema operacional, entre outras, são armazenadas em cookies.</p>\n\n	<p>Essas informações técnicas são utilizadas exclusivamente no aperfeiçoamento dos serviços oferecidos e são excluídas automaticamente após 2 horas.</p>\n\n	<h3>Armazenamento de informações</h3>\n\n	<p>Para garantir a utilidade dos serviços fornecidos, iremos excluir cadastros, perfis e demais conteúdos em que for detectado abandono, isto é, que não utilizado por mais de 180 dias.</p>	<span class="clear block">&nbsp;</span>', 'Política de privacidade', '', 'publish', 'open', 'open', '', 'politica-de-privacidade', '', '', '2011-03-29 00:20:43', '2011-03-29 00:20:43', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=229', 0, 'page', '', 0),
	(231, 2, '2011-03-29 00:25:24', '2011-03-29 00:25:24', '<p id="pagina_resumo">Nós acreditamos que as regras de conduta a seguir irão tornar nosso site mais útil e agradável a todos – e mais divertido também!</p>\n		<h3>Utilização do Blog</h3>\n\n	<p>Para utilizar do site Fisk, você declara ser:</p>\n\n	<ul>\n		<li><strong>maior de 13 anos de idade</strong></li>\n		<li>residente no Brasil</li>\n		<li>responsável pelo teor e veracidade dos seus comentários enviados ao site Fisk</li>\n		<li>isentar de responsabilidade o site Fisk sobre sua conduta enquanto utilizar os serviços desse site</li>\n	</ul>\n\n	<h3>Etiqueta e Conduta</h3>\n\n	<p><strong>Seja construtivo</strong>. Ao comentar, tente ajudar e esclarecer uma dúvida. Forneça argumentos razoáveis e convincentes.</p>\n\n	<p><strong>Respeite</strong>. Seja educado e respeite os demais usuários. Nem sempre você vai concordar com outras opiniões. Brigas não são justificadas.</p>\n\n	<p><strong>Seja igual</strong>. Não tente impor autoridade, superioridade aos outros, deixando a crer que apenas sua opinião é válida.</p>\n\n	<p><strong>Fale a verdade</strong>. Não especule ou espalhe boatos. Verifique a veracidade das informações antes de postá-las. Sua reputação vale ouro!</p>\n\n	<h3>Outras Dicas</h3>\n\n	<p>Se possível, não mencione nossos concorentes. Se for realmente necessário, faça-o vagamente, exemplo: ‘aquele outro fornecedor’, ‘lá no outro site de inglês’.</p>\n\n	<p>Seja discreto. Lembre-se que as informações contidas nesse site são públicas. Dessa forma, verifique o teor das fotos e textos que você enviar.</p>\n\n	<p>Participe. Ajude-nos a tornar o site melhor. Caso constate algum defeito, ou encontre algum usuário mal-educado, por favor entre em contato.</p>\n\n	<p><em>Comentários e demais conteúdos que não se enquadrarem nessas regras de conduta serão removidos sem notificação. Nos reservamos o direito de remover trechos de comentários e moderar perfis.</em></p>	<span class="clear block">&nbsp;</span>', 'Termos de uso', '', 'publish', 'open', 'open', '', 'termos-de-uso', '', '', '2011-03-29 00:25:24', '2011-03-29 00:25:24', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=231', 0, 'page', '', 0),
	(280, 2, '2011-03-31 01:25:19', '2011-03-31 01:25:19', '<p id="pagina_resumo">My First 1, 2 e 3</p>\n\n<h3>Série para crianças a partir dos 4 anos de idade</h3>\nPara alunos da educação infantil e 1º ano do ensino fundamental (4/6 anos)\n\nA série, composta de 3 níveis, fornece o estímulo ideal para uma atitude altamente positiva com relação ao novo idioma porque alia envolvimento emocional a uma grande variedade de atividades e recursos apropriados à faixa etária. Com livros, adesivos, pôsteres, cartões ilustrados, <abbr title="s">DVDs, atividades manuais, etc, esta série proporciona as ferramentas necessárias para um aprendizado mais ativo e eficaz.</abbr>\n\n<img class="alignleft size-medium wp-image-397" title="my_first_11264420174" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/my_first_11264420174-300x259.jpg" alt="" width="300" height="259" />\n<img class="alignleft size-full wp-image-405" title="my_first_21264420358" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/my_first_212644203583.jpg" alt="" width="168" height="145" />\n<img class="alignleft size-full wp-image-401" title="my_first_31264420370" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/my_first_312644203701.jpg" alt="" width="168" height="139" />', 'My First English Adventure', '', 'publish', 'open', 'open', '', 'my-first-english-adventure', '', '', '2011-03-31 01:25:19', '2011-03-31 01:25:19', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=280', 0, 'page', '', 0),
	(282, 2, '2011-03-31 01:27:42', '2011-03-31 01:27:42', '<p id="pagina_resumo">Playground 1, 2, 3 e 4</p>\nDesenvolvida para crianças em fase de alfabetização, esta série permite que os alunos usem as expressões do seu dia-a-dia na língua inglesa e ensina a pronunciar e a escrever as letras de uma maneira fácil e divertida.\n\nCom livros cheios de atividades, repletos de jogos, colagens e pinturas, as crianças constroem o conhecimento da língua de forma alegre e atraente. A confiança adquirida enquanto se aprende brincando, aumenta o entusiasmo e a vontade de falar inglês.\n\nDuração: 45 horas cada estágio\nFaixa etária: crianças cursando a 1ª e 2ª séries do ensino fundamental\n\n<img class="alignleft size-full wp-image-408" title="playground_11264171725" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/playground_11264171725.jpg" alt="" width="168" height="194" /><img class="alignleft size-full wp-image-409" title="playground_21264420211" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/playground_21264420211.jpg" alt="" width="168" height="193" />\n\n<img class="alignleft size-full wp-image-412" title="playground_41264171753" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/playground_41264171753.jpg" alt="" width="168" height="195" /><img class="alignleft size-full wp-image-410" title="playground_31264171743" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/playground_31264171743.jpg" alt="" width="168" height="195" />', 'FISK Playground', '', 'publish', 'open', 'open', '', 'fisk-playground', '', '', '2011-03-31 01:27:42', '2011-03-31 01:27:42', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=282', 0, 'page', '', 0),
	(285, 2, '2011-03-31 01:28:09', '2011-03-31 01:28:09', '<p id="pagina_resumo">Have Fun 1, 2 e 3</p>\r\nDuração: 45 horas cada estágio\r\nFaixa etária: crianças cursando a 3ª e 4ª séries do ensino fundamental\r\n\r\nA série combina estruturas simples da língua inglesa com expressões e diálogos. As crianças são incentivadas a brincar e a falar o tempo todo, aprimorando o que já sabem. Os jogos e as atividades interativas favorecem um aprendizado divertido.\r\n\r\nCom jogos, colagens e brincadeiras, os alunos vão construindo seu conhecimento da língua. Ao mesmo tempo, permitem a entrada de novos alunos, sem conhecimento prévio da língua, sem que estes tenham de esperar a “idade certa”.\r\n\r\n<img class="alignleft size-full wp-image-435" title="have_fun_11264171679" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_112641716791.jpg" alt="" width="168" height="196" /><img class="alignright size-full wp-image-436" title="have_fun_21264171692" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_212641716921.jpg" alt="" width="168" height="193" />\r\n\r\n<img class="alignleft size-medium wp-image-437" title="have_fun_31264171703" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_312641717031-256x300.jpg" alt="" width="256" height="300" />', 'Have Fun', '', 'publish', 'open', 'open', '', 'have-fun', '', '', '2015-01-27 16:03:43', '2015-01-27 16:03:43', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=285', 0, 'page', '', 0),
	(1257, 2, '2015-01-27 16:03:43', '2015-01-27 16:03:43', '<p id="pagina_resumo">Have Fun 1, 2 e 3</p>\r\nDuração: 45 horas cada estágio\r\nFaixa etária: crianças cursando a 3ª e 4ª séries do ensino fundamental\r\n\r\nA série combina estruturas simples da língua inglesa com expressões e diálogos. As crianças são incentivadas a brincar e a falar o tempo todo, aprimorando o que já sabem. Os jogos e as atividades interativas favorecem um aprendizado divertido.\r\n\r\nCom jogos, colagens e brincadeiras, os alunos vão construindo seu conhecimento da língua. Ao mesmo tempo, permitem a entrada de novos alunos, sem conhecimento prévio da língua, sem que estes tenham de esperar a “idade certa”.\r\n\r\n<img class="alignleft size-full wp-image-435" title="have_fun_11264171679" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_112641716791.jpg" alt="" width="168" height="196" /><img class="alignright size-full wp-image-436" title="have_fun_21264171692" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_212641716921.jpg" alt="" width="168" height="193" />\r\n\r\n<img class="alignleft size-medium wp-image-437" title="have_fun_31264171703" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_312641717031-256x300.jpg" alt="" width="256" height="300" />', 'Have Fun', '', 'inherit', 'open', 'open', '', '285-revision-v1', '', '', '2015-01-27 16:03:43', '2015-01-27 16:03:43', '', 285, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/285-revision-v1/', 0, 'revision', '', 0),
	(287, 2, '2011-03-31 01:28:51', '2011-03-31 01:28:51', '<p id="pagina_resumo">Teens 1, 2, 3, 4 e 5</p>\r\n<strong>Estágios:</strong> 08 livros\r\n<strong>Duração: </strong>45 horas cada estágio\r\n<strong>Faixa etária:</strong> a partir de 11 anos\r\n\r\nNesse nível, os alunos dão continuidade ao aprendizado e desenvolvem suas habilidades comunicativas através de lições envolventes que criam uma expectativa sobre o que está por vir. Os alunos também são estimulados a falar sobre si mesmos e a compartilhar suas opiniões e experiências com os colegas. Dessa forma, eles se tornam capazes de utilizar o que aprendem para se expressar com mais confiança.\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Teens', '', 'publish', 'open', 'open', '', 'fisk-teens', '', '', '2015-01-25 15:26:32', '2015-01-25 15:26:32', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=287', 0, 'page', '', 0),
	(1204, 1, '2015-01-25 15:26:32', '2015-01-25 15:26:32', '<p id="pagina_resumo">Teens 1, 2, 3, 4 e 5</p>\r\n<strong>Estágios:</strong> 08 livros\r\n<strong>Duração: </strong>45 horas cada estágio\r\n<strong>Faixa etária:</strong> a partir de 11 anos\r\n\r\nNesse nível, os alunos dão continuidade ao aprendizado e desenvolvem suas habilidades comunicativas através de lições envolventes que criam uma expectativa sobre o que está por vir. Os alunos também são estimulados a falar sobre si mesmos e a compartilhar suas opiniões e experiências com os colegas. Dessa forma, eles se tornam capazes de utilizar o que aprendem para se expressar com mais confiança.\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Teens', '', 'inherit', 'open', 'open', '', '287-revision-v1', '', '', '2015-01-25 15:26:32', '2015-01-25 15:26:32', '', 287, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/287-revision-v1/', 0, 'revision', '', 0),
	(289, 2, '2011-03-31 01:29:29', '2011-03-31 01:29:29', '<p id="pagina_resumo">Breaking Free &amp;  Spreading Wings</p>\nNível Inicial\nDuração: 50 a 55 horas cada estágio\nFaixa etária: a partir de 13 anos\nMétodo: Regular ou Personalizado\nRítmo: Rápido ou Intensivo\n\nOs dois primeiros livros da nova série para jovens e adultos têm como objetivo proporcionar aos alunos um aprendizado rápido e seguro da língua inglesa de forma envolvente e prazerosa. Com aulas dinâmicas e motivadoras, os alunos aprendem a se comunicar desde o primeiro dia de aula.\n\nAs estruturas e os pontos gramaticais da língua são apresentados dentro de um contexto significativo para os alunos.\n\nAs atividades de vídeo, bem como as lúdicas, foram elaboradas especificamente para esses estágios e oferecem mais oportunidades para os alunos praticarem o que foi aprendido.\n\n<img class="alignleft size-full wp-image-450" title="breaking_free1264171642" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/breaking_free1264171642.jpg" alt="" width="168" height="177" /><img class="alignrigth size-full wp-image-452" title="spreading_wings1264171763" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/spreading_wings1264171763.jpg" alt="" width="168" height="171" />\n\nPara reforçar o conteúdo visto em sala, o material vem acompanhado de <abbr title="s">CDs de áudio e CD-ROM.</abbr>', 'Nível Inicial', '', 'publish', 'open', 'open', '', 'nivel-inicial', '', '', '2011-03-31 01:29:29', '2011-03-31 01:29:29', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=289', 0, 'page', '', 0),
	(192, 2, '2010-01-22 02:17:08', '2010-01-22 02:17:08', '<p id="materia_resumo">Aconteceu no dia 28/03/2009 o nosso muito esperado FISK SHOP! Foi um sucesso!</p>\n<p>Muitos alunos, pais, Professores, funcionários e amigos estiveram na Unidade FISK Asa Sul para brincar e gastar os seus FISK DOLLARS acumulados ao longo do ano letivo de muito estudo. Foram momentos de muita diversão nos “stands” da nossa feira anual.</p>\n\n	<p>Tinha barracas de “souvenirs”, doces, cachorro quente, refrigerante e ainda tinha Pula-pula e cama elástica além um DJ que animou a todos os presentes. </p>\n\n	<p>Vale lembrar que neste primeiro semestre de 2010 teremos o FISK SHOP 2010, então se liga e pergunte ao seu Teacher o seu número de FISK DOLLARS e fique sempre atento aos Critérios de acúmulo. Seja um bom aluno e divirta-se à vontade com a FISK!</p><br />\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_01121264162605.jpg" alt="" title="FISK Shop 2" width="504" height="331" class="alignleft size-full wp-image-456" /><br />\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_01791264162155.jpg" alt="" title="FISK Shop 4" width="504" height="385" class="alignleft size-full wp-image-458" /><br />\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_01671264162145.jpg" alt="" title="FISK Shop 3" width="504" height="361" class="alignleft size-full wp-image-459" />\n\n	<p>Fique atento no nosso BLOG que daremos todos os detalhes!</p>\n\n	<p>Participe! Cadastra-se no nosso site e receba também as novidades por email! É grátis!</p>', 'FISK Shop 2009 - Asa Sul', '', 'publish', 'open', 'open', '', 'fisk-shop-2009-asa-sul', '', '', '2010-01-22 02:17:08', '2010-01-22 02:17:08', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=192', 0, 'post', '', 0),
	(194, 2, '2010-01-22 02:21:15', '2010-01-22 02:21:15', '<p id="materia_resumo">O Arraiá FISK 2009 foi "danado de bom, uai!"</p>\n<p>Aconteceu em 13/06/2009 o Arraia FISK 2009 num clima de muita alegria e diversão!</p>\n\n	<p>Estiveram presentes um número grande de alunos, pais, professores, funcionários e amigos da Unidade FISK Asa Sul.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_01871264162742.jpg" alt="" title="Festa Junina 1" width="504" height="364" class="alignleft size-full wp-image-449" />\n\n	<p>Tinha de tudo na nossa festa: Doces típicos, cachorro quente, pastel, refrigerante e jogos muitos divertidos. Quem participou da festa viu o sucesso que foi a nossa barraca da pescaria fez, os peixinhos foram muito disputados e houveram alunos que já tem até filhotes dos peixinhos capturados naquele dia</p>\n\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_01841264162733.jpg" alt="" title="Festa Junina 2" width="504" height="333" class="alignleft size-full wp-image-450" />	<br />\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_02101264162670.jpg" alt="" title="Festa Junina 3" width="504" height="393" class="alignleft size-full wp-image-452" /><br />\n<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/DSC_03201264162114.jpg" alt="" title="Festa Junina 4" width="422" height="640" class="alignleft size-full wp-image-453" />\n<br clear="all"/>\n	<p>Tivemos uma quadrilha muito animada que arrancou muitos aplausos dos presentes!</p>\n\n	<p>Fiquem atentos pois vem ai o Arraiá FISK 2010! Aqui no BLOG você ficará sabendo de tudo em primeira mão!</p>\n\n	<p>Se ligue.. Cadastre-se no nosso site e receba também as novidades por email! É grátis!</p>', 'Arraiá FISK 2009', '', 'publish', 'open', 'open', '', 'arraia-fisk-2009', '', '', '2010-01-22 02:21:15', '2010-01-22 02:21:15', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=194', 0, 'post', '', 0),
	(196, 2, '2010-01-22 02:23:43', '2010-01-22 02:23:43', '<p id="materia_resumo">O Prata da Casa 2009 revelou muitos talentos!</p>\n<p>Aconteceu no dia 25/09/2009 o Prata da Casa 2009!</p>\n\n	<p>Muitos alunos, ou melhor artistas, apresentaram seus números artísticos envolvendo Inglês ou Espanhol. Houveram apresentações músicais, teatralizações, declamações, apresentações em grupo e muito mais!</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/0031264162170.jpg" alt="" title="Prata da Casa 1" width="504" height="432" class="alignleft size-full wp-image-443" />\n\n	<p>Contamos com muitos presentes e os aplausos para os alunos artistas foram muito ouvidos durante aquela noite agradável de sexta-feira.</p>\n\n	<p>O ponto alto foi a apresentação da Banda &#8220;Walk Machine&#8221; que animou a todos com seus clássicos do rock dos anos 80.</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/0151264162178.jpg" alt="" title="Prata da Casa 2" width="504" height="512" class="alignleft size-full wp-image-445" />\n\n	<p>Os alunos que se apresentaram tiveram suas notas de participação aumentadas. <br />\nVocê já sabe, aqui na FISK ensino e cultura caminham sempre juntos.</p>\n\n	<p>Fique atento ao Prata da Casa 2010! Ensaie seu número artístico e vire um verdadeiro artista na FISK!</p>\n\n	<img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/0321264162194.jpg" alt="" title="Prata da Casa 4" width="422" height="640" class="alignleft size-full wp-image-446" /><br />\n        <img src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2010/01/0211264162185.jpg" alt="" title="Prata da Casa 3" width="504" height="377" class="alignleft size-full wp-image-447" />\n\n	<p>Acompanhe o nosso BLOG  e fique sempre por dentro de tudo que acontece na FISK! </p>\n\n	<p>Cadastre-se no nosso site e receba também as novidades por email! É grátis!</p>', 'Prata da Casa 2009', '', 'publish', 'open', 'open', '', 'prata-da-casa-2009', '', '', '2010-01-22 02:23:43', '2010-01-22 02:23:43', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=196', 0, 'post', '', 0),
	(198, 2, '2010-01-21 02:25:23', '2010-01-21 02:25:23', '<p id="materia_resumo">Venha conhecer a Unidade FISK TAGUATINGA NORTE! Com certeza você vai se encantar!</p>\n<p>É com muita alegria que inauguramos no dia 16/11/2009 mais uma Unidade FISK em Taguatinga Norte fruto de muito trabalho e dedicação de todos os Professores e Funcionários da Unidade Asa Sul que ajudaram fazer frutificar mais uma Escola embasada no mesmos valores que fazem de nossa Escola um verdadeiro sucesso!</p>\n\n	<p>Inauguramos um Centro de Ensino com amplas e modernas instalações, confira o que temos:</p>\n\n	<ul>\n		<li>3 Salas de Ensino Personalizado</li>\n		<li>3 Salas de Ensino Regular</li>\n		<li>1 Sala de Kids</li>\n		<li>1 Laboratório Multimídia</li>\n		<li>1 Auditório Audiovisual</li>\n		<li>1 Cafeteria</li>\n		<li>2 Lounges</li>\n		<li>1 Biblioteca</li>\n	</ul>\n\n	<p>Tudo isso numa &#8220;Great atmosphere!&#8221; para contribuir com o desenvolvimento cultural da comunidade de Taguatinga Norte e região.</p>\n\n	<p>Venha conhecer a Unidade FISK TAGUATINGA NORTE! Com certeza você vai se encantar!</p>\n\n	<p>Aqui no BLOG saberemos de tudo que acontece em Taguatinga Norte, não esqueca de se cadastrar para receber as novidades também por email!</p>', 'Inauguração da Unidade FISK Taguatinga Norte', '', 'publish', 'open', 'open', '', 'inauguracao-da-unidade-fisk-taguatinga-norte', '', '', '2010-01-21 02:25:23', '2010-01-21 02:25:23', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=198', 0, 'post', '', 0),
	(291, 2, '2011-03-31 01:30:01', '2011-03-31 01:30:01', '<p id="pagina_resumo">Aiming at the Sky &amp;  Flying High</p>\nNível Intermediário\nDuração: 50 a 55 horas o estágio\nMétodo: Regular ou Personalizado\nRítmo: Rápido ou Intensivo\n\nAiming at the Sky e Flying High foram planejados para aumentar a competência comunicativa dos alunos e oferecer-lhes oportunidades para expressarem suas opiniões numa variedade de situações com naturalidade e confiança.\n\nPara alcançar esse objetivo, o novo vocabulário e as novas estruturas são apresentados dentro de contextos específicos para que os alunos possam deduzir usos e regras e reterem as informações de modo mais duradouro. Estes estágios asseguram uma comunicação efetiva através da integração de todas as habilidades lingüísticas – conversação, compreensão auditiva, leitura e escrita – e permitem aos alunos a interação entre eles.\n\n<img class="alignleft size-full wp-image-456" title="aiming_sky1264171631" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/aiming_sky1264171631.jpg" alt="" width="168" height="180" /><img class="alignleft size-full wp-image-458" title="flying_high1264420196" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/flying_high1264420196.jpg" alt="" width="168" height="178" />', 'Nível Intermediário', '', 'publish', 'open', 'open', '', 'nivel-intermediario', '', '', '2011-03-31 01:30:01', '2011-03-31 01:30:01', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=291', 0, 'page', '', 0),
	(293, 2, '2011-03-31 01:30:29', '2011-03-31 01:30:29', '<p id="pagina_resumo">Expanding Horizons &amp;  Wings of Freedom</p>\nNível Avançado\nDuração: 50 a 55 horas cada estágio\nMétodo: Regular ou Personalizado\nRítmo: Rápido ou Intensivo\n\nExpanding Horizons e Wings of Freedom visam fortalecer as habilidades comunicativas dos alunos através de práticas gramaticais, textos e vocabulário mais avançados e de variadas atividades de escrita, compreensão auditiva e conversação. Os alunos aprimoram seus conhecimentos e, consequentemente, usam o idioma não só mais fluentemente como também mais corretamente.\n\n<img class="alignleft size-full wp-image-460" title="expanding_horizons1264171654" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/expanding_horizons1264171654.jpg" alt="" width="168" height="178" /><img class="alignleft size-full wp-image-462" title="wings_freedom1264171830" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/wings_freedom1264171830.jpg" alt="" width="168" height="176" />', 'Nível Avançado', '', 'publish', 'open', 'open', '', 'nivel-avancado', '', '', '2011-03-31 01:30:29', '2011-03-31 01:30:29', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=293', 0, 'page', '', 0),
	(295, 2, '2011-03-31 01:30:58', '2011-03-31 01:30:58', '<p id="pagina_resumo">Focus on FISK Final</p>\nNível Aperfeiçoamento\nDuração: 50 a 55 horas\nMétodo: Regular ou Personalizado\nRítmo: Rápido ou Intensivo\n\nO objetivo deste estágio é preparar o aluno para esse exame final, além de proporcionar-lhe uma consolidação de seus conhecimentos do idioma e de suas habilidades comunicativas. Após o Focus on Fisk Final, o aluno prestará um exame para obter o certificado de conclusão do curso.\n\n<img class="alignleft size-full wp-image-431" title="focus1264171667" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/focus1264171667.jpg" alt="" width="168" height="173" />', 'Nível Aperfeiçoamento', '', 'publish', 'open', 'open', '', 'nivel-aperfeicoamento', '', '', '2011-03-31 01:30:58', '2011-03-31 01:30:58', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=295', 0, 'page', '', 0),
	(298, 2, '2011-03-31 01:31:31', '2011-03-31 01:31:31', '<p id="pagina_resumo">Proficiency Course for Diploma &amp; TOEFL</p>\r\nEstágio: Proficiency Course for Diploma &amp; TOEFL\r\nDuração: 55 horas cada\r\nMétodo: Regular ou Personalizado\r\nRítmo: Rápido ou Intensivo\r\n\r\nNeste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination.\r\n\r\nA Proficiência internacional pode ser conseguida através do Curso Preparatório para o Exame TOEFL IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul, Asa Norte e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material didático, que nos tem garantido excelentes índices de aprovação nestes exames.\r\n\r\n<strong>FISK, TODO MUNDO FALA BEM!</strong>', 'Proficiência', '', 'publish', 'open', 'open', '', 'proficiencia', '', '', '2013-03-26 23:45:31', '2013-03-26 23:45:31', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=298', 0, 'page', '', 0),
	(1095, 2, '2011-09-28 20:12:07', '2011-09-28 20:12:07', '<strong>MAY I HELP YOU? - BOOK 1 &amp; 2</strong>\r\n\r\nCom o advento dos grandes eventos que o Brasil sediará nos próximos anos, a FISK apresenta o curso <strong><em>May I Help You?</em></strong>, que consiste em curso prático de conversação situacional em inglês totalmente desenvolvido para suprir as necessidades de todos que precisam de uma preparação rápida para as grandes oportunidades que virão.\r\n<p style="text-align: justify;">O curso tem como objetivo preparar quem trabalha na área de turismo, hotelaria ou viaja a negócios ou lazer para interagir com pessoas de todo o mundo. Os principais diferenciais dessa modalidade são: conversação imediata, apresentação de expressões e frases situacionais, diálogos-modelo, vocabulário temático e atividades de compreensão auditiva e de pronúncia. Para reforçar o conteúdo estudado em sala, o material vem acompanhado de CDs de áudio.</p>\r\n<p style="text-align: justify;"><strong>O curso tem duração de somente 8 meses com carga horária de 80 h/a divididas em 2 vezes na semana de 1h15min</strong>. As aulas podem ser dadas nas sedes das Escolas FISK ASA SUL e TAGUATINGA NORTE ou na modalidade "In company" que consiste em aulas dadas na sede da empresa parceira com professores, material didático e metodologia FISK.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg"><img class="alignleft size-full wp-image-872" title="May I help you" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg" alt="" width="174" height="227" /></a></p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg"><img class="alignright size-full wp-image-873" title="May I help you2" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg" alt="" width="175" height="226" /></a></p>', 'Curso May I Help you?', '', 'inherit', 'open', 'open', '', '860-revision-v1', '', '', '2011-09-28 20:12:07', '2011-09-28 20:12:07', '', 860, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/860-revision-12/', 0, 'revision', '', 0),
	(311, 2, '2011-03-31 01:55:17', '2011-03-31 01:55:17', '<p id="pagina_resumo">Conheça nossos Cursos de Inglês</p>\n<p>Na FISK, crianças a partir de 4 anos já começam a se comunicar em inglês.</p>\n<p>Veja abaixo quais as opções que a FISK oferece para crianças, jovens e adultos:</p>\n', 'Cursos de Inglês', '', 'publish', 'open', 'open', '', 'cursos-de-ingles', '', '', '2011-03-31 01:55:17', '2011-03-31 01:55:17', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=311', 0, 'page', '', 0),
	(316, 2, '2011-03-31 02:50:30', '2011-03-31 02:50:30', '<p id="pagina_resumo">Conheça os nossos Cursos de Espanhol</p>\nNa FISK você pode aprender Espanhol a partir dos 9 anos.', 'Cursos de Espanhol', '', 'publish', 'open', 'open', '', 'cursos-de-espanhol', '', '', '2011-03-31 02:50:30', '2011-03-31 02:50:30', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=316', 0, 'page', '', 0),
	(318, 2, '2011-03-31 02:51:34', '2011-03-31 02:51:34', '<p id="pagina_resumo">Aprenda o Português sem Tropeços na FISK!</p>\n\n<h3>Português sem tropeços 1 e  2</h3>\n<strong>Faixa Etária</strong>: jovens e adultos que já tenham terminado o Ensino regular\n\n<strong>Duração</strong>: 40 horas cada nível\n\n<img class="alignleft size-full wp-image-427" title="DSC_01351264421160" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/DSC_01351264421160.jpg" alt="" width="200" height="284" /><img class="alignleft size-full wp-image-428" title="DSC_01361264161229" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/DSC_01361264161229.jpg" alt="" width="202" height="287" />\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;\n\nO objetivo do curso é proporcionar o aprimoramento das habilidades comunicativas oral e de escrita dos alunos por meio da atualização gramatical e do esclarecimento das dúvidas mais freqüentes dos falantes de português do Brasil. Por meio de temas e situações pertinentes ao âmbito profissional, Português sem tropeços 1 e 2 auxiliam os alunos na produção de textos orais e escritos coerentes e, portanto, adequados a qualquer ato comunicativo. Mais do que gramática, os livros oferecem a base para o progresso dos alunos quanto ao domínio da norma culta da língua portuguesa, ampliando, assim, as possibilidades dos alunos ascenderem profissionalmente.', 'Cursos de Português', '', 'publish', 'open', 'open', '', 'cursos-de-portugues', '', '', '2011-03-31 02:51:34', '2011-03-31 02:51:34', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=318', 0, 'page', '', 0),
	(320, 2, '2011-03-31 02:52:52', '2011-03-31 02:52:52', '<p id="pagina_resumo">A série FISK.COM tem como objetivo desenvolver as competências tecnológicas para que os alunos dominem os principais softwares disponíveis no mercado.\r\nUtilizando uma abordagem voltada a pratica, o material traz exercícios passo a passo que ajudam o aluno a entender como utilizar as principais ferramentas de cada software estudado.\r\nUm dos principais diferenciais do material é que a parte teórica está diluída ao longo do curso através de atividades dinâmicas que farão com que o aluno entenda as principais terminologias da área de informática, sem que a aula se torne monótona e cansativa.</p>', 'Cursos de Informática', '', 'publish', 'open', 'open', '', 'cursos-de-informatica', '', '', '2015-01-25 15:28:48', '2015-01-25 15:28:48', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=320', 0, 'page', '', 0),
	(322, 2, '2011-03-31 02:58:03', '2011-03-31 02:58:03', '<p id="pagina_resumo">Chiquiteens 1 e 2</p>\r\nEstágios: Chiquiteens 1 e 2\r\nDuração: 40 a 45 horas cada estágio\r\nFaixa etária: 10 / 11 anos ( a partir do sexto ano do ensino fundamental)\r\nMétodo: Regular ou Personalizado\r\nRítmo: Rápido ou intensivo\r\n\r\nNos livros Chiquiteens 1 e 2 encontram-se atividades interessantes e motivadoras, considerando-se sempre as características cognitivas, os interesses e os conhecimentos prévios do aluno dessa faixa etária. Ao final de cada livro, estão as Tarefas, que sistematizam os pontos gramaticais abordados em cada uma das lições com exercícios que objetivam, através da prática individual a reflexão a respeito do que foi aprendido em sala de aula.\r\n\r\nAo concluir o livro Chiquiteens 2 o aluno estará capacitado para comunicar-se em espanhol de um modo simples, porém com grande desenvoltura.', 'Chiquiteens', '', 'publish', 'open', 'open', '', 'chiquiteens', '', '', '2015-01-27 16:08:54', '2015-01-27 16:08:54', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=322', 0, 'page', '', 0),
	(1255, 2, '2015-01-27 16:01:56', '2015-01-27 16:01:56', '<p id="pagina_resumo">Chiquiteens 1 e 2</p>\r\nEstágios: Chiquiteens 1 e 2\r\nDuração: 40 a 45 horas cada estágio\r\nFaixa etária: 10 / 11 anos ( a partir do sexto ano do ensino fundamental)\r\nMétodo: Regular ou Personalizado\r\nRítmo: Rápido ou intensivo\r\n\r\nNos livros Chiquiteens 1 e 2 encontram-se atividades interessantes e motivadoras, considerando-se sempre as características cognitivas, os interesses e os conhecimentos prévios do aluno dessa faixa etária. Ao final de cada livro, estão as Tarefas, que sistematizam os pontos gramaticais abordados em cada uma das lições com exercícios que objetivam, através da prática individual a reflexão a respeito do que foi aprendido em sala de aula.\r\n\r\nAo concluir o livro Chiquiteens 2 o aluno estará capacitado para comunicar-se em espanhol de um modo simples, porém com grande desenvoltura.', 'Chiquiteens', '', 'inherit', 'open', 'open', '', '322-revision-v1', '', '', '2015-01-27 16:01:56', '2015-01-27 16:01:56', '', 322, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/322-revision-v1/', 0, 'revision', '', 0),
	(324, 2, '2011-03-31 02:58:47', '2011-03-31 02:58:47', '<p id="pagina_resumo">Español con Ñ1, Ñ2, Ñ3, Ñ4 e Ñ5</p>\nO curso de espanhol foi criado para atender a um público formado por jovens a partir dos 14 anos e adultos. Ele é composto de 5 estágios com duração de 50 a 55 horas. O curso é dividido em 1 estágio do Nível básico (Español con Ñ1), 2 estágios do Intermediário (Español con Ñ2 &amp; Ñ3), 1 estágio do avançado (Español con Ñ4) e 1 estágio do Nível Aperfeiçoamento (Español con Ñ5), sendo este último um preparatório para os exames de Proficiência da Universidade de Salamanca.\n\nMétodo: Regular ou Personalizado\n\nRítmo: Rápido ou Intensivo\n\n<img class="alignleft size-full wp-image-421" title="espanhol_n11264171853" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/espanhol_n11264171853.jpg" alt="" width="168" height="180" /><img class="alignleft size-full wp-image-422" title="espanhol_n21264172000" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/espanhol_n21264172000.jpg" alt="" width="168" height="171" />\n\n\n<img class="alignleft size-full wp-image-424" title="espanhol_n41264172012" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/espanhol_n41264172012.jpg" alt="" width="168" height="176" /><img class="alignleft size-full wp-image-425" title="espanhol_n51264172025" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/espanhol_n51264172025.jpg" alt="" width="168" height="179" />\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3></h3>\n<h3>!VENGA CON NOSOTROS!</h3>\nO método foi planejado cuidadosamente para que o aluno aprenda as estruturas gramaticais e o vocabulário necessário de forma dinâmica e participativa, facilitando a fixação e a incorporação da língua espanhola.\n\nO aluno desenvolve a conversação utilizando a linguagem cotidiana dos países de fala hispânica. Leitura, exercícios escritos, tarefas e a prática auditiva com o uso de gravações também contribuem para aumentar a competência comunicativa do aluno, o que torna o ensino mais agradável e divertido.\n\nAo término da série o aluno será capaz de comunicar-se com fluência e desenvoltura na língua espanhola, terá entrado em contato com manifestações culturais diferentes da sua e aprendido sobre a pluralidade mundial. O último livro da série também prepara o aluno para prestar o exame de Proficiência de Língua Espanhola da Universidade de Salamanca.', 'Español con Ñ', '', 'publish', 'open', 'open', '', 'espanol-con-n', '', '', '2011-03-31 02:58:47', '2011-03-31 02:58:47', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=324', 0, 'page', '', 0),
	(328, 2, '2011-03-31 03:01:44', '2011-03-31 03:01:44', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO InDesign é uma poderosa ferramenta voltada para a área de design, que permite ao usuário criar diversos layouts, como cartões, folhetos, jornais, revistas, entre outros.\r\nDesenvolvido para substituir o PageMaker, ele faz parte do Adobe Creative Suite, um pacote de programas para designers.\r\nO curso aborda as principais ferramentas para a criação de trabalhos profissionais, trazendo apresentações passo a passo das ferramentas, seguidas de exercícios práticos que facilitam o processo de aprendizado.', 'InDesign', '', 'publish', 'open', 'open', '', 'indesign', '', '', '2015-01-25 15:33:32', '2015-01-25 15:33:32', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=328', 0, 'page', '', 0),
	(1212, 1, '2015-01-25 15:33:32', '2015-01-25 15:33:32', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO InDesign é uma poderosa ferramenta voltada para a área de design, que permite ao usuário criar diversos layouts, como cartões, folhetos, jornais, revistas, entre outros.\r\nDesenvolvido para substituir o PageMaker, ele faz parte do Adobe Creative Suite, um pacote de programas para designers.\r\nO curso aborda as principais ferramentas para a criação de trabalhos profissionais, trazendo apresentações passo a passo das ferramentas, seguidas de exercícios práticos que facilitam o processo de aprendizado.', 'InDesign', '', 'inherit', 'open', 'open', '', '328-revision-v1', '', '', '2015-01-25 15:33:32', '2015-01-25 15:33:32', '', 328, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/328-revision-v1/', 0, 'revision', '', 0),
	(330, 2, '2011-03-31 03:02:24', '2011-03-31 03:02:24', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Photoshop é um dos softwares mais populares do mercado gráfico, pois trabalha com a edição profissional de imagens.\r\nBoa parte de sua popularidade está relacionada com as transformações que conseguimos fazer nas fotos, principalmente em itens relacionados à beleza. Por isso, ele é bastante utilizado na produção de imagens para revistas, anúncios, sites, etc.\r\nEntretanto, o Photoshop vai muito além da questão de deixar as pessoas “perfeitas”. Com ele, podemos criar ilustrações digitais brincando com a realidade, ajustar a parte técnica da imagem, como por exemplo, o modo de cor correto para impressão ou para Web, adequar a foto ao tipo de papel no qual será impressa, entre outras coisas.\r\nO curso foi planejado e desenvolvido para proporcionar aos alunos uma visão ampla dos principais recursos oferecidos no programa, através de exercícios práticos que mostrarão como combinar as diferentes ferramentas para a produção de trabalhos profissionais.', 'Photoshop', '', 'publish', 'open', 'open', '', 'photoshop', '', '', '2015-01-25 15:33:09', '2015-01-25 15:33:09', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=330', 0, 'page', '', 0),
