	(332, 2, '2011-03-31 03:03:06', '2011-03-31 03:03:06', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO CorelDRAW é um programa utilizado para a criação de ilustrações vetoriais, designs de logotipos e criação de páginas.\r\nUtilizando uma abordagem dinâmica, o curso aborda as principais ferramentas para a criação de trabalhos profissionais. Ele traz apresentações passo a passo das ferramentas, seguidas de exercícios práticos que facilitam o processo de aprendizado.', 'CorelDRAW', '', 'publish', 'open', 'open', '', 'corel-draw', '', '', '2015-01-25 15:32:23', '2015-01-25 15:32:23', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=332', 0, 'page', '', 0),
	(1210, 1, '2015-01-25 15:32:23', '2015-01-25 15:32:23', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO CorelDRAW é um programa utilizado para a criação de ilustrações vetoriais, designs de logotipos e criação de páginas.\r\nUtilizando uma abordagem dinâmica, o curso aborda as principais ferramentas para a criação de trabalhos profissionais. Ele traz apresentações passo a passo das ferramentas, seguidas de exercícios práticos que facilitam o processo de aprendizado.', 'CorelDRAW', '', 'inherit', 'open', 'open', '', '332-revision-v1', '', '', '2015-01-25 15:32:23', '2015-01-25 15:32:23', '', 332, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/332-revision-v1/', 0, 'revision', '', 0),
	(334, 2, '2011-03-31 03:03:52', '2011-03-31 03:03:52', '<strong>Word</strong>\r\n\r\n<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nUtilizado na criação de documentos profissionais, o Word 2010 é um software que integra o pacote Office, desenvolvido pela Microsoft.\r\nEle é um poderoso editor de textos que permite ao usuário trabalhar não apenas com textos, mas também com outros recursos, como a manipulação de imagens, gráficos, tabelas, entre outros. Tudo isso é possível porque o programa utiliza recursos de editoração eletrônica.\r\nO curso de Word 2010 mostra uma visão completa do programa, passando por todas as etapas da criação de documentos profissionais que possam ser utilizados em diferentes contextos.\r\n\r\n<strong>Excel</strong>\r\n\r\n<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nCada vez mais as empresas têm utilizado os recursos das planilhas eletrônicas para a realização de cálculos, organização de dados e a criação de gráficos.\r\nNesse contexto surge, o Microsoft Excel, um programa que faz parte do pacote Office e é responsável pela criação e gerenciamento desse tipo de documento.\r\nO curso de Excel da Fisk tem como objetivo abordar as principais ferramentas do programa, de modo que o aluno seja capaz de criar trabalhos profissionais de forma rápida e eficaz.\r\n\r\n<strong>PowerPoint</strong>\r\n\r\n<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nCada vez mais as empresas e as pessoas fazem uso das apresentações de slides em feiras, seminários, palestras, aulas, entre outros, devido à facilidade que este tipo de ferramenta proporciona na exposição de assuntos de diferentes áreas.\r\nO Microsoft PowerPoint é um programa que faz parte do pacote Office e auxilia na criação e no gerenciamento dessas apresentações.\r\nO curso de PowerPoint 2010 aborda todas as etapas da criação de uma apresentação de slides profissional, permitindo desta forma que o aluno domine as principais ferramentas do programa.', 'Word, Excel e PowerPoint', '', 'publish', 'open', 'open', '', 'pacote-office', '', '', '2015-01-25 15:31:17', '2015-01-25 15:31:17', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=334', 0, 'page', '', 0),
