	(336, 2, '2011-03-31 03:04:29', '2011-03-31 03:04:29', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Windows é o sistema operacional mais utilizado em todo o mundo, porém poucas pessoas conseguem realmente utilizar seus recursos mais avançados.\r\nSendo assim, a proposta do curso de Windows é apresentar o sistema operacional de maneira profissional, abordando recursos como, por exemplo, backup de arquivos e restauração do sistema, tarefas que poucas pessoas conseguem realizar.\r\nAlém disso, as terminologias fundamentais de informática foram selecionadas visando o usuário que utiliza o computador como uma de suas ferramentas de trabalho e não o técnico de informática. Por essa razão, utilizamos uma abordagem diferenciada na forma como tais termos são apresentados.', 'Windows', '', 'publish', 'open', 'open', '', 'windows-xp-e-internet', '', '', '2015-01-25 15:29:33', '2015-01-25 15:29:33', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=336', 0, 'page', '', 0),
	(1207, 1, '2015-01-25 15:29:33', '2015-01-25 15:29:33', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Windows é o sistema operacional mais utilizado em todo o mundo, porém poucas pessoas conseguem realmente utilizar seus recursos mais avançados.\r\nSendo assim, a proposta do curso de Windows é apresentar o sistema operacional de maneira profissional, abordando recursos como, por exemplo, backup de arquivos e restauração do sistema, tarefas que poucas pessoas conseguem realizar.\r\nAlém disso, as terminologias fundamentais de informática foram selecionadas visando o usuário que utiliza o computador como uma de suas ferramentas de trabalho e não o técnico de informática. Por essa razão, utilizamos uma abordagem diferenciada na forma como tais termos são apresentados.', 'Windows', '', 'inherit', 'open', 'open', '', '336-revision-v1', '', '', '2015-01-25 15:29:33', '2015-01-25 15:29:33', '', 336, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/336-revision-v1/', 0, 'revision', '', 0),
	(139, 2, '2010-11-06 16:53:40', '2010-11-06 16:53:40', 'O Halloween 2010 foi de arrepiar!\nA FISK ASA SUL promoveu uma semana de atividades de Halloween (26 a 30/10) que foram de arrepiar!\n\nAlém do tradicional “Costume contest”  que é o nosso concurso de fantasias que todos os anos agitam os nossos alunos, este ano tivemos a “Haunted house”  que foi uma atração muito divertida, que consistia em uma casa mal assombrada com muitos túneis e “surpresas” assustadoras.  Os alunos que “sobreviviam” ainda tinham que escutar uma história interativa onde tinham sensações para lá de reais!\n\nHouve a participação efetiva dos nossos alunos, professores e funcionários que após as fortes emoções da “Haunted house” puderam desfrutar de um delicioso “Halloween snack” onde o prato principal foi o “Cemetery cake”!\n\nHouveram alguns alunos que produziram uma “Jack-o-latern” que foi usada em algumas turmas de jovens e adultos para proporcionar ambiência para alguns “Creepy tales” que alguns professores trouxeram para as aulas.\n\nO Halloween 2010 foi demais!\n\nArrepie-se você tambem com as fotos:\n\n[nggallery id=5] ', 'HALLOWEEN 2010 - FISK ASA SUL', '', 'publish', 'open', 'open', '', 'evento-1', '', '', '2010-11-06 16:53:40', '2010-11-06 16:53:40', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=139', 0, 'post', '', 0),
	(145, 2, '2010-11-10 02:27:36', '2010-11-10 02:27:36', '<p id="materia_resumo">Taguatinga Norte arrepiou-se com a FISK!</p>\nUma semana inteira de muita diversão e arrepios movimentou a Escola FISK Taguatinga Norte.\n\nPela primeira vez realizou-se o “Costume Contest” que consiste em um concurso de fantasias o qual cada aluno vem caraterizado em um personagem de Halloween. Não faltaram bruxas, zumbis, vampiros etc.\n\nFoi a maior curtição pois ocorreram muitas brincadeiras iradas, além do um delicioso “Snack” com muitas gostosuras como o bolo cemitério que todos “devoraram”.\n\nParticiparam alunos, professores e funcionários desta comemoração que é um dos pontos altos da cultura que envolve os países de língua inglesa.\n\nArrepie-se você também conferindo as fotos:\n\n[nggallery id=4] ', 'Halloween 2010 - FISK TAG. NORTE', '', 'publish', 'open', 'open', '', 'noticia', '', '', '2010-11-10 02:27:36', '2010-11-10 02:27:36', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=145', 0, 'post', '', 0),
	(1102, 2, '2013-06-05 15:15:17', '2013-06-05 15:15:17', 'Neste ano de 2013 a FISK realizou o café da manhã de dia das mães, com o intuito de homenagear aquelas que representam o dom da criação, da doação e do amor incondicional. O evento foi repleto de carinho e alegrias, foi surpreendente ver nossos alunos se relacionando com suas mães e mostrando seus trabalhos realizados em homenagem a elas.\n\nConfira abaixo as fotos do evento realizados nas três unidades Fisk, Asa Sul, Asa Norte e Taguatinga Norte.\n\n[nggallery id=37]', 'Café da manhã em homenagem ao dia das mães!', '', 'inherit', 'open', 'open', '', '1097-revision-5', '', '', '2013-06-05 15:15:17', '2013-06-05 15:15:17', '', 1097, 'http://dev.webfacetecnologia.com.br/fisk/2013/06/1097-revision-5/', 0, 'revision', '', 0),
