	(166, 2, '2010-06-24 01:27:16', '2010-06-24 01:27:16', '<p id="materia_resumo">Veja fotos da nossa viagem ao Hopi Hari!</p>\nUma galera da FISK Asa Sul e FISK Taguatinga Norte foi ao Hopi Hari nos dias 2 a 6 de junho de 2010 e se divertiu bastante. Veja as fotos!\n\n[nggallery id=8] ', 'FISK no Hopi Hari 2010', '', 'publish', 'open', 'open', '', 'fisk-no-hopi-hari-2010', '', '', '2010-06-24 01:27:16', '2010-06-24 01:27:16', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=166', 0, 'post', '', 0),
