	(172, 2, '2010-06-10 01:41:51', '2010-06-10 01:41:51', '<p id="materia_resumo">Profissionais que dominam o inglês e o espanhol chegam a receber 21,7% a mais do que os colegas que conseguem apenas se comunicar em português</p>\n<p>Investir no aprendizado de outros idiomas o quanto antes é a melhor opção para quem pretende se destacar no mercado de trabalho. A formação em línguas estrangeiras representa um diferencial não só na hora de se conseguir uma vaga de emprego, mas quando o assunto é dinheiro. Prova de que as empresas brasileiras valorizam essa fluência está na 31ª edição da Pesquisa Salarial e de Benefícios da Catho Online, realizada de 1º a 27 de fevereiro deste ano. O estudo revelou que falar inglês e espanhol tem impacto direto no bolso e pode elevar em até 21,78% os salários de profissionais que ocupam cargos de confiança — diretor, gerente, coordenador, supervisor e chefe. </p>\n\n	<p>O levantamento foi feito com cerca de 175 mil pessoas de mais de 21 mil empresas em 3.550 cidades de todo o país. Entre coordenadores, supervisores e chefes, a remuneração média varia entre R$ 4.343,98 (só português) e R$ 5.290,03 (inglês e espanhol), uma diferença de 21,78%. Os dados mostram que o aumento varia de acordo com os idiomas. Quem fala só português ganha menos do que quem fala também espanhol, que, por sua vez, recebe menos do que quem domina só o inglês e do que aqueles com fluência nas duas línguas estrangeiras. </p>\n\n	<p>No nível gerencial, a valorização é de 19,24% para os fluentes em inglês e espanhol. Os salários médios passam de R$ 7.498,66 a R$ 8.941,14.O nível hierárquico de diretoria tem a menor diferença salarial para profissionais que dominam as duas línguas: 18,23%, partindo de R$ 14.176,71 e atingindo o patamar de R$ 16.761,55. Na avaliação de Marco Soraggi, diretor da Pesquisa Salarial da Catho Online, as informações traduzem uma realidade no mercado de trabalho. “A globalização torna necessário, cada vez mais, o domínio de outras línguas. Saber falar inglês e espanhol é vantagem competitiva e se traduz, também, em maior ganho financeiro”, resume. </p>\n\n	<h3>Negócios </h3>\n\n	<p>Soraggi destaca que as empresas têm feito mais negócios com clientes ou fornecedores de outros países e que eles raramente estarão disponíveis para negociar em português. “A linguagem padrão para relacionamentos internacionais é o inglês. E muitas vezes, principalmente, para negócios na América Latina, saber espanhol também é muito útil. Profissionais que falam bem e negociam nessas línguas, naturalmente, alcançam melhores resultados.” Ele lembra que, quanto mais cedo o início da aprendizagem, melhor. Porém afirma que isso não invalida que adultos comecem a se dedicar também. </p>\n\n	<p>É o caso de Sandra Regina Pereira, 35 anos, gerente do sistema integrado de gestão do Laboratório Sabin. A paraibana conta que resolveu aprimorar o inglês quando estava perto de concluir o curso de administração de empresas, e precisou estudar artigos na língua estrangeira. Pouco depois de se formar, conseguiu uma licença do trabalho para se dedicar a um curso de três meses na Inglaterra, onde morou em casa de família, o que ajudou a melhorar a escuta e a conversação. Na volta, decidiu mudar-se para Brasília. “O fato de ter esse curso me ajudou muito na recolocação profissional. A importância do inglês é muita, deixa você preparado para qualquer coisa”, observa. Além de trabalhar no laboratório, Sandra dá aulas em graduação e pós-graduação, o que exige dela o domínio de outro idioma para conhecer e entender o que está sendo produzido do mundo. </p>\n\n	<p>Matéria publicada no Correio Braziliense &#8211; Eu, Estudante <em>Camila de Magalhães</em><br />\nhttp://www.correioweb.com.br/euestudante/noticias.php?id=11441&amp;tp=8</p>', 'A importância de saber outro idioma para a carreira', '', 'publish', 'open', 'open', '', 'a-importancia-de-saber-outro-idioma-para-a-carreira', '', '', '2010-06-10 01:41:51', '2010-06-10 01:41:51', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=172', 0, 'post', '', 0),
	(174, 2, '2010-04-28 01:52:01', '2010-04-28 01:52:01', '<p id="materia_resumo">Confira as fotos do FISK Shop 2010 e sorria!</p>\nUma tarde inteira de muita diversão, entrega de brindes e brincadeiras com participação de vários alunos e pais! Assim foi o FISK Shop 2010, realizado no último sábado, na unidade FISK Asa Sul.\n\nNeste dia todos puderam conferir como é bom estudar na FISK. Aqui o nosso esforço vale a pena! Aqueles que estudaram mais, curtiram mais!\n\nNão fique de fora do FISK SHOP 2011, estude muito que muitas novidades virão na próxima edição!\n\n[nggallery id=10] ', 'Muita diversão no FISK Shop 2010!', '', 'publish', 'open', 'open', '', 'muita-diversao-no-fisk-shop-2010', '', '', '2010-04-28 01:52:01', '2010-04-28 01:52:01', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=174', 0, 'post', '', 0),
