	(860, 2, '2011-09-28 00:12:35', '2011-09-28 00:12:35', '<strong>MAY I HELP YOU? - BOOK 1 &amp; 2</strong>\r\n\r\nCom o advento dos grandes eventos que o Brasil sediará nos próximos anos, a FISK apresenta o curso <strong><em>May I Help You?</em></strong>, que consiste em curso prático de conversação situacional em inglês totalmente desenvolvido para suprir as necessidades de todos que precisam de uma preparação rápida para as grandes oportunidades que virão.\r\n<p style="text-align: justify;">O curso tem como objetivo preparar quem trabalha na área de turismo, hotelaria ou viaja a negócios ou lazer para interagir com pessoas de todo o mundo. Os principais diferenciais dessa modalidade são: conversação imediata, apresentação de expressões e frases situacionais, diálogos-modelo, vocabulário temático e atividades de compreensão auditiva e de pronúncia. Para reforçar o conteúdo estudado em sala, o material vem acompanhado de CDs de áudio.</p>\r\n<p style="text-align: justify;"><strong>O curso tem duração de somente 8 meses com carga horária de 80 h/a divididas em 2 vezes na semana de 1h15min</strong>. As aulas podem ser dadas nas sedes das Escolas FISK ASA SUL, ASA NORTE e TAGUATINGA NORTE ou na modalidade "In company" que consiste em aulas dadas na sede da empresa parceira com professores, material didático e metodologia FISK.</p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg"><img class="alignleft size-full wp-image-872" title="May I help you" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg" alt="" width="174" height="227" /></a></p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg"><img class="alignright size-full wp-image-873" title="May I help you2" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg" alt="" width="175" height="226" /></a></p>', 'Curso May I Help you?', '', 'publish', 'open', 'closed', '', 'curso-may-i-help-you', '', '', '2015-01-27 16:03:01', '2015-01-27 16:03:01', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=860', 0, 'page', '', 0),
	(879, 2, '2011-09-30 16:56:15', '2011-09-30 16:56:15', 'Nessa semana (26/09 a 01/10) está acontecendo a Primeira Semana Cultural FISK Asa Sul e já está sendo um sucesso! Números incríveis estão acontecendo durante todo o dia e o mais interessante é que os nossos alunos que são os artistas!  Os alunos participantes concorrem a prêmios FISK e ainda aumentam a sua nota de participação. Se você ainda não se apresentou ainda dá tempo, mostre o seu talento artístico até sábado. Confira as fotos das apresentações já ocorridas e aplauda os participantes!\r\n\r\n[nggallery id=21]', 'Semana Cultural Fisk Asa Sul (fotos)', '', 'publish', 'open', 'open', '', 'semana-cultural-fisk-fotos', '', '', '2011-09-30 17:25:06', '2011-09-30 17:25:06', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=879', 0, 'post', '', 0),
	(865, 2, '2011-09-28 00:12:35', '2011-09-28 00:12:35', '<div>\r\n<p id="pagina_resumo">Proficiency Course for Diploma &amp; TOEFL</p>\r\nEstágio: Proficiency Course for Diploma &amp; TOEFL\r\nDuração: 55 horas cada\r\nMétodo: Regular ou Personalizado\r\nRítmo: Rápido ou Intensivo\r\n\r\nNeste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination.\r\n\r\nA Proficiência internacional pode ser conseguida através dos Cursos Preparatórios para os Exames TOEFL ITP (Institucional) &amp; IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material preparatório, que nos tem garantido excelentes índices de aprovação nestes exames.\r\n\r\n<strong>FISK, O MUNDO RECONHECE QUEM FAZ!</strong>\r\n\r\n</div>\r\n&nbsp;', 'Curso May I help You?', '', 'inherit', 'open', 'open', '', '860-revision-v1', '', '', '2011-09-28 00:12:35', '2011-09-28 00:12:35', '', 860, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/860-revision-2/', 0, 'revision', '', 0),
	(857, 1, '2013-03-04 23:46:01', '2013-03-04 23:46:01', '<p id="pagina_resumo">Conheça nossos Cursos de Inglês</p>\nNa FISK, crianças a partir de 4 anos já começam a se comunicar em inglês.\n\nVeja abaixo quais as opções que a FISK oferece para crianças, jovens e adultos:', 'Cursos de Inglês', '', 'inherit', 'open', 'open', '', '311-autosave', '', '', '2013-03-04 23:46:01', '2013-03-04 23:46:01', '', 311, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/311-autosave/', 0, 'revision', '', 0),
