	(862, 2, '2013-03-26 23:45:19', '2013-03-26 23:45:19', '<p id="pagina_resumo">Proficiency Course for Diploma &amp; TOEFL</p>\nEstágio: Proficiency Course for Diploma &amp; TOEFL\nDuração: 55 horas cada\nMétodo: Regular ou Personalizado\nRítmo: Rápido ou Intensivo\n\nNeste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination.\n\nA Proficiência internacional pode ser conseguida através do Curso Preparatório para o Exame TOEFL IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul, Asa Norte e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material didático, que nos tem garantido excelentes índices de aprovação nestes exames.\n\n<strong>FISK, TODO MUNDO FALA BEM!</strong>', 'Proficiência', '', 'inherit', 'open', 'open', '', '298-autosave', '', '', '2013-03-26 23:45:19', '2013-03-26 23:45:19', '', 298, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/298-autosave/', 0, 'revision', '', 0),
	(863, 2, '2011-09-28 00:14:53', '2011-09-28 00:14:53', 'Proficiency Course for Diploma & TOEFL Estágio: Proficiency Course for Diploma & TOEFL Duração: 55 horas cada Método: Regular ou Personalizado Rítmo: Rápido ou Intensivo Neste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination. A Proficiência internacional pode ser conseguida através dos Cursos Preparatórios para os Exames TOEFL ITP (Institucional) & IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material preparatório, que nos tem garantido excelentes índices de aprovação nestes exames. FISK, O MUNDO RECONHECE QUEM FAZ!  ', '', 'Curso May I help You?', 'publish', 'open', 'closed', '', '863', '', '', '2016-01-20 03:42:35', '2016-01-20 03:42:35', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=863', 11, 'nav_menu_item', '', 0),
