	(875, 2, '2011-09-28 20:00:34', '2011-09-28 20:00:34', 'BOOK 1 &amp; 2\r\n<p style="text-align: justify;">Com o advento dos grandes eventos que o Brasil sediará nos próximos anos, a FISK apresenta o curso <strong><em>May I Help You?</em></strong>, que consiste em curso prático de conversação situacional em inglês totalmente desenvolvido para suprir as necessidades de todos que precisam de uma preparação rápida para as grandes oportunidades que virão.</p>\r\n<p style="text-align: justify;">O curso tem como objetivo preparar quem trabalha na área de turismo, hotelaria ou viaja a negócios ou lazer para interagir com pessoas de todo o mundo. Os principais diferenciais dessa modalidade são: conversação imediata, apresentação de expressões e frases situacionais, diálogos-modelo, vocabulário temático e atividades de compreensão auditiva e de pronúncia.\r\nPara reforçar o conteúdo estudado em sala, o material vem acompanhado de CDs de áudio.</p>\r\n<p style="text-align: justify;"><strong>O curso tem duração de somente 8 meses com carga horária de 80 h/a divididas em 2 vezes na semana de 1h15min</strong>. As aulas podem ser dadas na sede da Escola FISK ASA SUL ou TAGUATINGA NORTE ou na modalidade "In company" que consiste em aulas dadas na sede da empresa parceira com professores, material didático e metodologia FISK.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg"><img class="alignleft size-full wp-image-872" title="May I help you" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg" alt="" width="218" height="284" /></a></p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg"><img class="alignright size-full wp-image-873" title="May I help you2" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg" alt="" width="219" height="283" /></a></p>', 'Curso May I Help you?', '', 'inherit', 'open', 'open', '', '860-revision-v1', '', '', '2011-09-28 20:00:34', '2011-09-28 20:00:34', '', 860, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/860-revision-8/', 0, 'revision', '', 0),
