	(880, 2, '2011-09-30 13:25:45', '2011-09-30 13:25:45', ' A semana Cultural Fisk está sendo um sucesso! Todos os alunos estão apresentando números incréveis... Se você ainda não se apresentou então corra para a Fisk porque sábado dia 01/10 é o útltimo dia, e pra você que já se apresnetou', 'Semana Cultural Fisk (fotos)', '', 'inherit', 'open', 'open', '', '879-revision', '', '', '2011-09-30 13:25:45', '2011-09-30 13:25:45', '', 879, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/879-revision/', 0, 'revision', '', 0),
	(890, 2, '2011-10-10 18:42:22', '2011-10-10 18:42:22', 'A Fisk Taguatinga Norte incentivando a conscientização de nossos alunos por uma vida melhor e um planeta mais saudável.\r\n\r\nAlunos dos  cursos de Inglês e Espanhol, desde os Kids à Adults criaram folhas-mensagens para a composição da copa da nossa <em>Hope Tree/Arbol de la esperanza</em>, com dizeres que proporcionaram uma reflexão e conscientização nos leitores.\r\n\r\nFoi um SUCESSO!\r\n\r\nConfira abaixo o resultado como ficou:\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/arvore2.jpg"><img class="aligncenter size-full wp-image-896" title="arvore" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/arvore2.jpg" alt="" width="292" height="300" /></a>\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/folhas.jpg"><img class="aligncenter size-full wp-image-897" title="folhas" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/folhas.jpg" alt="" width="300" height="225" /></a>\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/hope.jpg"><img class="aligncenter size-full wp-image-898" title="hope" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/hope.jpg" alt="" width="300" height="264" /></a>', 'Dia da Árvore!', '', 'publish', 'open', 'open', '', 'dia-da-arvore', '', '', '2011-10-10 18:46:52', '2011-10-10 18:46:52', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=890', 0, 'post', '', 0),
	(882, 2, '2011-09-30 16:50:29', '2011-09-30 16:50:29', ' A semana Cultural Fisk está sendo um sucesso! Todos os alunos estão apresentando números incréveis... Se você ainda não se apresentou então corra para a Fisk porque sábado dia 01/10 é o útltimo dia, e pra você que já se apresentou dê uma olhada nas fotos porque com certeza tem uma foto sua aí!', 'Semana Cultural Fisk (fotos)', '', 'inherit', 'open', 'open', '', '879-revision-2', '', '', '2011-09-30 16:50:29', '2011-09-30 16:50:29', '', 879, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/879-revision-2/', 0, 'revision', '', 0),
	(883, 2, '2011-09-30 17:25:17', '2011-09-30 17:25:17', 'Nessa semana (26/09 a 01/10) está acontecendo a Primeira Semana Cultural FISK Asa Sul e já está sendo um sucesso! Números incríveis estão acontecendo durante todo o dia e o mais interessante é que os nossos alunos que são os artistas!  Os alunos participantes concorrem a prêmios FISK e ainda aumentam a sua nota de participação. Se você ainda não se apresentou ainda dá tempo, mostre o seu talento artístico até sábado. Confira as fotos das apresentações já ocorridas e aplauda os participantes!\r\n\r\n[nggallery id=21]', 'Semana Cultural Fisk Asa Sul (fotos)', '', 'inherit', 'open', 'open', '', '879-autosave', '', '', '2011-09-30 17:25:17', '2011-09-30 17:25:17', '', 879, 'http://dev.webfacetecnologia.com.br/fisk/2011/09/879-autosave/', 0, 'revision', '', 0),
