	(915, 2, '2011-10-21 16:42:36', '2011-10-21 16:42:36', 'O Adido Cultural adjunto dos Estados Unidos Mr. Justen Thomas muito nos honrou quando gentilmente aceitou o convite para duas palestras no auditório da FISK ASA SUL sobre o "American way of life", que ocorreram nos últimos dias 20 e 22 de outubro para os alunos de inglês dos estágios Aiming at the sky em diante.\r\n\r\nA palestra foi muito interessante pois o Mr. Justen Thomas trouxe muitas curiosidades sobre o estilo de vida americano em comparação com o brasileiro. Os alunos participaram com perguntas acerca do assunto e assim tiveram uma ótima oportunidade para praticar o seu inglês. Após o encerramento da palestra houve um café com pães e biscoitos típicos americanos que a Escola ofereceu a todos os presentes.\r\n\r\nThank you Mr. Justen Thomas!\r\n\r\nVeja os fotos:\r\n\r\n[nggallery id=23]', 'Adido Cultural dos EUA faz palestra na FISK ASA SUL', '', 'publish', 'open', 'open', '', 'adido-cultural-dos-eua-faz-palestra-na-fisk-asa-sul', '', '', '2011-10-24 19:23:59', '2011-10-24 19:23:59', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=915', 0, 'post', '', 1),
