	(905, 2, '2011-03-14 15:27:08', '2011-03-14 15:27:08', '	<p id="pagina_resumo">Promoções FISK</p>\n		<p>Entre em <a href="contato.html" title="contato.html">contato</a>:</p>\n\n	<p>FISK Asa Sul<br />\n<a href="mailto:contato@fiskasasul.com.br" title="contato@fiskasasul.com.br">contato@fiskasasul.com.br</a><br />\n(61) 3345-0083 / 3345-0087<br />\nEQS 114/115 Conj.A BL.1 Lojas 1/2/17, Brasília &#8211; DF, 70377-400</p>\n\n	<p>FISK Taguatinga Norte<br />\n<a href="mailto:contato@fisktaguatinganorte.com.br" title="contato@fisktaguatinganorte.com.br">contato@fisktaguatinganorte.com.br</a><br />\n(61) 3355-1191 / 3355-1192<br />\nAv. Samdu Norte QNE 24 Casa 05, Taguatinga Norte, Brasília &#8211; DF, 72125-240</p>\n\n	<h3>Concorra a 10 viagens para Hollywood!</h3>\n\n	<p>Corra até uma unidade FISK, use a sua criatividade e concorra a dias de celebridade em Hollywood. Preencha o cupom &#8220;calçada da fama&#8221;, e deixe sua mensagem. Você pode ganhar uma viagem a Hollywood com direito a acompanhante.</p>\n\n	<p>O melhor Centro de Ensino do Brasil oferece cursos de inglês, espanhol, informática, português para brasileiros e ainda leva você a Hollywood. <strong>FISK, o mundo reconhece quem faz.</strong></p>\n\n	<p>Concurso cultural válido de 01/06/2010 ate 31/08/2010 para alunos e não-alunos. Serão seleccionadas 5 mensagens e cada ganhador será premiado com direito a um acompanhante, totalizando 10 viagens. Para mais informações, consulte o regulamento no site www.fisk.com.br ou dirija-se as Unidades FISK ASA SUL e TAGUATINGA NORTE.</p>\n\n	<h3>Test-drive FISK</h3>\n\n	<p>Em 2010, a FISK quer dar uma oportunidade a você. Chegou o <strong>Test Drive FISK</strong>.</p>\n\n	<p>Venha até as Unidades FISK Asa Sul e Taguatinga Norte, escolha um de nossos cursos (<a href="../cursos/ingles/" title="inglês">Inglês</a>, <a href="../cursos/espanhol/" title="espanhol">Espanhol</a>, <a href="../cursos/informatica/" title="informática">Informática</a> e <a href="../cursos/portugues" title="português para brasileiros">Português para brasileiros</a>) e estude por duas aulas sem pagar nada.</p>\n\n	<p><strong>Essa não é uma promoção, é uma oportunidade. Nós temos certeza de que você vai querer continuar aqui.</strong></p>\n\n	<p>Para mais informações, <a href="http://www.fisk.com.br/2010/pdf/regulamentoTestDrive.pdf" title="regulamento oficial">Consulte o Regulamento Oficial</a>.</p>\n\n	<span class="clear block">&nbsp;</span>\n\n', 'Promoções', '', 'inherit', 'open', 'open', '', '25-revision-v1', '', '', '2011-03-14 15:27:08', '2011-03-14 15:27:08', '', 25, 'http://dev.webfacetecnologia.com.br/fisk/2011/03/25-revision/', 0, 'revision', '', 0),
	(907, 2, '2011-10-17 11:46:50', '2011-10-17 11:46:50', 'No dia 08 de Outubro aconteceu na Fisk de Taguatinga Norte, um dos eventos mais esperados do ano na Fisk, o Fisk Shop!\r\n\r\nA festa como sempre foi um sucesso, os alunos participaram das brincadeiras e fizeram compras de Souvenirs e doces, utilizando os Fisk Dollars acumulados durante todo o ano!\r\n\r\nAs famílias e amigos também puderam participar desta grande festa, compartilhando desse momento de pura diversão!\r\n\r\nVamos ver um pouquinho do que rolou por aqui?!\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f4.jpg"><img class="aligncenter size-full wp-image-912" title="f4" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f4.jpg" alt="" width="400" height="300" /></a>\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f3.jpg"><img class="aligncenter size-full wp-image-911" title="f3" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f3.jpg" alt="" width="400" height="300" /></a>\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f2.jpg"><img class="aligncenter size-full wp-image-910" title="f2" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f2.jpg" alt="" width="400" height="300" /></a>\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f1.jpg"><img class="aligncenter size-full wp-image-909" title="f1" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/10/f1.jpg" alt="" width="400" height="300" /></a>', 'Fisk Shop Taguatinga Norte', '', 'publish', 'open', 'open', '', 'fisk-shop-taguatinga-norte', '', '', '2011-10-17 11:46:50', '2011-10-17 11:46:50', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=907', 0, 'post', '', 0),
