	(917, 2, '2011-10-21 16:38:49', '2011-10-21 16:38:49', 'O Adido Cultural adjunto dos Estados Unidos Mr. Justen Thomas muito nos honrou quando gentilmente aceitou o convite para uma palestra no auditório da FISK ASA SUL sobre o "American way of life" que ocorreu nos últimos dias 20 e 22 de outubro para os alunos de inglês dos estágios Aiming at the sky e', 'Adido Cultural dos EUA faz palestra na FISK ASA SUL', '', 'inherit', 'open', 'open', '', '915-revision-2', '', '', '2011-10-21 16:38:49', '2011-10-21 16:38:49', '', 915, 'http://dev.webfacetecnologia.com.br/fisk/2011/10/915-revision-2/', 0, 'revision', '', 0),
	(916, 2, '2011-10-21 16:37:53', '2011-10-21 16:37:53', 'O Adido Cultural adjunto dos Estados Unidos Mr. Justen Thomas muito nos honrou quando gentilmente aceitou o convite para uma palestra no auditório da FISK ASA SUL sobre o "American way of life" que ocorreu nos últimos dias 20 e 22 de outubro para os alunos de inglês dos estágios Aiming at the sky em diante.\n\nA palestra foi muito interessante pois o Mr. Justen Thomas trouxe muitas curiosidades sobre o estilo de vida americano em comparação com o brasileiro. Os alunos participaram com perguntas acerca do assunto e tiveram uma ótima oportunidade de praticar o seu inglês. Após o encerramento da palestra houve um café com pães e biscoitos típicos americanos que a Escola ofereceu a todos os presentes.\n\nThank very much Mr. Justen Thomas!\n\nVeja os fotos', 'Adido Cultural dos EUA faz palestra na FISK ASA SUL', '', 'inherit', 'open', 'open', '', '915-revision', '', '', '2011-10-21 16:37:53', '2011-10-21 16:37:53', '', 915, 'http://dev.webfacetecnologia.com.br/fisk/2011/10/915-revision/', 0, 'revision', '', 0),
