	(931, 2, '2011-11-01 18:21:42', '2011-11-01 18:21:42', 'Esse ano na Fisk de Taguatinga Norte o Halloween foi horripilante! Todos vieram de fantasia e participaram das atividades propostas, como "Tricks or Treats", múmias de papel, vídeos com histórias de terror, e é claro, não podemos esquecer da atração principal, o Túnel do Horror!\r\n\r\nNesses dias, os teachers contaram histórias das estilosas monster high e ao final tivemos um grande lanche!\r\n\r\nFiquem atentos à votação das 3 melhores fantasias, que serão divulgas neste sábado (05/11). Ah, os papais e mamães também podem ajudar elegendo a melhor e mais criativa fantasia de Halloween. Boa sorte a todos!!!!\r\n\r\nAgora, vamos ver um pouquinho do que rolou por aqui essa semana!\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/9.jpg"><img class="aligncenter size-full wp-image-942" title="9" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/9.jpg" alt="" width="400" height="225" /></a><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/11.jpg"><img class="aligncenter size-full wp-image-945" title="11" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/11.jpg" alt="" width="225" height="400" /></a><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/12.jpg"><img class="aligncenter size-full wp-image-946" title="12" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/12.jpg" alt="" width="225" height="400" /></a><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/8.jpg"><img class="aligncenter size-full wp-image-941" title="8" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/8.jpg" alt="" width="225" height="400" /></a><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/7.jpg"><img class="aligncenter size-full wp-image-940" title="7" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/upl