	(957, 2, '2011-11-28 22:48:31', '2011-11-28 22:48:31', 'As Escolas FISK ASA SUL, ASA NORTE &amp; TAGUATINGA NORTE saem na fente e já oferecem aos seus alunos do método personalizado o Studybox, que consiste em um aparelho de MP4 especialmente desenvolvido para a FISK que contém todo o áudio das lições além de vídeos dos estágios mais avançados. Trata-se de uma revolução em sala de aula pois não há mais necessidade de CDs.\r\n\r\nA Escola FISK Asa Sul já dispõem do equipamento em todas as suas salas de personalizado, FISK ASA NORTE em uma sala e a Escola de Taguatinga Norte com duas.\r\n\r\nÉ a FISK sempre inovando!\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/sTUDYBOX.jpg"><img class="aligncenter size-full wp-image-960" title="sTUDYBOX" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/sTUDYBOX.jpg" alt="" width="199" height="366" /></a>', 'Studybox: Realidade na FISK Asa Sul, Asa Norte & Taguatinga Norte!', '', 'publish', 'open', 'open', '', 'studybox-realidade-na-fisk-asa-sul-taguatinga-norte', '', '', '2012-09-24 22:05:16', '2012-09-24 22:05:16', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=957', 0, 'post', '', 0),
