	(978, 2, '2012-04-04 23:43:03', '2012-04-04 23:43:03', 'Neste último sábado (31/03) ocorreu Unidades FISK Asa sul &amp; Taguatinga Norte o tão esperado sorteio do Ipad 2 que foi o final da Promoção "Eu quero o meu Ipad 2", a qual todos os alunos veteranos que fizeram renovação até o início de dezembro 2011 e todos os novos que fizeram matrículas até a véspera do sorteio participaram com seus números da sorte.\r\n\r\nFoi um dia de grandes expectativas, todos estavam torcendo muito, porém apenas um sortudo de cada Unidade levou um Ipad 2 novinho em folha para casa!\r\n\r\nPARABÉNS aos alunos: Milena Botelho (Breaking Free - FISK Taguatinga Norte) e  Gregório de Faro (Flying High - FISK Asa Sul) que tiveram muita sorte e poderão agora aproveitar de forma ainda mais fácil e divertida os recursos multimídia muito legais que a FISK oferece nos seus cursos! \r\n\r\nVejam algumas fotos do que aconteceu nas Escolas e claro, a foto dos vencedores da promoção!\r\n\r\nQuem não ganhou não desanime, já estamos planejando novas promoções!!!!\r\n\r\n[nggallery id=30]', 'SORTEIO Ipad 2 - Conheça os ganhadores!', '', 'publish', 'open', 'open', '', 'sorteio-ipad-2', '', '', '2012-04-05 18:42:15', '2012-04-05 18:42:15', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=978', 0, 'post', '', 0),
