	(967, 2, '2011-12-03 17:09:49', '2011-12-03 17:09:49', 'As Escolas FISK Asa Sul &amp; Taguatinga Norte no caminho da excelência em ensino, apresentam para o primeiro semestre de 2012 o que de mais avançado em tecnologia educacional, o projetor interativo Epson que traz a tecnologia da interatividade com a projeção em alta definição em um só equipamento! \r\n\r\nNo<strong> e-board </strong>o professor pode juntamente com seus alunos interagir com o conteúdo estudado, a medida que escreve diretamente na imagem projetada além de comandar o áudio e vídeos das lições somente com um toque na tela, ou seja tudo isso para tornar as aulas mais dinâmicas e interessantes!\r\n\r\n E mais, a FISK é a única rede de escolas que desenvolveu o próprio material do curso de forma interativa, assim o aluno poderá fazer uma lição completa no nosso auditório interativo, demais!\r\n\r\nA FISK Asa Sul &amp; Taguatinga Norte mais uma vez saem na frente e investem na excelência dos serviços prestados, buscando sempre os melhores professores, o melhor material aliado com a melhor tecnologia de ensino!\r\n\r\nPor isso se você é nosso aluno, como de costume continue usufruindo tudo que só o melhor Centro de Ensino do Brasil pode oferecer! Se você ainda não é, venha para a FISK Asa Sul &amp; Taguatinga Norte e faça parte desse time vencedor!\r\n\r\nAfinal, que domina o conhecimento se dá bem!\r\n\r\nAssim, domine o conhecimento com a FISK!\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/12/epson_eb-455wi_2.jpg"><img class="aligncenter size-full wp-image-968" title="epson_eb-455wi_2" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/12/epson_eb-455wi_2.jpg" alt="" width="450" height="330" /></a>', 'e-board "Quadro interativo" é realidade na FISK Asa Sul & Taguatinga Norte!', '', 'publish', 'open', 'open', '', 'e-board-quadro-interativo-realidade-na-fisk-asa-sul-taguatinga-norte', '', '', '2011-12-03 17:50:09', '2011-12-03 17:50:09', '', 0, 'ht