	(990, 2, '2012-04-05 18:34:35', '2012-04-05 18:34:35', 'Neste último sábado (31/03) ocorreu Unidades FISK Asa sul &amp; Taguatinga Norte o tão esperado sorteio do Ipad 2 que foi o final da Promoção "Eu quero o mei Ipad 2",  a qual todos os alunos veteranos que fizeram renovação até início de dezembro 2011 e todos os novos que fizeram matrículas até a véspera do sorteio participaram com seus números da sorte.\n\nFoi um dia de grandes expectativas, todos estavam torcendo muito, porém apenas um sortudo de cada Unidade levou um Ipad novinho em folha para casa!\n\nPARABÉNS aos alunos: Milena Botelho (Breaking Free - FISK Taguatinga Norte) e  Gregório de Faro (Flying High - FISK Asa Sul) que tiveram muita sorte e poderão agora aproveitar de forma ainda mais fácil e divertida os recursos multimídia muito legais que a FISK oferece nos seus cursos! \n\nVejam algumas fotos do que aconteceu nas Escolas e claro, a foto dos vencedores da promoção!\n\nQuem não ganhou não desanime, já estamos planejando novas promoções!!!!\n\n[nggallery id=30]', 'SORTEIO Ipad 2 - Conheça os ganhadores!', '', 'inherit', 'open', 'open', '', '978-autosave', '', '', '2012-04-05 18:34:35', '2012-04-05 18:34:35', '', 978, 'http://dev.webfacetecnologia.com.br/fisk/2012/04/978-autosave/', 0, 'revision', '', 0),
