	(1001, 2, '2012-05-09 20:39:15', '2012-05-09 20:39:15', 'No mês passado a escola da Asa Sul desenvolveu com os alunos de Jovens e Adultos o Projeto "Volta ao mundo" onde o tema do trabalho consistiu em apresentar a cultura, tradições e costumes dos países para alunos de outras turmas. Assim, os alunos puderam vivenciar o idioma de uma forma mais dinâmica e aprender um pouquinho mais dos países da lingua estudada.\r\n\r\nVejam algumas fotos das apresentações do curso de inglês, espanhol e francês!!!\r\n\r\n[nggallery id=31]\r\n\r\n&nbsp;', 'Projeto "Volta ao mundo"', '', 'publish', 'open', 'open', '', 'projeto-volta-ao-mundo', '', '', '2012-05-09 20:42:34', '2012-05-09 20:42:34', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1001', 0, 'post', '', 0),
