	(1028, 2, '2011-11-28 22:56:45', '2011-11-28 22:56:45', 'As Escolas FISK ASA SUL &amp; TAGUATINGA NORTE saem na fente e já oferecem aos seus alunos do método personalizado o Studybox, que consiste em um aparelho de MP4 especialmente desenvolvido para a FISK que contém todo o áudio das lições além de vídeos dos estágios mais avançados. Trata-se de uma revolução em sala de aula pois não há mais necessidade de CDs.\r\n\r\nA Escola FISK Asa Sul já dispõem do equipamento em todas as suas salas de personalizado e a Escola de Taguatinga Norte com a sua primeira sala, já está no mesmo caminho!\r\n\r\nÉ a FISK sempre inovando!\r\n\r\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/sTUDYBOX.jpg"><img class="aligncenter size-full wp-image-960" title="sTUDYBOX" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/sTUDYBOX.jpg" alt="" width="199" height="366" /></a>', 'Studybox: Realidade na FISK Asa Sul & Taguatinga Norte!', '', 'inherit', 'open', 'open', '', '957-revision-5', '', '', '2011-11-28 22:56:45', '2011-11-28 22:56:45', '', 957, 'http://dev.webfacetecnologia.com.br/fisk/2011/11/957-revision-5/', 0, 'revision', '', 0),
