	(1030, 2, '2012-09-24 22:04:45', '2012-09-24 22:04:45', 'As Escolas FISK ASA SUL, ASA NORTE &amp; TAGUATINGA NORTE saem na fente e já oferecem aos seus alunos do método personalizado o Studybox, que consiste em um aparelho de MP4 especialmente desenvolvido para a FISK que contém todo o áudio das lições além de vídeos dos estágios mais avançados. Trata-se de uma revolução em sala de aula pois não há mais necessidade de CDs.\n\nA Escola FISK Asa Sul já dispõem do equipamento em todas as suas salas de personalizado, FISK ASA NORTE em uma sala e a Escola de Taguatinga Norte com duas las, já está no mesmo caminho!\n\nÉ a FISK sempre inovando!\n\n<a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/sTUDYBOX.jpg"><img class="aligncenter size-full wp-image-960" title="sTUDYBOX" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/11/sTUDYBOX.jpg" alt="" width="199" height="366" /></a>', 'Studybox: Realidade na FISK Asa Sul, Asa Norte & Taguatinga Norte!', '', 'inherit', 'open', 'open', '', '957-autosave', '', '', '2012-09-24 22:04:45', '2012-09-24 22:04:45', '', 957, 'http://dev.webfacetecnologia.com.br/fisk/2012/09/957-autosave/', 0, 'revision', '', 0),
