	(1051, 2, '2012-11-14 21:12:30', '2012-11-14 21:12:30', 'Aconteceu no último dia 09 de novembro, o  I Sarau FISK que é um evento de caráter cultural e pedagógico que visa proporcionar aos alunos de inglês e espanhol um espaço para vivência dos idiomas apreendidos através de canto, teatro, poesia, dança etc.\n\nMuitos "artistas" participaram mostrando o seu talento em inúmeras apresentações que emocionaram à todos os presentes.\n\nO Sarau aconteceu simultaneamente nas unidades FISK ASA NORTE, ASA SUL e TAGUATINGA NORTE! Muitos pais compareceram e puderam conferir o quanto é importante trabalhar para o desenvolvimento da expressão oral e corporal ao comunicar-se  em inglês ou espanhol. E o Sarau cumpriu bem isso...', 'I Sarau FISK - Sucesso de participação!', '', 'inherit', 'open', 'open', '', '1050-revision', '', '', '2012-11-14 21:12:30', '2012-11-14 21:12:30', '', 1050, 'http://dev.webfacetecnologia.com.br/fisk/2012/11/1050-revision/', 0, 'revision', '', 0),
	(1050, 2, '2012-11-09 14:59:15', '2012-11-09 14:59:15', 'Aconteceu no último dia 09 de novembro, o  I Sarau FISK que é um evento de caráter cultural e pedagógico que visa proporcionar aos alunos de inglês e espanhol um espaço para vivência dos idiomas apreendidos através de canto, teatro, poesia, dança etc.\r\n\r\nMuitos "artistas" participaram mostrando o seu talento em inúmeras apresentações que emocionaram à todos os presentes.\r\n\r\nO Sarau aconteceu simultaneamente nas unidades FISK ASA NORTE, ASA SUL e TAGUATINGA NORTE! Muitos pais compareceram e puderam conferir o quanto é importante trabalhar para o desenvolvimento da expressão oral e corporal ao comunicar-se  em inglês ou espanhol. E o Sarau cumpriu bem isso...\r\n\r\nConfira as fotos dos nossos artistas:\r\n\r\n[nggallery id=35]\r\n\r\n&nbsp;', 'I Sarau FISK - Sucesso de participação!', '', 'publish', 'open', 'open', '', 'i-sarau-fisk-sucesso-de-participacao', '', '', '2012-11-28 16:05:58', '2012-11-28 16:05:58', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1050', 0, 'post', '', 0),
	(1039, 2, '2012-10-18 15:05:39', '2012-10-18 15:05:39', 'A ganhadora da promoção Xbox  360 com Kinnect foi a aluna da Unidade  Taguatinga Norte, Nicolly Santana Amaral do Teens 5.\r\n\r\nNicolly é aluna da Fisk desde o 2º semestre de 2010, quando iniciou seus estudos no Teens 1.\r\n\r\nRealmente a Nicole é muita sortuda pois ganhou um Xbox 360 com Kinnect novinho em folha! Isso mesmo, estudar na FISK é muito legal pois além de aprender muito, todo semestre os alunos concorrem a prêmios incríveis!\r\n\r\nA Nicole não pode conter a alegria ao receber a notícia da secretária Luciana! \r\n\r\nParabéns Nicole! Curta bastante o seu Xbox mas não esqueça de organizar o seu tempo, lembre-se que estudar sempre vem antes de brincar!\r\n\r\nQuem não ganhou dessa vez, espere! No próximo semestre tem mais!\r\n\r\nBom é ser FISK!\r\n\r\n[nggallery id=34]', 'Promoção Xbox  360 com Kinnect! Conheça a ganhadora!', '', 'publish', 'open', 'open', '', 'promocao-xbox-360-com-kinect', '', '', '2012-10-18 21:27:48', '2012-10-18 21:27:48', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1039', 0, 'post', '', 1),
