	(1047, 2, '2012-10-18 21:26:43', '2012-10-18 21:26:43', 'A ganhadora da promoção Xbox  360 com Kinnect foi a aluna da Unidade  Taguatinga Norte, Nicolly Santana Amaral do Teens 5.\r\n\r\nNicolly é aluna da Fisk desde o 2º semestre de 2010, quando iniciou seus estudos no Teens 1.\r\n\r\nRealmente a Nicole é muita sortuda pois ganhou um Xbox 360 com Kinnect novinho em folha! Isso mesmo, estudar na FISK é muito legal pois além de aprender muito, todo semestre os alunos concorrem a prêmios incríveis!\r\n\r\nA Nicole não pode conter a alegria ao receber a notícia da secretária Luciana! \r\n\r\nParabéns Nicole! Curta bastante o seu Xbox mas não esqueça de organizar o seu tempo, lembre-se que estudar sempre vem antes de brincar!\r\n\r\nQuem não ganhou dessa vez, espere! No próximo semestre tem mais!\r\n\r\nBom é ser FISK!\r\n\r\n[nggallery id=34]', 'Promoção Xbox  360 com Kinnect! Conheça a ganhadora!', '', 'inherit', 'open', 'open', '', '1039-revision-6', '', '', '2012-10-18 21:26:43', '2012-10-18 21:26:43', '', 1039, 'http://dev.webfacetecnologia.com.br/fisk/2012/10/1039-revision-6/', 0, 'revision', '', 0),
	(1088, 2, '2011-03-31 01:31:31', '2011-03-31 01:31:31', '	<p id="pagina_resumo">Proficiency Course for Diploma &amp;  TOEFL</p>\n		<p>Estágio: Proficiency Course for Diploma &amp; TOEFL<br />\nDuração: 55 horas cada<br />\nMétodo: Regular ou Personalizado<br />\nRítmo: Rápido ou Intensivo</p>\n\n	<p>Neste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination.</p>\n\n	<p>A Proficiência internacional pode ser conseguida através dos Cursos Preparatórios para os Exames TOEFL ITP (Institucional) &amp; IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material preparatório, que nos tem garantido excelentes índices de aprovação nestes exames.</p>\n\n	<p><strong>FISK, O MUNDO RECONHECE QUEM FAZ!</strong></p>', 'Proficiência', '', 'inherit', 'open', 'open', '', '298-revision', '', '', '2011-03-31 01:31:31', '2011-03-31 01:31:31', '', 298, 'http://dev.webfacetecnologia.com.br/fisk/2011/03/298-revision/', 0, 'revision', '', 0),
	(1066, 1, '2011-03-14 15:25:41', '2011-03-14 15:25:41', '<p id="pagina_resumo" class="hide">Conheça nossos Cursos.</p>\n\n<div id="quadro_cursos">\n<div id="bloco_ingles" class="bloco_curso">\n\n<img class="alignleft size-full wp-image-254" title="ingles" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/ingles.gif" alt="" width="80" height="90" />\n\nNa FISK, crianças a partir de 4 anos já começam a se comunicar em inglês. Veja quais as opções que a FISK oferece para crianças, jovens e adultos.\n\n<a href="queroserfisk_cursos_ingles.html">Veja os Cursos de Inglês</a>\n\n&nbsp;\n\n</div>\n<div id="bloco_espanhol" class="bloco_curso">\n\n<img class="alignleft size-full wp-image-262" title="espanhol" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/espanhol.gif" alt="" width="80" height="90" />\n\nNa FISK, Espanhol agora começa mais cedo. Confira abaixo as opções que a FISK oferece para adolescentes, jovens e adultos:\n\n<a href="queroserfisk_cursos_espanhol.html">Veja os Cursos de Espanhol</a>\n\n&nbsp;\n\n</div>\n<div id="bloco_portugues" class="bloco_curso">\n\n<img class="alignleft size-full wp-image-263" title="portugues" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/portugues.gif" alt="" width="80" height="90" />\n\nNão tropece mais! Aprimore suas habilidades de escrita e fala com a FISK.\n\n<a href="queroserfisk_cursos_portugues.html">Veja os Cursos de Português</a>\n\n&nbsp;\n\n</div>\n<div id="bloco_informatica" class="bloco_curso">\n\n<img class="alignleft size-full wp-image-264" title="informatica" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/informatica.gif" alt="" width="80" height="90" />\n\nMantenha-se atualizado e profissionalize-se com nossos diversos cursos de Informática!\n\n<a href="queroserfisk_cursos_informatica.html">Veja os Cursos de Informática</a>\n\n&nbsp;\n\n</div>\n&nbsp;\n\n</div>\n<span class="block clear"> </span>', 'Cursos', '', 'inhe