	(1054, 2, '2012-11-14 21:14:25', '2012-11-14 21:14:25', 'Aconteceu no último dia 09 de novembro, o  I Sarau FISK que é um evento de caráter cultural e pedagógico que visa proporcionar aos alunos de inglês e espanhol um espaço para vivência dos idiomas apreendidos através de canto, teatro, poesia, dança etc.\n\nMuitos "artistas" participaram mostrando o seu talento em inúmeras apresentações que emocionaram à todos os presentes.\n\nO Sarau aconteceu simultaneamente nas unidades FISK ASA NORTE, ASA SUL e TAGUATINGA NORTE! Muitos pais compareceram e puderam conferir o quanto é importante trabalhar para o desenvolvimento da expressão oral e corporal ao comunicar-se  em inglês ou espanhol. E o Sarau cumpriu bem isso...\n\nConfira as fotos dos nossos artistas:', 'I Sarau FISK - Sucesso de participação!', '', 'inherit', 'open', 'open', '', '1050-revision-2', '', '', '2012-11-14 21:14:25', '2012-11-14 21:14:25', '', 1050, 'http://dev.webfacetecnologia.com.br/fisk/2012/11/1050-revision-2/', 0, 'revision', '', 0),
