	(1058, 2, '2012-10-31 16:04:13', '2012-10-31 16:04:13', 'Aconteceu nas Escolas FISK ASA NORTE, ASA SUL e TAGUATINGA NORTE o nosso tradicional "Halloween Costume contest" que é o concurso de fantasias que movimenta muito as nossas Escolas nessa época que todos os "bruxinhos e bruxinhas" aparecem com muito apetite por doces!\r\n\r\nForam dias de muita descontração, todos se divertiram muito ao sairem pela Escola pedindo doces para os Professores e funcionários, claro que dizendo "Trick or treat!" .\r\n\r\nConfira as fotos e divirta-se:\r\n\r\n[nggallery id=36]', 'Halloween 2012 - Costume contest', '', 'publish', 'open', 'open', '', 'halloween-2012-costume-contest', '', '', '2012-11-28 16:05:16', '2012-11-28 16:05:16', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1058', 0, 'post', '', 0),
