	(1074, 1, '2011-03-14 15:29:21', '2011-03-14 15:29:21', '<p id="pagina_resumo">Divirta-se e aprimore seu Inglês ou Espanhol ON LINE!</p>\nSó aqui você encontra o FISKNET, um portal de jogos interativos e curiosidades que a FISK preparou para você se divertir enquanto revisa o conteúdo aprendido em sala de aula.\n\nVocê que é FISK ou quer ser FISK jogue agora mesmo o FISK MENTOR, FISK ENIGMA, FISK NET LAB e FISK QUIZ e outros jogos irados no nosso site!\n<h3><a title="FISK NET" href="http://www.rlc.com.br/fsk/v2_logint.asp" target="_blank">Acesse o FISK NET</a></h3>\n<a href="http://www.rlc.com.br/fsk/v2_logint.asp" target="_blank"><img class="alignleft size-full wp-image-483" title="cabecaseq1264195905" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/cabecaseq1264195905.gif" alt="" width="205" height="270" /></a><a href="http://www.rlc.com.br/fsk/v2_logint.asp" target="_blank"><img class="alignleft size-full wp-image-486" title="1_tutmask_a31264195553" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/1_tutmask_a31264195553.jpg" alt="" width="125" height="147" /></a><a href="http://www.rlc.com.br/fsk/v2_logint.asp" target="_blank"><img class="alignleft size-full wp-image-487" title="bot_logo_mentor_fisk_21264195499" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/bot_logo_mentor_fisk_21264195499.jpg" alt="" width="100" height="118" /></a>', 'FISK Net', '', 'inherit', 'open', 'open', '', '35-revision', '', '', '2011-03-14 15:29:21', '2011-03-14 15:29:21', '', 35, 'http://dev.webfacetecnologia.com.br/fisk/2011/03/35-revision/', 0, 'revision', '', 0),
	(1090, 2, '2011-03-14 16:20:11', '2011-03-14 16:20:11', '	<p id="pagina_resumo">Seja proficiente em Inglês com a FISK!</p>\n		<p>Proficiency Course for Diploma<br />\nCarga horária mínima: 55 horas<br />\nDuração: 1 semestre</p>\n\n	<p>Indicado para alunos FISK e de outras instituições que terminaram o curso completo de Inglês em nível avançado e que pretendem  obter o <strong>Certificado de Proficiência em Língua Inglesa da Fundação Richard Hugh Fisk</strong>. <br />\nDurante o curso o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso preparatório e ser aprovado no exame Fisk Proficiency Examination.</p>\n\n	<p><strong>FISK, O MUNDO RECONHECE QUE FAZ!</strong></p>	<span class="clear block">&nbsp;</span>\n', 'FISK Proficiency Examination', '', 'inherit', 'open', 'open', '', '62-revision', '', '', '2011-03-14 16:20:11', '2011-03-14 16:20:11', '', 62, 'http://dev.webfacetecnologia.com.br/fisk/2011/03/62-revision/', 0, 'revision', '', 0),
