	(1105, 2, '2013-06-05 15:17:57', '2013-06-05 15:17:57', 'Neste ano de 2013 a FISK realizou o café da manhã de dia das mães, com o intuito de homenagear aquelas que representam o dom da criação, da doação e do amor incondicional. O evento foi repleto de carinho e alegrias, foi surpreendente ver nossos alunos se relacionando com suas mães e mostrando seus trabalhos realizados em homenagem a elas.\r\n\r\nConfira abaixo as fotos do evento realizados nas três unidades Fisk, Asa Sul, Asa Norte e Taguatinga Norte.\r\n\r\n[nggallery id=37]', 'Café da manhã em homenagem ao dia das mães!', '', 'inherit', 'open', 'open', '', '1097-revision-7', '', '', '2013-06-05 15:17:57', '2013-06-05 15:17:57', '', 1097, 'http://dev.webfacetecnologia.com.br/fisk/2013/06/1097-revision-7/', 0, 'revision', '', 0),
