	(1101, 2, '2013-06-05 15:13:57', '2013-06-05 15:13:57', 'Neste ano de 2013 a FISK realizou o café da manhã de dia das mães, com o intuito de homenagear aquelas que representam o dom da criação, da doação e do amor incondicional. O evento foi repleto de carinho e alegrias, foi surpreendente ver nossos alunos se relacionando com suas mães e mostrando seus trabalhos realizados em homenagem a elas.\n\nConfira abaixo as fotos do evento realizados nas três unidades Fisk, Asa Sul, Asa Norte e Taguatinga Norte.\n\n[nggallery id=37]', 'Café da manhã em homenagem ao dia das mães!', '', 'inherit', 'open', 'open', '', '1097-revision-4', '', '', '2013-06-05 15:13:57', '2013-06-05 15:13:57', '', 1097, 'http://dev.webfacetecnologia.com.br/fisk/2013/06/1097-revision-4/', 0, 'revision', '', 0),
	(1100, 2, '2013-06-05 15:09:43', '2013-06-05 15:09:43', 'Neste ano de 2013 a FISK realizou o café da manhã de dia das mães, com o intuito de homenagear aquelas que representam o dom da criação, da doação e do amor incondicional, o evento foi repleto de carinho e alegrias, foi surpreendente ver nossos alunos se relacionando com suas mães e mostrando seus trabalhos realizados em homenagem a elas.\r\n\r\nConfira abaixo as fotos do evento realizados nas três unidades, Asa Sul, Asa Norte e Taguatinga Norte.\r\n\r\n[nggallery id=37]', 'Café da manhã em homenagem ao dia das mães!', '', 'inherit', 'open', 'open', '', '1097-revision-3', '', '', '2013-06-05 15:09:43', '2013-06-05 15:09:43', '', 1097, 'http://dev.webfacetecnologia.com.br/fisk/2013/06/1097-revision-3/', 0, 'revision', '', 0),
	(1089, 2, '2013-03-26 23:36:49', '2013-03-26 23:36:49', '<p id="pagina_resumo">Proficiency Course for Diploma &amp; TOEFL</p>\r\nEstágio: Proficiency Course for Diploma &amp; TOEFL\r\nDuração: 55 horas cada\r\nMétodo: Regular ou Personalizado\r\nRítmo: Rápido ou Intensivo\r\n\r\nNeste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination.\r\n\r\nA Proficiência internacional pode ser conseguida através dos Cursos Preparatórios para os Exames TOEFL ITP (Institucional) &amp; IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul, Asa Norte e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material preparatório, que nos tem garantido excelentes índices de aprovação nestes exames.\r\n\r\n<strong>FISK, O MUNDO RECONHECE QUEM FAZ!</strong>', 'Proficiência', '', 'inherit', 'open', 'open', '', '298-revision-2', '', '', '2013-03-26 23:36:49', '2013-03-26 23:36:49', '', 298, 'http://dev.webfacetecnologia.com.br/fisk/2013/03/298-revision-2/', 0, 'revision', '', 0),
	(1092, 2, '2011-03-14 16:20:33', '2011-03-14 16:20:33', '<p id="pagina_resumo">Prepare-se e seja aprovado nos exames internacionais TOEFL ITP &amp;  IBT com a FISK!</p>\nSe você pretende estudar no exterior ou quer uma certificação internacional que ateste o seu conhecimento em Inglês, faça o curso preparatório com a FISK!\n\nA certificação internacional pode ser conseguida através dos Exames TOEFL ITP (Institucional) &amp; IBT (Internet Based TOEFL), para os quais preparamos você com os  melhores Professores e com o mais completo material didático, que garante excelentes índices de aprovação. Além disso, realizamos diversos simulados durante o Curso preparatório.\n\nIndicado para alunos FISK e de outras instituições que possuam o Nível Avançado de Inglês.\n\nCarga horária mínima: 55 horas aula\nDuração: 1 semestre letivo\n\n<img class="alignleft size-full wp-image-271" title="Cambridge Preparation for the TOEFL Test" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/03/book_3_img1264269043.jpg" alt="" width="403" height="340" />\n\n<span class="clear block"> </span>', 'TOEFL', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2011-03-14 16:20:33', '2011-03-14 16:20:33', '', 64, 'http://dev.webfacetecnologia.com.br/fisk/2011/03/64-revision/', 0, 'revision', '', 0),
	(1094, 2, '2013-03-26 23:37:14', '2013-03-26 23:37:14', '<p id="pagina_resumo">Proficiency Course for Diploma &amp; TOEFL</p>\r\nEstágio: Proficiency Course for Diploma &amp; TOEFL\r\nDuração: 55 horas cada\r\nMétodo: Regular ou Personalizado\r\nRítmo: Rápido ou Intensivo\r\n\r\nNeste estágio, indicado para quem quer obter o Certificado de Proficiência em Língua Inglesa da Fundação Fisk, o aluno enriquece seus conhecimentos de vocabulário e gramática, bem como suas habilidades de compreensão auditiva, leitura e conversação. Para isso, o aluno deverá fazer o curso e ser aprovado no exame Fisk Proficiency Examination.\r\n\r\nA Proficiência internacional pode ser conseguida através dos Cursos Preparatórios para os Exames TOEFL ITP (Institucional) &amp; IBT (Internet Based TOEFL) que as Unidades FISK Asa Sul, Asa Norte e Taguatinga Norte ministram. Temos os melhores Professores e o melhor material preparatório, que nos tem garantido excelentes índices de aprovação nestes exames.\r\n\r\n<strong>FISK, TODO MUNDO FALA BEM!</strong>', 'Proficiência', '', 'inherit', 'open', 'open', '', '298-revision-3', '', '', '2013-03-26 23:37:14', '2013-03-26 23:37:14', '', 298, 'http://dev.webfacetecnologia.com.br/fisk/2013/03/298-revision-3/', 0, 'revision', '', 0),
	(1256, 2, '2015-01-27 16:02:50', '2015-01-27 16:02:50', '<strong>MAY I HELP YOU? - BOOK 1 &amp; 2</strong>\r\n\r\nCom o advento dos grandes eventos que o Brasil sediará nos próximos anos, a FISK apresenta o curso <strong><em>May I Help You?</em></strong>, que consiste em curso prático de conversação situacional em inglês totalmente desenvolvido para suprir as necessidades de todos que precisam de uma preparação rápida para as grandes oportunidades que virão.\r\n<p style="text-align: justify;">O curso tem como objetivo preparar quem trabalha na área de turismo, hotelaria ou viaja a negócios ou lazer para interagir com pessoas de todo o mundo. Os principais diferenciais dessa modalidade são: conversação imediata, apresentação de expressões e frases situacionais, diálogos-modelo, vocabulário temático e atividades de compreensão auditiva e de pronúncia. Para reforçar o conteúdo estudado em sala, o material vem acompanhado de CDs de áudio.</p>\r\n<p style="text-align: justify;"><strong>O curso tem duração de somente 8 meses com carga horária de 80 h/a divididas em 2 vezes na semana de 1h15min</strong>. As aulas podem ser dadas nas sedes das Escolas FISK ASA SUL, ASA NORTE e TAGUATINGA NORTE ou na modalidade "In company" que consiste em aulas dadas na sede da empresa parceira com professores, material didático e metodologia FISK.</p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg"><img class="alignleft size-full wp-image-872" title="May I help you" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you1.jpg" alt="" width="174" height="227" /></a></p>\r\n<p style="text-align: justify;"><a href="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg"><img class="alignright size-full wp-image-873" title="May I help you2" src="http://dev.webfacetecnologia.com.br/fisk/wp-content/uploads/2011/09/May-I-help-you2.jpg" alt="" width="175" height="226" /></a></p>', 'Curso May I Help you?', '', 'inherit', 'open', 'open', '', '860-revision-v1', '', '', '2015-01-27 16:02:50', '2015-01-27 16:02:50', '', 860, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/860-revision-v1/', 0, 'revision', '', 0),
	(1152, 2, '2014-05-19 23:07:23', '2014-05-19 23:07:23', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>Michigan</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pelas Universidade de Michigan/Cambridge e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\r\n\r\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\r\n\r\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\r\n\r\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\r\n\r\n[singlepic id=1261 w=320 h=240 float=]\r\n\r\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET) agora é o teste final do curso de inglês FISK! ', '', 'inherit', 'open', 'open', '', '1148-revision-v1', '', '', '2014-05-19 23:07:23', '2014-05-19 23:07:23', '', 1148, 'http://dev.webfacetecnologia.com.br/fisk/2014/05/1148-revision-v1/', 0, 'revision', '', 0),
