	(1151, 2, '2014-05-19 23:05:39', '2014-05-19 23:05:39', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>Michigan</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pelas Universidade de Michigan/Cambridge e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\r\n\r\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\r\n\r\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\r\n\r\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\r\n\r\n[singlepic id=1261 w=320 h=240 float=]\r\n\r\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET) agora é FISK! ', '', 'inherit', 'open', 'open', '', '1148-revision-v1', '', '', '2014-05-19 23:05:39', '2014-05-19 23:05:39', '', 1148, 'http://dev.webfacetecnologia.com.br/fisk/2014/05/1148-revision-v1/', 0, 'revision', '', 0),
