	(1268, 2, '2015-03-30 14:59:06', '2015-03-30 14:59:06', 'No último sábado dia 28/03/2015 realizamos na FISK ASA SUL às 10:00h, o tão esperado sorteio do <strong>Iphone 6 plus,</strong> quando a nossa aluna Isabel Cristina da Unidade FISK TAGUATINGA NORTE foi a grande sortuda. A aluna estava na sua Escola regular fazendo provas quando ligamos para a sua casa e falamos com os seus pais, que prontamente a levaram para a Escola FISK. Ao chegar na Escola FISK é que foi revelado a sorte grande que ela havia ganhado, um Iphone 6 plus novinho em folha!\r\n\r\nParabéns Isabel! Os aplausos são todos para você!\r\n\r\nSe você não ganhou desta vez, não desanime, pois a FISK sempre tem uma promoção nova para você!\r\n\r\nLembre-se: FALOU FISK, FALOU TUDO!\r\n\r\nConfira as fotos do sorteio e da ganhadora:\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'CONHEÇA A GANHADORA DO IPHONE 6 PLUS!', '', 'inherit', 'open', 'open', '', '1267-revision-v1', '', '', '2015-03-30 14:59:06', '2015-03-30 14:59:06', '', 1267, 'http://dev.webfacetecnologia.com.br/fisk/2015/03/1267-revision-v1/', 0, 'revision', '', 0),
	(1149, 2, '2014-05-19 22:35:33', '2014-05-19 22:35:33', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>Michigan</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pelas Universidade de Michigan/Cambridge e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\r\n\r\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\r\n\r\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\r\n\r\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\r\n\r\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET)', '', 'inherit', 'open', 'open', '', '1148-revision-v1', '', '', '2014-05-19 22:35:33', '2014-05-19 22:35:33', '', 1148, 'http://dev.webfacetecnologia.com.br/fisk/2014/05/1148-revision-v1/', 0, 'revision', '', 0),
	(1148, 2, '2014-05-19 22:40:09', '2014-05-19 22:40:09', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>MET</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pela <em>CaMLA – Cambridge Michigan Language Assessments</em> e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\r\n\r\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\r\n\r\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\r\n\r\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\r\n\r\n[singlepic id=1261 w=320 h=240 float=]\r\n\r\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET) agora é o teste final do curso de inglês FISK!', '', 'publish', 'open', 'open', '', 'michigan-english-test-met', '', '', '2016-03-09 18:43:50', '2016-03-09 18:43:50', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1148', 0, 'post', '', 0),
