	(1558, 2, '2017-05-16 21:23:40', '2017-05-16 21:23:40', 'ESSA É PARA VOCÊ SERVIDOR PÚBLICO: A Fisk desenvolveu um programa especial para LICENÇA CAPACITAÇÃO que permitirá você fazer Inglês, Espanhol, Francês, Informática e português para brasileiros de uma maneira que atenda suas necessidades e da administração pública. Consulte-nos e faça sua matrícula hoje mesmo.\r\n\r\n[ngg_images source="galleries" container_ids="44" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500" display_type="photocrati-nextgen_basic_thumbnails"]&nbsp;', 'Licença Capacitação? Faça FISK!', '', 'inherit', 'closed', 'closed', '', '1552-revision-v1', '', '', '2017-05-16 21:23:40', '2017-05-16 21:23:40', '', 1552, 'http://dev.webfacetecnologia.com.br/fisk/2017/05/1552-revision-v1/', 0, 'revision', '', 0),
	(1150, 2, '2014-05-19 22:39:31', '2014-05-19 22:39:31', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>Michigan</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pelas Universidade de Michigan/Cambridge e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\r\n\r\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\r\n\r\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\r\n\r\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\r\n\r\n[singlepic id=1261 w=320 h=240 float=]\r\n\r\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET)', '', 'inherit', 'open', 'open', '', '1148-revision-v1', '', '', '2014-05-19 22:39:31', '2014-05-19 22:39:31', '', 1148, 'http://dev.webfacetecnologia.com.br/fisk/2014/05/1148-revision-v1/', 0, 'revision', '', 0),
	(1153, 2, '2014-05-19 12:32:58', '2014-05-19 12:32:58', 'Anunciamos o  lançamento do CYBER FISK MOBILE que é o nosso Cyber em versão de aplicativo para dispositivos móveis com sistema operacional <i>Android</i>. Agora ficou muito mais fácil ouvir o áudio das lições, revisar o conteúdo ou se divertir com os <i>softwares </i>do Cyber FISK em seu celular ou tablet, sendo que, é muito fácil fazer o <i>Download </i>do aplicativo, basta navegar na <i>Google Play Store</i> e digitar o nome do seu livro, exemplo: <i>Breaking Free</i>; Depois, é só inserir a sua senha e curtir aonde quiser o Cyber FISK.\r\n\r\nÉ a FISK inovando cada dia mais!\r\n\r\n[singlepic id=1262 w=320 h=240 float=]', 'CYBER FISK agora é MOBILE', '', 'publish', 'open', 'open', '', 'cyber-fisk-agora-e-mobile', '', '', '2014-05-19 23:33:40', '2014-05-19 23:33:40', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1153', 0, 'post', '', 0),
