	(1181, 2, '2015-01-12 19:53:47', '2015-01-12 19:53:47', '<h1>O domínio do inglês, mais que um atributo pessoal</h1>\r\n<div>\r\n\r\nEm qualquer empresa as competências de comunicação sempre se destacam com eternos pontos de melhoria. Comunicar-se verbalmente e por escrito com os acionistas, clientes, fornecedores, parceiros, superiores e subordinados de forma eficaz são atributos indispensáveis em qualquer organização, logo o domínio do idioma torna-se um trunfo no ambiente corporativo. Trunfo ampliado quando se vai além do idioma nativo, ou seja, o domínio de outro idioma é mais do que um atributo pessoal é uma variável determinante na avaliação de "quanto vale" um profissional.\r\n\r\nE quanto vale um profissional fluente em um ou mais idiomas? A Pesquisa Salarial Catho identificou esse valor.\r\n\r\nA Catho realiza a sua Pesquisa Salarial e de Benefícios On-line desde janeiro de 2000. Em 2006 esta pesquisa coletou nos meses de fevereiro, junho e outubro informações salariais de aproximadamente 120.000 profissionais de todo o país, envolvendo diferentes segmentos do mercado nacional e abrangendo todos os níveis organizacionais, bem como o seu nível de fluência na Língua Inglesa e Espanhola.\r\n\r\nA pesquisa levantou o nível de domínio dos profissionais no idioma inglês e espanhol, e constatou diferenças salariais significativas.\r\n\r\nNa alta direção das empresas (diretores e presidentes), a diferença salarial entre os executivos que falam fluentemente inglês para aqueles que não falam é em média 52%. Diferenças significativas também foram constatadas entre os níveis gerenciais (23%), supervisão média (44%) e profissionais especializados com curso superior (47%).\r\n\r\n<img alt="" src="http://www3.catho.com.br/salario/img/o-dominio-de-outro-idioma_1.gif" />\r\n\r\nPara o idioma espanhol as diferenças salariais entre os pesquisados também foram significativas, como mostra a tabela abaixo:\r\n\r\n&nbsp;\r\n\r\n<img alt="" src="http://www3.catho.com.br/salario/img/o-dominio-de-outro-idioma_2.gif" />\r\n\r\nUma consideração importante detectada pela pesquisa é a menor diferença percentual de salários entre os "Gerentes", tanto no idioma inglês quanto para o espanhol, a porcentagem de gerentes que falam fluentemente algum dos idiomas é muito superior aos demais níveis. Por exemplo, apenas 24% de todos os diretores falam o idioma inglês fluentemente, contra 58% dos gerentes, ou seja, entre os gerentes o domínio da língua é mais generalizado, diminuindo assim a diferença salarial entre os profissionais. Na tabela abaixo temos o percentual por nível de cargo.\r\n\r\n<img alt="" src="http://www3.catho.com.br/salario/img/o-dominio-de-outro-idioma_3.gif" />\r\n\r\nOs níveis intermediários de conhecimento da língua também foram levantados pela pesquisa, e os resultados também indicaram diferenças salariais proporcionais.\r\n\r\nA pesquisa também identificou profissionais que tem fluência verbal e escrita nos dois idiomas pesquisados e o resultado foi surpreendente, os diretores de empresa que falam e escrevem fluentemente o inglês e o espanhol recebem em média salários 68% acima daqueles que não tem domínio algum de nenhuma das línguas.\r\n\r\nMuitas empresas exigem hoje de seus executivos e profissionais o domínio de um segundo ou mesmo de um terceiro idioma. Mas não se esqueçam, existe um pressuposto fundamental, domine perfeitamente o "primeiro" idioma, o português.\r\n\r\n</div>\r\n&nbsp;\r\n\r\nAutor: Equipe Pesquisa Salarial da Catho Online\r\n\r\n&nbsp;\r\n\r\nEstamos à disposição para esclarecer qualquer dúvida sobre os dados aqui analisados. Acesse <a href="http://www3.catho.com.br/salario" target="_blank">www.catho.com.br/salario</a> e obtenha mais informações sobre Remuneração. Você também pode entrar em contato conosco pelo e-mail <a href="mailto:infopesquisa@catho.com.br">infopesquisa@catho.com.br</a>.', 'DOMÍNIO DO INGLÊS AUMENTA O SEU SALÁRIO EM ATÉ 52%', '', 'inherit', 'open', 'open', '', '1179-revision-v1', '', '', '2015-01-12 19:53:47', '2015-01-12 19:53:47', '', 1179, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1179-revision-v1/', 0, 'revision', '', 0),
