	(1185, 1, '2015-01-25 15:05:10', '2015-01-25 15:05:10', 'A Fisk, com quase 6 décadas de sucesso e um método de ensino altamente eficaz, comprovado pelos mais de 15 milhões de alunos que já estudaram em suas escolas, acaba de adotar um exame de proficiência internacional, o <em>Michigan English Test (MET)</em>, para atestar ainda mais sua qualidade de ensino.\r\n\r\n&nbsp;\r\n\r\nA partir de agora, o MET passa a ser a avaliação final do curso de inglês da Fisk. Ao terminar o curso, o aluno prestará o MET e receberá seu relatório oficial de pontuação no exame. Sendo aprovado, o aluno obterá um Certificado de Conclusão cuja emissão está vinculada a um dos exames mais renomados no mundo! Dessa forma, o aluno Fisk:\r\n\r\n&nbsp;\r\n\r\n<strong>·  </strong>      Comprova sua proficiência em língua inglesa, de acordo com parâmetros internacionais;\r\n\r\n<strong>· </strong>       É reconhecido mundialmente;\r\n\r\n<strong>·</strong>        Adquire um diferencial profissional.\r\n\r\n&nbsp;\r\n\r\nAqui estão mais informações sobre o MET e o Certificado de Conclusão do Curso Fisk:\r\n\r\n&nbsp;\r\n\r\n<strong><em>O que é o MET?</em></strong>\r\n\r\n&nbsp;\r\n\r\nO exame MET, <em>Michigan English Test</em>, é um exame internacional criado por CaMLA para avaliar a proficiência geral de um estudante de língua inglesa em contextos sociais, educacionais e profissionais e avalia a compreensão auditiva, a leitura e as estruturas gramaticais em situações reais.\r\n\r\n&nbsp;\r\n\r\n<strong><em>O que é CaMLA?</em></strong>\r\n\r\n&nbsp;\r\n\r\nCaMLA (<em>Cambridge Michigan Language Assessments</em>) é a responsável pela elaboração e correção de vários exames internacionais, entre eles, o MET.  Ela é uma associação dos departamentos de exames de duas das mais renomadas universidades do mundo: a Universidade de Michigan, nos Estados Unidos, e a Universidade de Cambridge, na Inglaterra.\r\n\r\n&nbsp;\r\n\r\n<strong><em>O que o MET avalia e como ele é estruturado?</em></strong>\r\n\r\n&nbsp;\r\n\r\nA seção de compreensão auditiva contém 60 questões que avaliam a habilidade de entender conversas e apresentações em contextos sociais, educacionais e profissionais.\r\n\r\nA seção de gramática e leitura compreende 75 questões de múltipla escolha. Destas, 25 testam o domínio de estruturas gramaticais e as outras 50 apresentam textos reais dos mais diversos contextos para avaliar a compreensão de leitura.\r\n\r\n&nbsp;\r\n\r\n<strong><em>O exame abrange quais níveis de proficiência?</em></strong>\r\n\r\n&nbsp;\r\n\r\nO resultado do exame abrange os níveis de A2 a C1 do Quadro Europeu Comum de Referência para Línguas (CEFR) que é, atualmente, um dos documentos mais usados como referência para avaliar as habilidades linguísticas de estudantes de línguas estrangeiras no mundo.  O CEFR classifica o domínio do idioma em uma escala dividida em três grupos e seis níveis: Básico (A1 – A2), Independente (B1 – B2) e Proficiente (C1 – C2).\r\n\r\n&nbsp;\r\n\r\n<strong><em>Qual a pontuação para ser aprovado no exame?</em></strong>\r\n\r\n&nbsp;\r\n\r\nTodos os alunos que prestarem o exame receberão um relatório oficial de CaMLA indicando a pontuação obtida.  Essa pontuação varia de 0 a 80 e cada escala representa um nível do CEFR.   Já para receber o Certificado de Conclusão da Fisk, o aluno precisará atingir, no mínimo, a pontuação correspondente ao nível B2.\r\n\r\n&nbsp;\r\n\r\nO Certificado de Conclusão do Curso Fisk também trará impresso o resultado do aluno conforme seu nível de aprovação no MET:\r\n\r\n&nbsp;\r\n\r\n<em>               Pass  </em>(Aprovado)\r\n\r\n<em>               Above Expectations </em>(Acima das Expectativas)\r\n\r\n<em>               With Honors </em>(Com Menção Honrosa)\r\n\r\n&nbsp;\r\n\r\n<strong><em>E quanto à avaliação oral?</em></strong>\r\n\r\n&nbsp;\r\n\r\nA avaliação oral é efetuada através da apresentação de um projeto desenvolvido ao longo do último estágio do curso de inglês e também é levada em consideração para emissão do Certificado de Conclusão do curso.', 'MET - MICHIGAN ENGLISH TEST', '', 'publish', 'open', 'open', '', 'met-michigan-english-test', '', '', '2015-01-25 15:05:10', '2015-01-25 15:05:10', '', 60, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1185', 0, 'page', '', 0),
	(1186, 1, '2015-01-25 15:05:10', '2015-01-25 15:05:10', 'A Fisk, com quase 6 décadas de sucesso e um método de ensino altamente eficaz, comprovado pelos mais de 15 milhões de alunos que já estudaram em suas escolas, acaba de adotar um exame de proficiência internacional, o <em>Michigan English Test (MET)</em>, para atestar ainda mais sua qualidade de ensino.\r\n\r\n&nbsp;\r\n\r\nA partir de agora, o MET passa a ser a avaliação final do curso de inglês da Fisk. Ao terminar o curso, o aluno prestará o MET e receberá seu relatório oficial de pontuação no exame. Sendo aprovado, o aluno obterá um Certificado de Conclusão cuja emissão está vinculada a um dos exames mais renomados no mundo! Dessa forma, o aluno Fisk:\r\n\r\n&nbsp;\r\n\r\n<strong>·  </strong>      Comprova sua proficiência em língua inglesa, de acordo com parâmetros internacionais;\r\n\r\n<strong>· </strong>       É reconhecido mundialmente;\r\n\r\n<strong>·</strong>        Adquire um diferencial profissional.\r\n\r\n&nbsp;\r\n\r\nAqui estão mais informações sobre o MET e o Certificado de Conclusão do Curso Fisk:\r\n\r\n&nbsp;\r\n\r\n<strong><em>O que é o MET?</em></strong>\r\n\r\n&nbsp;\r\n\r\nO exame MET, <em>Michigan English Test</em>, é um exame internacional criado por CaMLA para avaliar a proficiência geral de um estudante de língua inglesa em contextos sociais, educacionais e profissionais e avalia a compreensão auditiva, a leitura e as estruturas gramaticais em situações reais.\r\n\r\n&nbsp;\r\n\r\n<strong><em>O que é CaMLA?</em></strong>\r\n\r\n&nbsp;\r\n\r\nCaMLA (<em>Cambridge Michigan Language Assessments</em>) é a responsável pela elaboração e correção de vários exames internacionais, entre eles, o MET.  Ela é uma associação dos departamentos de exames de duas das mais renomadas universidades do mundo: a Universidade de Michigan, nos Estados Unidos, e a Universidade de Cambridge, na Inglaterra.\r\n\r\n&nbsp;\r\n\r\n<strong><em>O que o MET avalia e como ele é estruturado?</em></strong>\r\n\r\n&nbsp;\r\n\r\nA seção de compreensão auditiva contém 60 questões que avaliam a habilidade de entender conversas e apresentações em contextos sociais, educacionais e profissionais.\r\n\r\nA seção de gramática e leitura compreende 75 questões de múltipla escolha. Destas, 25 testam o domínio de estruturas gramaticais e as outras 50 apresentam textos reais dos mais diversos contextos para avaliar a compreensão de leitura.\r\n\r\n&nbsp;\r\n\r\n<strong><em>O exame abrange quais níveis de proficiência?</em></strong>\r\n\r\n&nbsp;\r\n\r\nO resultado do exame abrange os níveis de A2 a C1 do Quadro Europeu Comum de Referência para Línguas (CEFR) que é, atualmente, um dos documentos mais usados como referência para avaliar as habilidades linguísticas de estudantes de línguas estrangeiras no mundo.  O CEFR classifica o domínio do idioma em uma escala dividida em três grupos e seis níveis: Básico (A1 – A2), Independente (B1 – B2) e Proficiente (C1 – C2).\r\n\r\n&nbsp;\r\n\r\n<strong><em>Qual a pontuação para ser aprovado no exame?</em></strong>\r\n\r\n&nbsp;\r\n\r\nTodos os alunos que prestarem o exame receberão um relatório oficial de CaMLA indicando a pontuação obtida.  Essa pontuação varia de 0 a 80 e cada escala representa um nível do CEFR.   Já para receber o Certificado de Conclusão da Fisk, o aluno precisará atingir, no mínimo, a pontuação correspondente ao nível B2.\r\n\r\n&nbsp;\r\n\r\nO Certificado de Conclusão do Curso Fisk também trará impresso o resultado do aluno conforme seu nível de aprovação no MET:\r\n\r\n&nbsp;\r\n\r\n<em>               Pass  </em>(Aprovado)\r\n\r\n<em>               Above Expectations </em>(Acima das Expectativas)\r\n\r\n<em>               With Honors </em>(Com Menção Honrosa)\r\n\r\n&nbsp;\r\n\r\n<strong><em>E quanto à avaliação oral?</em></strong>\r\n\r\n&nbsp;\r\n\r\nA avaliação oral é efetuada através da apresentação de um projeto desenvolvido ao longo do último estágio do curso de inglês e também é levada em consideração para emissão do Certificado de Conclusão do curso.', 'MET - MICHIGAN ENGLISH TEST', '', 'inherit', 'open', 'open', '', '1185-revision-v1', '', '', '2015-01-25 15:05:10', '2015-01-25 15:05:10', '', 1185, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1185-revision-v1/', 0, 'revision', '', 0),
