	(1200, 1, '2015-01-25 15:23:44', '2015-01-25 15:23:44', '<strong>Estágios: </strong>04 livros\r\n<strong>Duração: </strong>45 horas cada estágio\r\n<strong>Faixa etária: </strong>Para alunos a partir do 6º ano do ensino fundamental (a partir de 10 anos)\r\n\r\nA série visa proporcionar confiança aos alunos para que eles consigam se comunicar em inglês. As atividades são voltadas às necessidades linguísticas dos alunos e os assuntos abordados são relevantes para a faixa etária.', 'Teenstation', '', 'publish', 'open', 'open', '', 'teenstation', '', '', '2015-01-25 15:23:44', '2015-01-25 15:23:44', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1200', 0, 'page', '', 0),
