	(1203, 1, '2015-01-25 15:24:22', '2015-01-25 15:24:22', '<p id="pagina_resumo">Have Fun 1, 2, 3 e 4</p>\nDuração: 45 horas cada estágio\nFaixa etária: crianças cursando a 3ª e 4ª séries do ensino fundamental\n\nA série combina estruturas simples da língua inglesa com expressões e diálogos. As crianças são incentivadas a brincar e a falar o tempo todo, aprimorando o que já sabem. Os jogos e as atividades interativas favorecem um aprendizado divertido.\n\nCom jogos, colagens e brincadeiras, os alunos vão construindo seu conhecimento da língua. Ao mesmo tempo, permitem a entrada de novos alunos, sem conhecimento prévio da língua, sem que estes tenham de esperar a “idade certa”.\n\n<img class="alignleft size-full wp-image-435" title="have_fun_11264171679" alt="" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_112641716791.jpg" width="168" height="196" /><img class="alignright size-full wp-image-436" title="have_fun_21264171692" alt="" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_212641716921.jpg" width="168" height="193" />\n\n<img class="alignleft size-medium wp-image-437" title="have_fun_31264171703" alt="" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_312641717031-256x300.jpg" width="256" height="300" /><img class="alignright size-full wp-image-438" title="have_fun_41264171711" alt="" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/have_fun_412641717111.jpg" width="168" height="204" />', 'Have Fun', '', 'inherit', 'open', 'open', '', '285-autosave-v1', '', '', '2015-01-25 15:24:22', '2015-01-25 15:24:22', '', 285, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/285-autosave-v1/', 0, 'revision', '', 0),
	(1205, 1, '2011-03-31 02:52:52', '2011-03-31 02:52:52', '<p id="pagina_resumo">Atualize seus conhecimentos de Sistema Operacional, Pacote Office, CorelDraw, Photoshop e InDesign.</p>\n<img class="alignleft size-full wp-image-433" title="informatica1264420490" src="http://fiskasasul.com.br/wp-content/uploads/2011/03/informatica1264420490.jpg" alt="" width="300" height="310" />', 'Cursos de Informática', '', 'inherit', 'open', 'open', '', '320-revision-v1', '', '', '2011-03-31 02:52:52', '2011-03-31 02:52:52', '', 320, 'http://dev.webfacetecnologia.com.br/fisk/2011/03/320-revision-v1/', 0, 'revision', '', 0),
	(1206, 1, '2015-01-25 15:28:48', '2015-01-25 15:28:48', '<p id="pagina_resumo">A série FISK.COM tem como objetivo desenvolver as competências tecnológicas para que os alunos dominem os principais softwares disponíveis no mercado.\r\nUtilizando uma abordagem voltada a pratica, o material traz exercícios passo a passo que ajudam o aluno a entender como utilizar as principais ferramentas de cada software estudado.\r\nUm dos principais diferenciais do material é que a parte teórica está diluída ao longo do curso através de atividades dinâmicas que farão com que o aluno entenda as principais terminologias da área de informática, sem que a aula se torne monótona e cansativa.</p>', 'Cursos de Informática', '', 'inherit', 'open', 'open', '', '320-revision-v1', '', '', '2015-01-25 15:28:48', '2015-01-25 15:28:48', '', 320, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/320-revision-v1/', 0, 'revision', '', 0),
	(1213, 1, '2015-01-25 15:35:35', '2015-01-25 15:35:35', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Illustrator é uma poderosa ferramenta para a criação e manipulação de ilustrações vetoriais. Através dele é possível criar artes impressas, como logotipos, folhetos, pôsteres, embalagens, etc.\r\nO curso de Illustrator da Fisk tem como objetivo proporcionar aos alunos uma ampla abordagem das ferramentas do programa, através de atividades práticas que simulam situações do mercado de trabalho.\r\n<div></div>', 'Illustrator', '', 'publish', 'open', 'open', '', 'illustrator', '', '', '2015-01-25 15:35:35', '2015-01-25 15:35:35', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1213', 0, 'page', '', 0),
	(1214, 1, '2015-01-25 15:35:35', '2015-01-25 15:35:35', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Illustrator é uma poderosa ferramenta para a criação e manipulação de ilustrações vetoriais. Através dele é possível criar artes impressas, como logotipos, folhetos, pôsteres, embalagens, etc.\r\nO curso de Illustrator da Fisk tem como objetivo proporcionar aos alunos uma ampla abordagem das ferramentas do programa, através de atividades práticas que simulam situações do mercado de trabalho.\r\n<div></div>', 'Illustrator', '', 'inherit', 'open', 'open', '', '1213-revision-v1', '', '', '2015-01-25 15:35:35', '2015-01-25 15:35:35', '', 1213, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1213-revision-v1/', 0, 'revision', '', 0),
	(1215, 1, '2015-01-25 15:36:04', '2015-01-25 15:36:04', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Dreamweaver  é uma ferramenta voltada para a área de web design, que permite ao usuário criar páginas da Internet.\r\nO curso engloba todo o processo de criação de um site, desde o seu planejamento até a sua publicação na Web. Os alunos aprenderão a trabalhar com a linguagem HTML e os estilos CSS.', 'Dreamweaver', '', 'publish', 'open', 'open', '', 'dreamweaver', '', '', '2015-01-25 15:36:04', '2015-01-25 15:36:04', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1215', 0, 'page', '', 0),
	(1216, 1, '2015-01-25 15:36:04', '2015-01-25 15:36:04', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Dreamweaver  é uma ferramenta voltada para a área de web design, que permite ao usuário criar páginas da Internet.\r\nO curso engloba todo o processo de criação de um site, desde o seu planejamento até a sua publicação na Web. Os alunos aprenderão a trabalhar com a linguagem HTML e os estilos CSS.', 'Dreamweaver', '', 'inherit', 'open', 'open', '', '1215-revision-v1', '', '', '2015-01-25 15:36:04', '2015-01-25 15:36:04', '', 1215, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1215-revision-v1/', 0, 'revision', '', 0),
	(1217, 1, '2015-01-25 15:36:22', '2015-01-25 15:36:22', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Flash Professional é utilizado para criar conteúdo interativo para a Web para a criação de animações multimídia e sites interativos.\r\nAlém disso, o curso aborda noções básicas de ActionScript 3.0, uma das linguagens de programação utilizadas pelo Flash. Com isso, é possível deixar sites e aplicações muito mais interativos.', 'Flash', '', 'publish', 'open', 'open', '', 'flash', '', '', '2015-01-25 15:36:22', '2015-01-25 15:36:22', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1217', 0, 'page', '', 0),
	(1218, 1, '2015-01-25 15:36:22', '2015-01-25 15:36:22', '<strong>Duração: 25-30 horas\r\nFaixa etária: a partir de 12 anos</strong>\r\n\r\nO Flash Professional é utilizado para criar conteúdo interativo para a Web para a criação de animações multimídia e sites interativos.\r\nAlém disso, o curso aborda noções básicas de ActionScript 3.0, uma das linguagens de programação utilizadas pelo Flash. Com isso, é possível deixar sites e aplicações muito mais interativos.', 'Flash', '', 'inherit', 'open', 'open', '', '1217-revision-v1', '', '', '2015-01-25 15:36:22', '2015-01-25 15:36:22', '', 1217, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1217-revision-v1/', 0, 'revision', '', 0),
