	(1267, 2, '2015-03-30 15:20:18', '2015-03-30 15:20:18', 'No último sábado dia 28/03/2015 realizamos na FISK ASA SUL às 10:00h, o tão esperado sorteio do <strong>Iphone 6 plus,</strong> quando a nossa aluna Isabel Cristina da Unidade FISK TAGUATINGA NORTE foi a grande sortuda. A aluna estava na sua Escola regular fazendo provas quando ligamos para a sua casa e falamos com os seus pais, que prontamente a levaram para a Escola FISK. Ao chegar na Escola FISK é que foi revelado a sorte grande que ela havia ganhado, um Iphone 6 plus novinho em folha!\r\n\r\nParabéns Isabel! Os aplausos são todos para você!\r\n\r\nSe você não ganhou desta vez, não desanime, pois a FISK sempre tem uma promoção nova para você!\r\n\r\nLembre-se: FALOU FISK, FALOU TUDO!\r\n\r\nConfira as fotos do sorteio e da ganhadora:\r\n\r\n&nbsp;\r\n\r\n<img class="ngg_displayed_gallery mceItem" src="http://dev.webfacetecnologia.com.br/fisk/nextgen-attach_to_post/preview/id--1281" alt="" />\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'CONHEÇA A GANHADORA DO IPHONE 6 PLUS!', '', 'publish', 'open', 'open', '', 'conheca-a-ganhadora-do-iphone-6-plus', '', '', '2015-03-30 15:20:42', '2015-03-30 15:20:42', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1267', 0, 'post', '', 0),
	(1224, 1, '2015-01-25 15:40:07', '2015-01-25 15:40:07', '<strong>Estágios: </strong>4 livros\r\n<strong>Duração: </strong>40 a 45 horas cada estágio\r\n<strong>Faixa etária: </strong> a partir do 7º ano do ensino fundamental (11 a 13 anos)\r\n\r\nA série Conéctate dá continuidade ao curso para pré-adolescentes iniciada por Chiquiteens 1 e 2. Também é direcionada para alunos novos que estejam no sétimo ano do ensino fundamental, com o compromisso de desenvolver as 4 habilidades: compreensão auditiva, leitura, produção oral e escrita.\r\n\r\nPriorizamos as características cognitivas, os interesses e os conhecimentos prévios do aluno para assim termos um aluno competente na nova língua. Tivemos também a preocupação de manter o aluno que estudou a série Chiquiteens sempre motivado, apresentando novos conteúdos e novas dinâmicas.', 'Conéctate', '', 'publish', 'open', 'open', '', 'conectate-2', '', '', '2015-01-25 15:40:07', '2015-01-25 15:40:07', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1224', 0, 'page', '', 0),
	(1225, 1, '2015-01-25 15:40:07', '2015-01-25 15:40:07', '<strong>Estágios: </strong>4 livros\r\n<strong>Duração: </strong>40 a 45 horas cada estágio\r\n<strong>Faixa etária: </strong> a partir do 7º ano do ensino fundamental (11 a 13 anos)\r\n\r\nA série Conéctate dá continuidade ao curso para pré-adolescentes iniciada por Chiquiteens 1 e 2. Também é direcionada para alunos novos que estejam no sétimo ano do ensino fundamental, com o compromisso de desenvolver as 4 habilidades: compreensão auditiva, leitura, produção oral e escrita.\r\n\r\nPriorizamos as características cognitivas, os interesses e os conhecimentos prévios do aluno para assim termos um aluno competente na nova língua. Tivemos também a preocupação de manter o aluno que estudou a série Chiquiteens sempre motivado, apresentando novos conteúdos e novas dinâmicas.', 'Conéctate', '', 'inherit', 'open', 'open', '', '1224-revision-v1', '', '', '2015-01-25 15:40:07', '2015-01-25 15:40:07', '', 1224, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1224-revision-v1/', 0, 'revision', '', 0),
	(1226, 1, '2015-01-25 15:40:48', '2015-01-25 15:40:48', ' ', '', 'Conéctate 1, 2, 3 e 4', 'publish', 'open', 'open', '', '1226', '', '', '2015-01-25 15:40:48', '2015-01-25 15:40:48', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1226', 2, 'nav_menu_item', '', 0),
	(1227, 1, '2011-10-14 17:18:21', '2011-10-14 17:18:21', '<p id="pagina_resumo"><span style="color: #000000; font-size: 18px; line-height: 27px;">Test-drive FISK</span></p>\r\nVenha até as Unidades FISK Asa Sul e Taguatinga Norte, escolha um de nossos cursos (<a title="inglês" href="../cursos/ingles/">Inglês</a>, <a title="espanhol" href="../cursos/espanhol/">Espanhol</a>, <a title="informática" href="../cursos/informatica/">Informática</a> e <a title="português para brasileiros" href="../cursos/portugues">Português para brasileiros</a>) e estude por duas aulas sem pagar nada.\r\n\r\n<strong>Essa não é uma promoção, é uma oportunidade. Nós temos certeza de que você vai querer continuar aqui.</strong>\r\n\r\n&nbsp;\r\n\r\n<span class="clear block"> </span>', 'Promoções', '', 'inherit', 'open', 'open', '', '25-revision-v1', '', '', '2011-10-14 17:18:21', '2011-10-14 17:18:21', '', 25, 'http://dev.webfacetecnologia.com.br/fisk/2011/10/25-revision-v1/', 0, 'revision', '', 0),
