	(1491, 2, '2017-04-03 13:25:27', '2017-04-03 13:25:27', 'A aluna Kelly Lohnhoff da Fisk Asa Norte foi a sortuda que levou um Iphone 7 novinho em folha para casa no sorteio realizado no último dia 01/04 às 10:00h na Fisk Asa sul. A nossa aluna faz o estágio Spreading Wings nas terças e quintas.&nbsp;\r\n\r\nSe você não levou dessa vez, não desanime a Fisk sempre tem uma Promoção super especial para você. Fique atento!\r\n\r\nÉ a Fisk sempre fazendo o melhor para você!\r\n\r\nVeja a foto da ganhadora no momento da entrega do prêmio:\r\n\r\n[ngg_images source="galleries" container_ids="12" ajax_pagination="0" template="default" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500" display_type="photocrati-nextgen_basic_imagebrowser"]&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Conheça a ganhadora do Iphone 7!', '', 'inherit', 'closed', 'closed', '', '1488-revision-v1', '', '', '2017-04-03 13:25:27', '2017-04-03 13:25:27', '', 1488, 'http://dev.webfacetecnologia.com.br/fisk/2017/04/1488-revision-v1/', 0, 'revision', '', 0),
	(1490, 2, '2017-04-03 13:23:54', '2017-04-03 13:23:54', 'A aluna Kelly Lohnhoff da Fisk Asa Norte foi a sortuda que levou um Iphone 7 novinho em folha para casa no sorteio realizado no último dia 01/04 às 10:00h na Fisk Asa sul. A nossa aluna faz o estágio Spreading Wings nas terças e quintas.&nbsp;\r\n\r\nSe você não levou dessa vez, não desanime a Fisk sempre tem uma Promoção super especial para você. Fique atento!\r\n\r\nÉ a Fisk sempre fazendo o melhor para você!\r\n\r\nVeja a foto da ganhadora no momento da entrega do prêmio:\r\n\r\n[ngg_images source="galleries" container_ids="12" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="20" display_type="photocrati-nextgen_basic_thumbnails"]&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Conheça a ganhadora do Iphone 7!', '', 'inherit', 'closed', 'closed', '', '1488-revision-v1', '', '', '2017-04-03 13:23:54', '2017-04-03 13:23:54', '', 1488, 'http://dev.webfacetecnologia.com.br/fisk/2017/04/1488-revision-v1/', 0, 'revision', '', 0),
