	(1258, 2, '2015-01-27 16:04:46', '2015-01-27 16:04:46', 'As Escolas FISK Asa sul, Asa norte e Taguatinga Norte se credenciaram junto "University of Cambridge" para aplicarem o teste BULATS com o objetivo de atender o mercado corporativo de Brasília e região.\r\n\r\nO BULATS (Business Language Testing Service) é um teste amplamente aceito no mercado corporativo e especialmente tem servido de requisito básico  para ingresso em programas internos de concessão de bolsas de estudos das instituições bancárias, além de aferir o conhecimento de inglês dos profissionais do mundo dos negócios.\r\n\r\nAssim, faça o BULATS conosco e aprimore o seu inglês no melhor centro de ensino do Brasil!\r\n\r\nPara informações adicionais e agendamentos dos testes ligue para os telefones: 3345-0083/3345-0087\r\n\r\n[singlepic id=1260 w=320 h=240 float=]', 'Exame Bulats', '', 'inherit', 'open', 'open', '', '1191-revision-v1', '', '', '2015-01-27 16:04:46', '2015-01-27 16:04:46', '', 1191, 'http://dev.webfacetecnologia.com.br/fisk/2015/01/1191-revision-v1/', 0, 'revision', '', 0),
