	(1407, 2, '2016-03-09 18:43:04', '2016-03-09 18:43:04', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>MET</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pela CaMLA – Cambridge Michigan Language Assessments e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\n\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\n\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\n\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\n\n[singlepic id=1261 w=320 h=240 float=]\n\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET) agora é o teste final do curso de inglês FISK!', '', 'inherit', 'closed', 'closed', '', '1148-autosave-v1', '', '', '2016-03-09 18:43:04', '2016-03-09 18:43:04', '', 1148, 'http://dev.webfacetecnologia.com.br/fisk/2016/03/1148-autosave-v1/', 0, 'revision', '', 0),
	(1408, 2, '2016-03-09 18:43:50', '2016-03-09 18:43:50', 'É com muita alegria e orgulho que anunciamos a chegada do <b><span style="text-decoration: underline;">Michigan English Test</span></b> (MET) como teste final dos alunos que concluem o curso FISK, agora o aluno, ao terminar o nosso último estágio (<i>Focus on Fisk Final</i>), será submetido ao exame <b>MET</b> que proporcionará a aferição do conhecimento em inglês do aluno, de acordo com o padrão europeu de classificação linguística (A2 ao C1). Após a realização do exame, os alunos receberão um <i>Score Record </i>expedido pela <em>CaMLA – Cambridge Michigan Language Assessments</em> e que servirá como prova de seu conhecimento em inglês, juntamente com o Diploma FISK. O <b>Michigan English Test</b> é um exame de reconhecimento internacional e considerado mundialmente o mais importante exame de aferição de conhecimento na Língua inglesa.\r\n\r\nMais uma vez, a FISK se destaca no mercado, como a única Escola que oferece na estrutura de seu curso uma certificação dessa grandeza, assim, damos um salto muito grande no sentido do reconhecimento internacional da qualidade conquistada em mais de 50 anos de muita pesquisa e trabalho.\r\n\r\nAssim, se você ainda não é FISK, venha correndo e junte-se a esse time de vencedores que fazem FISK!\r\n\r\nLembrem-se <strong>FALOU FISK, FALOU TUDO!</strong>\r\n\r\n[singlepic id=1261 w=320 h=240 float=]\r\n\r\n&nbsp;', 'MICHIGAN ENGLISH TEST (MET) agora é o teste final do curso de inglês FISK!', '', 'inherit', 'closed', 'closed', '', '1148-revision-v1', '', '', '2016-03-09 18:43:50', '2016-03-09 18:43:50', '', 1148, 'http://dev.webfacetecnologia.com.br/fisk/2016/03/1148-revision-v1/', 0, 'revision', '', 0),
	(1412, 2, '2016-04-18 21:49:46', '2016-04-18 21:49:46', 'O método de aprendizado Écho é endereçado aos adolescentes a partir de 13 anos e aos adultos que possuem o interesse em aprender um novo idioma moderno. O método visa trabalhar, diferentes etapas culturais da vida pessoal, educativa, social e profissional do francês de uma forma dinâmica e motivadora. Junto a isso, o método ainda aborda questões linguísticas e gramaticais da metodologia francesa, em um aprendizado apoiado nas interações naturais da turma, ou seja, a prática da abordagem da conversação tida em cada livro do método Écho.\r\n\r\nO método Écho ainda permite, ao aluno de francês, a descoberta do desenvolvimento francofônico e da integração no meio social da cultura de outros países oriundos da cultura francesa em uma carga horária, semestral de 72 h/a, sendo assim, na metodologia regular ou personalizada. Aqui há um aprimoramento da língua francesa no que tange as mudanças de informações, experiências, opiniões ao melhor dos projetos.\r\n\r\nPor fim, as atividades de vídeos, dos estágios A1 e A2, ainda fazem todo diferencial, no processo da prática do que foi visto em sala de aula, ou seja, do que foi aprendido pelo aluno, ao longo da semana.\r\n\r\nO caderno de exercícios por sua vez, visa reforçar o conteúdo visto em sala de aula e vem acompanhado de um cd de áudio para a praticidade e automatização da escuta em casa', 'Curso ECHO de Francês', '', 'inherit', 'closed', 'closed', '', '1076-revision-v1', '', '', '2016-04-18 21:49:46', '2016-04-18 21:49:46', '', 1076, 'http://dev.webfacetecnologia.com.br/fisk/2016/04/1076-revision-v1/', 0, 'revision', '', 0),
