	(1389, 1, '2016-01-20 03:41:14', '2016-01-20 03:41:14', '<em><strong>Speed – Curso rápido para adultos</strong></em>\r\n\r\n<strong>Estágios:</strong> 03 livros\r\n<strong>Duração: </strong>40 horas cada estágio\r\n<strong>Faixa etária:</strong> : jovens adultos e adultos que tenham terminado o Ensino Médio\r\n\r\nO curso <em>Speed </em>foi especialmente desenvolvido para o público adulto que tem pouco ou nenhum conhecimento de inglês e que precisa aprender a se comunicar na língua inglesa em pouco tempo.  Nesse curso, o aluno aprende as estruturas fundamentais de forma rápida e eficaz, pois ele fornece todas as ferramentas de que o aluno precisa para se comunicar desde o primeiro dia de aula. Ele ouve, fala, lê e escreve relacionando os tópicos à sua própria experiência. Além do livro e do auxílio do professor, o aluno conta com outros recursos para aperfeiçoar seu inglês na sala de aula, em casa ou no trabalho - QR Codes e Cyber Fisk.\r\n\r\n&nbsp;', 'SPEED', '', 'publish', 'closed', 'closed', '', 'speed', '', '', '2016-01-20 03:41:14', '2016-01-20 03:41:14', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?page_id=1389', 0, 'page', '', 0),
	(1390, 1, '2016-01-20 03:41:14', '2016-01-20 03:41:14', '<em><strong>Speed – Curso rápido para adultos</strong></em>\r\n\r\n<strong>Estágios:</strong> 03 livros\r\n<strong>Duração: </strong>40 horas cada estágio\r\n<strong>Faixa etária:</strong> : jovens adultos e adultos que tenham terminado o Ensino Médio\r\n\r\nO curso <em>Speed </em>foi especialmente desenvolvido para o público adulto que tem pouco ou nenhum conhecimento de inglês e que precisa aprender a se comunicar na língua inglesa em pouco tempo.  Nesse curso, o aluno aprende as estruturas fundamentais de forma rápida e eficaz, pois ele fornece todas as ferramentas de que o aluno precisa para se comunicar desde o primeiro dia de aula. Ele ouve, fala, lê e escreve relacionando os tópicos à sua própria experiência. Além do livro e do auxílio do professor, o aluno conta com outros recursos para aperfeiçoar seu inglês na sala de aula, em casa ou no trabalho - QR Codes e Cyber Fisk.\r\n\r\n&nbsp;', 'SPEED', '', 'inherit', 'closed', 'closed', '', '1389-revision-v1', '', '', '2016-01-20 03:41:14', '2016-01-20 03:41:14', '', 1389, 'http://dev.webfacetecnologia.com.br/fisk/2016/01/1389-revision-v1/', 0, 'revision', '', 0),
