	(1396, 2, '2016-01-10 21:37:34', '2016-01-10 21:37:34', 'Diferente de alguns anos atrás que saber falar inglês era algo de luxo, hoje saber falar inglês já não é mais necessidade e sim obrigação de cada profissional. No mercado de trabalho, você vai ver que dominar o inglês pode fazer a diferença e fazer o seu salário ficar até 20 % maior.\r\n\r\nConfira o vídeo abaixo que fala sobre a importância de dominar o inglês.\r\n\r\nhttps://www.youtube.com/watch?v=726wCIts7tg', 'A importância do inglês no mercado de trabalho', '', 'publish', 'open', 'open', '', 'a-importancia-do-ingles-no-mercado-de-trabalho', '', '', '2016-01-29 21:39:27', '2016-01-29 21:39:27', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1396', 0, 'post', '', 0),
	(1397, 2, '2016-01-29 21:37:34', '2016-01-29 21:37:34', 'Diferente de alguns anos atrás que saber falar inglês era algo de luxo, hoje saber falar inglês já não é mais necessidade e sim obrigação de cada profissional. No mercado de trabalho, você vai ver que dominar o inglês pode fazer a diferença e fazer o seu salário ficar até 20 % maior.\r\n\r\nConfira o vídeo abaixo que fala sobre a importância de dominar o inglês.\r\n\r\nhttps://www.youtube.com/watch?v=726wCIts7tg', 'A importância do inglês no mercado de trabalho', '', 'inherit', 'closed', 'closed', '', '1396-revision-v1', '', '', '2016-01-29 21:37:34', '2016-01-29 21:37:34', '', 1396, 'http://dev.webfacetecnologia.com.br/fisk/2016/01/1396-revision-v1/', 0, 'revision', '', 0),
