	(1504, 2, '2017-05-05 16:12:28', '2017-05-05 16:12:28', 'Como todos sabem, o mês de maio é o mês das mães, e devido a isso, nós da FISK comemoramos dando condições super especiais para você, que é mãe e ainda não estuda conosco! Vejam só:\r\n\r\n<strong><u>50% de desconto nas mensalidades do primeiro semestre do curso escolhido (Inglês, Espanhol ou Francês), ou seja você mãe paga só meia para matrículas feitas no mês de maio!</u></strong>\r\n\r\nPromoção não cumulativa com nenhuma outra, válida somente para pagamentos em cheque. É permitido fazer matrícula para começar agora ou só no segundo semestre.\r\n\r\nPromoção válida para mães de nossos alunos ou não, assim se vocês tiverem uma amiga mãe que queira uma oportunidade, fale com ela e convide-a para fazer parte da família FISK.\r\n\r\nVenham mães! Estudem conosco e fiquem mais perto dos seus filhos!\r\n\r\nÉ a FISK sempre fazendo o melhor para você\r\n\r\nPromoção válida para matrículas realizadas até o dia 31/05/2017\r\n\r\n&nbsp;', 'Promoção: Mãe na FISK paga meia!', '', 'publish', 'open', 'open', '', 'promocao-mae-na-fisk-paga-meia-2', '', '', '2017-05-05 16:14:41', '2017-05-05 16:14:41', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1504', 0, 'post', '', 0),
