	(1507, 2, '2017-05-05 16:14:41', '2017-05-05 16:14:41', 'Como todos sabem, o mês de maio é o mês das mães, e devido a isso, nós da FISK comemoramos dando condições super especiais para você, que é mãe e ainda não estuda conosco! Vejam só:\r\n\r\n<strong><u>50% de desconto nas mensalidades do primeiro semestre do curso escolhido (Inglês, Espanhol ou Francês), ou seja você mãe paga só meia para matrículas feitas no mês de maio!</u></strong>\r\n\r\nPromoção não cumulativa com nenhuma outra, válida somente para pagamentos em cheque. É permitido fazer matrícula para começar agora ou só no segundo semestre.\r\n\r\nPromoção válida para mães de nossos alunos ou não, assim se vocês tiverem uma amiga mãe que queira uma oportunidade, fale com ela e convide-a para fazer parte da família FISK.\r\n\r\nVenham mães! Estudem conosco e fiquem mais perto dos seus filhos!\r\n\r\nÉ a FISK sempre fazendo o melhor para você\r\n\r\nPromoção válida para matrículas realizadas até o dia 31/05/2017\r\n\r\n&nbsp;', 'Promoção: Mãe na FISK paga meia!', '', 'inherit', 'closed', 'closed', '', '1504-revision-v1', '', '', '2017-05-05 16:14:41', '2017-05-05 16:14:41', '', 1504, 'http://dev.webfacetecnologia.com.br/fisk/2017/05/1504-revision-v1/', 0, 'revision', '', 0),
	(1508, 2, '2017-05-11 14:26:08', '2017-05-11 14:26:08', 'Como todos sabem, o mês de maio é o mês das mães, e devido a isso, nós da FISK comemoramos dando condições super especiais para você, que é mãe e ainda não estuda conosco! Vejam só:\r\n\r\n<strong><u>50% de desconto nas mensalidades do primeiro semestre do curso escolhido (Inglês, Espanhol ou Francês), ou seja você mãe paga só meia para matrículas feitas no mês de maio!</u></strong>\r\n\r\nPromoção não cumulativa com nenhuma outra, válida somente para pagamentos em cheque. É permitido fazer matrícula para começar agora ou só no segundo semestre.\r\n\r\nPromoção válida para mães de nossos alunos ou não, assim se vocês tiverem uma amiga mãe que queira uma oportunidade, fale com ela e convide-a para fazer parte da família FISK.\r\n\r\nVenham mães! Estudem conosco e fiquem mais perto dos seus filhos!\r\n\r\nÉ a FISK sempre fazendo o melhor para você\r\n\r\nPromoção válida para matrículas realizadas até o dia 31/05/2017\r\n\r\n&nbsp;', 'Promoção: Mãe na FISK paga meia!', '', 'inherit', 'closed', 'closed', '', '1504-autosave-v1', '', '', '2017-05-11 14:26:08', '2017-05-11 14:26:08', '', 1504, 'http://dev.webfacetecnologia.com.br/fisk/2017/05/1504-autosave-v1/', 0, 'revision', '', 0),
	(1509, 2, '2017-05-11 14:37:29', '2017-05-11 14:37:29', '<p style="text-align: left;">A Fisk promove todos os anos um evento destinado aos alunos dos Cursos Kids e Teens intitulado de Fisk Shop, que consiste em uma feira de produtos Fisk que os alunos podem "comprar" com os Fisk Dollars acumulados ao longo do ano. Trata-se de um programa de incentivo que bonifica os alunos de acordo com o seu aproveitamento. Os que estudam mais, ganham mais Fisk Dollars e nesse dia podem aproveitar. Na Fisk é assim, desde cedo aprende-se que o caminho do esforço e dedicação aos estudos é o que trás mais recompensas na vida. Venha logo pra Fisk e participe do próximo Fisk Shop!</p>\r\n\r\n[ngg_images source="galleries" container_ids="43" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500" display_type="photocrati-nextgen_basic_thumbnails"]', 'FISK SHOP 2017 acontece!', '', 'publish', 'open', 'open', '', 'fisk-shop-acontece-nas-unidades-fisk', '', '', '2017-05-19 17:22:43', '2017-05-19 17:22:43', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=1509', 0, 'post', '', 0),
	(1510, 2, '2017-05-11 14:37:29', '2017-05-11 14:37:29', '<p style="text-align: left;">A Fisk promove todos os anos um evento destinado aos alunos dos Cursos Kids e Teens intitulado de Fisk Shop, que consiste em uma feira de produtos Fisk que os alunos podem "comprar" com os Fisk Dollars acumulados ao longo do ano. Trata-se de um programa de incentivo que bonifica os alunos de acordo com o seu aproveitamento. Os que estudam mais, ganham mais Fisk Dollars e nesse dia podem aproveitar. Na Fisk é assim, desde cedo aprende-se que o caminho do esforço e dedicação aos estudos é que o trás mais recompensas na vida. Venha logo pra Fisk e participe do próximo Fisk Shop!</p>', 'FISK SHOP acontece nas Unidades FISK!', '', 'inherit', 'closed', 'closed', '', '1509-revision-v1', '', '', '2017-05-11 14:37:29', '2017-05-11 14:37:29', '', 1509, 'http://dev.webfacetecnologia.com.br/fisk/2017/05/1509-revision-v1/', 0, 'revision', '', 0),
