	(1645, 2, '2017-05-19 17:22:48', '2017-05-19 17:22:48', '<p style="text-align: left;">A Fisk promove todos os anos um evento destinado aos alunos dos Cursos Kids e Teens intitulado de Fisk Shop, que consiste em uma feira de produtos Fisk que os alunos podem "comprar" com os Fisk Dollars acumulados ao longo do ano. Trata-se de um programa de incentivo que bonifica os alunos de acordo com o seu aproveitamento. Os que estudam mais, ganham mais Fisk Dollars e nesse dia podem aproveitar. Na Fisk é assim, desde cedo aprende-se que o caminho do esforço e dedicação aos estudos é o que trás mais recompensas na vida. Venha logo pra Fisk e participe do próximo Fisk Shop!</p>\r\n\r\n[ngg_images source="galleries" container_ids="43" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500" display_type="photocrati-nextgen_basic_thumbnails"]', 'FISK SHOP 2017 acontece!', '', 'inherit', 'closed', 'closed', '', '1509-autosave-v1', '', '', '2017-05-19 17:22:48', '2017-05-19 17:22:48', '', 1509, 'http://dev.webfacetecnologia.com.br/fisk/2017/05/1509-autosave-v1/', 0, 'revision', '', 0),
