	(1916, 2, '2017-10-09 14:13:25', '2017-10-09 14:13:25', 'A Escola Fisk Asa norte realizou nos últimos dias 04 e 05 de outubro, o Fisk Shop no Colégio Santa Dorotéia, onde a Fisk é parceira e ministra aulas em uma sala padronizada para alunos do Curso integral e regular. O Fisk Shop é uma feira de produtos Fisk onde os alunos podem "comprar" com os Fisk Dollars que acumularam durante um ano de estudo, ou seja é um programa de incentivo e reconhecimento que as Escolas Fisk Asa Norte, Asa sul e Taguatinga Norte fazem bonificando as alunos que estudaram muito e tiraram boas notas. Confira as fotos, foi pura alegria.\r\n\r\n[ngg_images source="galleries" container_ids="47" display_type="photocrati-nextgen_basic_thumbnails" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500"]', 'FISK SHOP NO COLÉGIO SANTA DOROTÉIA', '', 'inherit', 'closed', 'closed', '', '1896-revision-v1', '', '', '2017-10-09 14:13:25', '2017-10-09 14:13:25', '', 1896, 'http://dev.webfacetecnologia.com.br/fisk/2017/10/1896-revision-v1/', 0, 'revision', '', 0),
