	(2000, 2, '2017-11-01 15:15:56', '2017-11-01 15:15:56', 'Happy Halloween! As Escolas FISK Asa Norte, Asa sul e Taguatinga norte ficaram "horripilantes" com a temporada de bruxinhas, monstrinhos e fantasminhas que apareceram por lá. Foi muita brincadeira e alegria. Confira as fotos dos alunos, professores e funcionários! Have a spooky Halloween!\r\n\r\n[ngg_images source="galleries" container_ids="48" display_type="photocrati-nextgen_basic_thumbnails" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500"]', 'Halloween 2017 nas Escolas FISK!', '', 'publish', 'open', 'open', '', 'halloween-2017-nas-escolas-fisk', '', '', '2017-11-01 15:15:56', '2017-11-01 15:15:56', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=2000', 0, 'post', '', 0),
	(2001, 2, '2017-11-01 15:15:56', '2017-11-01 15:15:56', 'Happy Halloween! As Escolas FISK Asa Norte, Asa sul e Taguatinga norte ficaram "horripilantes" com a temporada de bruxinhas, monstrinhos e fantasminhas que apareceram por lá. Foi muita brincadeira e alegria. Confira as fotos dos alunos, professores e funcionários! Have a spooky Halloween!\r\n\r\n[ngg_images source="galleries" container_ids="48" display_type="photocrati-nextgen_basic_thumbnails" override_thumbnail_settings="0" thumbnail_width="100" thumbnail_height="75" thumbnail_crop="1" images_per_page="20" number_of_columns="0" ajax_pagination="0" show_all_in_lightbox="0" use_imagebrowser_effect="0" show_slideshow_link="1" slideshow_link_text="[Show as slideshow]" order_by="sortorder" order_direction="ASC" returns="included" maximum_entity_count="500"]', 'Halloween 2017 nas Escolas FISK!', '', 'inherit', 'closed', 'closed', '', '2000-revision-v1', '', '', '2017-11-01 15:15:56', '2017-11-01 15:15:56', '', 2000, 'http://dev.webfacetecnologia.com.br/fisk/2017/11/2000-revision-v1/', 0, 'revision', '', 0),
	(2002, 2, '2017-11-06 19:55:01', '2017-11-06 19:55:01', '<div dir="auto">\r\n\r\n<strong>2018 já chegou e que tal começar o ano novo matriculado no melhor Centro de Ensino do Brasil?&nbsp;</strong>\r\n\r\n<strong>&nbsp;Awesome!</strong>\r\n\r\n<strong>&nbsp;Isso mesmo, durante o mês de janeiro as Escolas Fisk Asa sul, Asa norte e Taguatinga norte estão oferendo até 20% de desconto para novos alunos.</strong>\r\n\r\n<strong>&nbsp;Não perca essa oportunidade e faça já a sua matrícula!</strong>\r\n\r\n<strong>Promoção por tempo limitado.&nbsp;</strong>\r\n\r\n</div>', 'Venha para a FISK e comece 2018 saindo na frente!', '', 'publish', 'open', 'open', '', 'venha-para-a-fisk-e-saia-na-frente-em-2018', '', '', '2018-01-16 11:45:34', '2018-01-16 11:45:34', '', 0, 'http://dev.webfacetecnologia.com.br/fisk/?p=2002', 0, 'post', '', 0),
